[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Count Louis I of Nassau-Weilburg (1473 – 28 May 1523) was a son of Count John III of Nassau-Weilburg and his wife, Elisabeth of Hesse. In 1492, Louis I succeeded his grandfather Philip II as Count of Nassau-Weilburg, because his father had already died in 1480. In 1502, Louis I married Margaret (1487-1548), a daughter of Adolf III of Nassau-Wiesbaden-Idstein. Louis and Margaret had the following children:', 'title': 'Louis I, Count of Nassau-Weilburg'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Frederick William, Prince of Nassau- Weilburg( 25 October 1768, The Hague – 9 January 1816, Weilburg) was a ruler of Nassau- Weilburg. In 1806 he was given the title of Prince of Nassau, while his cousin, Prince Frederick Augustus of Nassau- Usingen, became the Duke of Nassau. Frederick William died in January 1816, only two months before his cousin. Both men were succeeded by Frederick William's son, William.", 'title': 'Frederick William, Prince of Nassau-Weilburg'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'John III of Nassau-Weilburg (27 June 1441 – 15 July 1480) was count of Nassau-Weilburg as co-regent with his father. He came from the Walramian branch of the House of Nassau.', 'title': 'John III, Count of Nassau-Weilburg'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Albert of Nassau- Weilburg- Ottweiler( 26 December 1537, Weilburg – 11 November 1593, Ottweiler), was a Count of the House of Nassau. His territory included the areas around Weilburg, Ottweiler and Lahr in the Black Forest. Like his father, Philip III of Nassau- Weilburg he was an advocate of the Reformation.', 'title': 'Albert, Count of Nassau-Weilburg'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ernest Casimir of Nassau- Weilburg( 15 November 1607 – 16 April 1655) was the founder of the" younger" line of Nassau- Weilburg. He was a son of Louis II, Count of Nassau- Weilburg and his wife Anna Maria of Hesse- Kassel( 1567 – 1626).', 'title': 'Ernest Casimir, Count of Nassau-Weilburg'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Princess Therese Wilhelmine Friederike Isabelle Charlotte of Nassau- Weilburg,( Terezya Vasilyevna Nassauskaya; 17 April 1815 in Weilburg, Duchy of Nassau – 8 December 1871 in Prague, Kingdom of Bohemia, Austria – Hungary) was a member of the House of Nassau- Weilburg and a Princess of Nassau- Weilburg by birth. Through her marriage to Duke Peter of Oldenburg, Therese was also a Duchess of Oldenburg.', 'title': 'Princess Therese of Nassau-Weilburg'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Louis II of Nassau- Weilburg( 9 August 1565, Weilburg – 8 November 1627, Saarbrücken) was a count of Nassau- Weilburg.', 'title': 'Louis II, Count of Nassau-Weilburg'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Charles Christian, Prince of Nassau-Weilburg (Weilburg, 16 January 1735 – Münster-Dreissen, near Kirchheim, 28 November 1788), till 1753 Count of Nassau-Weilburg, was the first ruler of the Principality of Nassau-Weilburg between 1753 and 1788.', 'title': 'Charles Christian, Prince of Nassau-Weilburg'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Philip IV of Nassau- Weilburg, also known as Philip III of Nassau- Saarbrücken( 14 October 1542 in Weilburg – 12 March 1602 in Saarbrücken) was Count of Nassau- Weilburg from 1559 until his death and since 1574 also Count of Nassau- Saarbrücken. Both possessions belonged to the Walram line of the House of Nassau. In Weilburg, he was the fourth count named Philip, but only the third in Saarbrücken, because his father, Philip III of Nassau- Weilburg never held Nassau- Saarbrücken.', 'title': 'Philip IV, Count of Nassau-Weilburg'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Frederick Louis of Nassau- Ottweiler( 13 November 1651 – 25 May 1728) was a member of the House of Nassau.', 'title': 'Frederick Louis, Count of Nassau-Ottweiler'}]

