 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Madame Lu or Madame Lu, the Woman for Discreet Advice (German: Madame Lu, die Frau für diskrete Beratung) is a 1929 German silent film directed by Franz Hofer and starring Ida Wüst, Gerdi Gerdt and Hans Mierendorff. The film's art direction was by Leopold Blonder.", 'title': 'Madame Lu'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Brian Patrick Kennedy( born 5 November 1961) is an Irish- born art museum director who has worked in Ireland and Australia, and now lives and works in the United States. He is currently the director of the Peabody Essex Museum. He was the director of the Toledo Museum of Art in Ohio from 2010 to 2019. He was the director of the Hood Museum of Art from 2005 to 2010, and the National Gallery of Australia( Canberra) from 1997- 2004.', 'title': 'Brian Kennedy (gallery director)'}
