 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Franz Hofer (November 27, 1902 in Bad Hofgastein – February 18, 1975 in Mülheim an der Ruhr) was, in the time of the Third Reich, the Nazi Gauleiter of the Tyrol and Vorarlberg. As the Nazi party chief for the Tirol/Vorarlberg province he was the most powerful figure in the region. As the area\'s supreme Nazi, Hofer dealt directly with Hitler or with the Führer\'s deputy, Martin Bormann. Hofer was not only the party chief but the Reichskommissar in charge of the Tirol-Vorarlberg defences. His region embraced much of the suspected National Redoubt. Indeed, Hofer might well be considered the father of the Redoubt. Born to a Bad Hofgastein hotelkeeper, Hofer went to the Volksschule-Realschule in Innsbruck and in 1922 began a career as a freelance salesman. In September 1931, he joined the NSDAP. He very quickly rose in the Party, becoming District Leader in April 1932, and in July of the same year acting Gauleiter of the Tyrol. Only four months later, on 27 November 1932 – Hofer\'s thirtieth birthday – he was promoted to Gauleiter of the Tyrol. For his activities in the Nazi Party, which was banned in Austria, Hofer was arrested in June 1933 and sentenced by a Tyrolean court to two years in prison. On 30 August 1933, 4 armed SA men broke into Hofer\'s prison cell by force and freed him. He fled the prison amid gunfire, which wounded him. He made it to Italy, and only a few weeks later gave a speech at the Nuremberg Party Congress from his stretcher. In early 1937, having recovered from his gunshot wounds, Hofer became leader of the "Leaders\' and Members\' Political Gathering Place for Austrians in Germany", with a job in Berlin. After the Anschluss, he was once again appointed the Gauleiter of the Tyrol and Vorarlberg. In the same year, he was given the function of ministerial adviser and the rank of NSKK Obergruppenführer. On 1 September 1940 he was furthermore made the governor ("Reichsstatthalter") of the "Reichsgau" of Tyrol-Vorarlberg. After Italy forsook the Axis Powers, Hofer was chosen on 10 September 1943 to be the Supreme Commissar in the Operation Zone of the Alpine Foothills (consisting of the neighbouring Italian provinces of Belluno, South Tyrol and Trentino joined to his own Reichsgau of Tyrol-Vorarlberg). Gauleiter Hofer was an accomplished marksman who often competed in regional and national shooting matches. In 1944 Hofer won a shooting competition in the city of Bolzano, qualifying him for the national competition which was held in Innsbruck that year. Using a specially crafted 22 cal Mauser rifle (serial #300354) Hofer finished 7th. In November 1944, Hofer suggested in a memorandum to Adolf Hitler that an Alpenfestung ("Alpine Fortress") ought to be built up in the heart of the Alps as Nazi Germany\'s last bastion. Apparently Hitler\'s secretary Martin Bormann only brought this document to the Führer\'s attention early the next year. Hofer had a personal audience with Hitler in late January 1945. \' Hofer reminded the German leader that the Allies dreaded the thought of continued fighting from an Alpenfestung. Considering the fact that the Ardennes Offensive had failed, Hitler was receptive to such an idea. The German leader authorized preparations to fortify the Alps. \'Hofer and his team actually started work on this in mid-February. Hofer was called to Hitler\'s Berlin bunker again on 12 April 1945 to discuss further his proposal. Hitler – 18 days before his own suicide and still convinced that his "Endsieg" was possible – again approved Hofer\'s ongoing plan and appointed him Reich Defence Commissar of the "Alpenfestung". On May 3, 1945 Hofer surrendered to American troops. This surrender was achieved by OSS agent Frederick Mayer. It was not long before Hofer\'s freedom was curtailed. On 6 May 1945, he was arrested by the United States Army in Hall in Tirol and held in an internment camp. In 1948, he managed to flee to Germany, where he continued his former trade as a salesman in Mülheim, in the end under his true name. In Austria in June 1949, Hofer was sentenced to death "in absentia". In July 1953, a Munich appeal court upheld a sentence of 3 years and 5 months in labour prison. When interviewed by the press during this time, Hofer made it known he was unrepentant about his National Socialist convictions. In 1964, a lawsuit brought by Hofer\'s children for the return of ownership of the "Lachhof bei Hall" where their father had lived while he was the Gauleiter, was dismissed by an Austrian court. Hofer spent his later years in Mülheim an der Ruhr with his wife and seven children, continued his former trade as a salesman and died a natural death on February 18, 1975, under his real name.', 'title': 'Franz Hofer'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'John Coleman( born 12 October 1962) is an English football manager and former player. He is the manager of League One side Accrington Stanley.', 'title': 'John Coleman (footballer, born 1962)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'David John Coleman( 27 March 1942 – 23 September 2016) was an English footballer who played in the Football League as a forward for Colchester United.', 'title': 'David Coleman (footballer, born 1942)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'John Coleman Calhoun (March 1871 – September 28, 1950) was a politician in Alberta, Canada and a municipal councillor in Edmonton.', 'title': 'John Coleman Calhoun'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Edgar Rice Burroughs (September 1, 1875 – March 19, 1950) was an American fiction writer best known for his celebrated and prolific output in the adventure and science-fiction genres. Among the most notable of his creations are the jungle hero Tarzan, the heroic Mars adventurer John Carter, and the fictional landmass within Earth known as Pellucidar. Burroughs' California ranch is now the center of the Tarzana neighborhood in Los Angeles.", 'title': 'Edgar Rice Burroughs'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'John Coleman( born in Ireland), is an Irish rugby league footballer for the Sheffield Eagles in the Co-operative Championship. He plays on the. He is a current Ireland international.', 'title': 'John Coleman (rugby league)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'John Coleman VC( 1821 – 22 May 1858) was an English recipient of the Victoria Cross, the highest and most prestigious award for gallantry in the face of the enemy that can be awarded to British and Commonwealth forces. He was a native of Norwich.', 'title': 'John Coleman (VC)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'John Coleman "Jack" Burroughs (28 February 1913 – 22 February 1979) was an American illustrator known for his illustrations of the works of his father, Edgar Rice Burroughs.', 'title': 'John Coleman Burroughs'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Daigo's reign spanned the years from 897 through 930. He is named after his place of burial.", 'title': 'Emperor Daigo'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Ancient Egyptian artisan Sennedjem lived in Set Maat( translated as" The Place of Truth"), contemporary Deir el- Medina, on the west bank of the Nile, opposite Thebes, during the reigns of Seti I and Ramesses II. Sennedjem had the title" Servant in the Place of Truth". He was buried along with his wife, Iyneferti, and family in a tomb in the village necropolis. His tomb was discovered January 31, 1886. When Sennedjem\'s tomb was found, in it there was regular furniture from his home, including a stool and a bed, which he actually used when he was alive. His titles included Servant in the Place of Truth, meaning that he worked on the excavation and decoration of the nearby royal tombs.', 'title': 'Sennedjem'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'John Coleman Pickett( September 3, 1896 – September 1, 1983) was a United States Circuit Judge of the United States Court of Appeals for the Tenth Circuit.', 'title': 'John Coleman Pickett'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Etan Boritzer( born 1950) is an American writer of children ’s literature who is best known for his book" What is God?" first published in 1989. His best selling" What is?" illustrated children\'s book series on character education and difficult subjects for children is a popular teaching guide for parents, teachers and child- life professionals. Boritzer gained national critical acclaim after" What is God?" was published in 1989 although the book has caused controversy from religious fundamentalists for its universalist views. The other current books in the" What is?" series include What is Love?, What is Death?, What is Beautiful?, What is Funny?, What is Right?, What is Peace?, What is Money?, What is Dreaming?, What is a Friend?, What is True?, What is a Family?, What is a Feeling?" The series is now also translated into 15 languages. Boritzer was first published in 1963 at the age of 13 when he wrote an essay in his English class at Wade Junior High School in the Bronx, New York on the assassination of John F. Kennedy. His essay was included in a special anthology by New York City public school children compiled and published by the New York City Department of Education. Boritzer now lives in Venice, California and maintains his publishing office there also. He has helped numerous other authors to get published through" How to Get Your Book Published!" programs. Boritzer is also a yoga teacher who teaches regular classes locally and guest- teaches nationally. He is also recognized nationally as an erudite speaker on" The Teachings of the Buddha."', 'title': 'Etan Boritzer'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Ian Barry is an Australian director of film and TV.', 'title': 'Ian Barry (director)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Glynn Russell Turman( born January 31, 1947) is an American stage, television, and film actor as well as a writer, director, and producer. Turman is known for his roles as Lew Miles on the prime- time soap opera" Peyton Place"( 1968 – 69), high school student Leroy" Preach" Jackson in the 1975 coming- of- age film" Cooley High", math professor and retired Army colonel Bradford Taylor on the NBC sitcom" A Different World"( 1988 – 93), and fictional Baltimore mayor Clarence Royce on the HBO drama series" The Wire". He recently portrayed Jeremiah Kaan on the Showtime series" House of Lies".', 'title': 'Glynn Turman'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Cooley High is a 1975 American coming-of-age comedy-drama film that follows the narrative of high school seniors and best friends, Leroy "Preach" Jackson (Glynn Turman) and Richard "Cochise" Morris (Lawrence Hilton-Jacobs). Written by Eric Monte, directed by Michael Schultz and produced by American International Pictures (AIP), the film, primarily shot in Chicago, Illinois, was a major hit at the box offices, grossing over $13,000,000 (USD). The light-hearted turned tragic storyline captivated viewers with its comedic portrayal of carefree best friends, and its soundtrack featured many Motown hits.', 'title': 'Cooley High'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Terence D. Robinson( date of birth and death unknown) was a male wrestler who competed for England.', 'title': 'Terence Robinson'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Brian Saunders( date of birth and death unknown) was a male weightlifter who competed for England.', 'title': 'Brian Saunders (weightlifter)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Peter Levin is an American director of film, television and theatre.', 'title': 'Peter Levin'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Eric Monte( born Kenneth Williams; December 25, 1943) is an American screenwriter who has written for and created notable shows depicting 1970s African- American culture, most notably" Good Times The Jeffersons", and" What\'s Happening!!" as well as 1975\'s coming of age film" Cooley High", which was based on his high school experience.', 'title': 'Eric Monte'}
