[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Alexander Friedrich Fürst von Lieven (Alexander Karlovich Liven; 1801–1880) was a Baltic German infantry-general and senator. Alexander von Lieven was born on January 14, 1801, into an ancient noble family of Lieven. He received a good education at home and in 1818 enrolled into the Life Guards Grenadeer regiment and in 1820 was promoted to the rank of lieutenant . Four years later, in 1824, Lieven was transferred into the Moscow regiment and was promoted to the rank of aide-de-camp to the Emperor Nicholas I of Russia. During the campaign of the Russo-Turkish War, 1828–1829, Alexander Lieven participated in the siege of Varna. In 1831, during the November Uprising, his regiment was sent to subdue the rebels in the Congress Poland, and took part in the siege of Warsaw and Modlin Fortress. In 1832, after the war was over he was promoted to the rank of colonel and transferred into the Leib Guards of Preobrazhensky regiment. In 1838, he was made aide-de-camp to the commander of the 5th Infantry Corps, Lieutenant-General Anders, in 1842 Lieven was promoted to the rank of mayor-general and received the position of the second commander of Sevastopol. In 1844–1853 Lieven was Governor of Taganrog. In 1853, Lieven was promoted to the rank of lieutenant-general and was made senator. In 1857 he was appointed Chairman of the Inspection Committee  in Moscow. In 1861 he was appointed full member of the Imperial Philanthropic Society  and president of its Moscow-based committee. Lieven was promoted to the rank of the infantry general in 1875, keeping his senator's title. He died on February 17, 1880.", 'title': 'Alexander Friedrich von Lieven'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Heinz Lieven( born April 18, 1928) is a German actor.', 'title': 'Heinz Lieven'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'John Templeton( 1766–1825) was an early Irish naturalist and botanist. He is often referred to as the" Father of Irish Botany". He was the father of naturalist, artist and entomologist Robert Templeton.', 'title': 'John Templeton (botanist)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Albert Lieven( born Albert Fritz Liévin; 22 June 1906 – 22 December 1971) was a German actor.', 'title': 'Albert Lieven'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Dominic Lieven( born 19 January 1952) is a research professor at Cambridge University( Senior Research Fellow, Trinity College) and a Fellow of the British Academy and of Trinity College, Cambridge.', 'title': 'Dominic Lieven'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Milomir Odović( born 26 March 1955) is a Bosnian football manager and former professional football player. Milomir is the son of Jelena" Jela" Odović( 1930 – 17 August 2018), who died at the age of 88.', 'title': 'Milomir Odović'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Arthur Beauchamp( 1827 – 28 April 1910) was a Member of Parliament from New Zealand. He is remembered as the father of Harold Beauchamp, who rose to fame as chairman of the Bank of New Zealand and was the father of writer Katherine Mansfield.', 'title': 'Arthur Beauchamp'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Jelena Lieven (1842–1917), was an Imperial Russian pedagogue. She was the principal of the Smolny Institute in Saint Petersburg in 1895–1917. Daughter of Alexander Lieven. Jelena Lieven was not formally educated but received a very high level of education through Autodidacticism. She was early active with her mother as a philanthropist. She never married, and after having received a very small inheritance after her father's death in 1880 she asked the Imperial family for a position. She was made manager of the home for the orphans of officers and in 1895 as principal for the Smolny Institute. She reformed the hygiene, introduced electricity (1909), granted the students leaser time by cutting their study time by half, gave craftsmanship and physical education a greater role and made a fund for the support of former students after graduation (1898). She died during the Russian Revolution, and the students of the institute was evacuated.", 'title': 'Jelena Lieven'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Cleomenes II( died 309 BC) was Agiad King of Sparta from 369 to 309 BC. The son of Cleombrotus I, he succeeded his brother Agesipolis II. He was the father of Acrotatus I, the father of Areus I, and of Cleonymus, the father of Leonidas II.', 'title': 'Cleomenes II'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'He was the father of Obata Masamori.', 'title': 'Obata Toramori'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Tjuyu( sometimes transliterated as Thuya or Thuyu) was an Egyptian noblewoman and the mother of queen Tiye, and the wife of Yuya. She is the grandmother of Akhenaten, and great grandmother of Tutankhamun.', 'title': 'Tjuyu'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Henry IV of Bar( abt 1315 – 1344) was count of Bar from 1336 to 1344. His aunt, Joan of Bar, Countess of Surrey, governed Bar in his name during his minority. He was the son of Edward I of Bar and his wife Marie of Burgundy. He married Yolande of Dampierre( died 1395), a granddaughter of Robert III, Count of Flanders. Henry and Yolande had two sons:', 'title': 'Henry IV, Count of Bar'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Hubba bint Hulail was the grandmother of Hashim ibn\' Abd Manaf, thus the great- great- great- grandmother of the Islamic" Nabī"( Prophet) Muhammad ibn Abdullah.', 'title': 'Hubba bint Hulail'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'After the elections of 2009, she became more widely known as the grandmother of Prime Minister Yukio Hatoyama and his politician brother Kunio Hatoyama.', 'title': 'Kaoru Hatoyama'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Edward II of Bar( 1339 – May 1352) was Henry IV of Bar's eldest son and successor as count of Bar( with Edward's mother Yolande of Flanders ruling as count during his minority, which ended on 10 October 1349). He had no male issue and was succeeded as count by his younger brother Robert I of Bar.", 'title': 'Edward II, Count of Bar'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Joan of Bar( died 1361) was a French- English noble. She acted as regent of the County of Bar from 1344 until 1353. She was a daughter of Henry III, Count of Bar and Eleanor of England, and niece of Edward II of England. She was unhappily married to John de Warenne, 7th Earl of Surrey. In 1345, Joan became the regent of Bar for her great- nephew Robert.', 'title': 'Joan of Bar, Countess of Surrey'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Hannah Arnold, also known as Hannah Waterman King, was the grandmother of Benedict Arnolds children.', 'title': 'Hannah Arnold'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Margaret of Bar( 1220–1275) was a daughter of Henry II of Bar and his wife Philippa of Dreux. She was Countess of Luxembourg by her marriage to Henry V of Luxembourg. She is also known as" Marguerite of Bar".', 'title': 'Margaret of Bar'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Sophie of Bar (c. 1004 or 1018 – January 21 or June 21, 1093) was sovereign Count of Bar and lady of Mousson between 1033 and 1093. She succeeded her brother, Frederick III, Duke of Upper Lorraine, ruled in co-regency with her spouse Louis, Count of Montbéliard, and was succeeded by her son Frederick of Montbéliard.', 'title': 'Sophie, Countess of Bar'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Frederick II (c. 995–1026), son of Thierry I of the House of Ardennes and Richilde von Blieskastel, daughter of Folmar III, Count in Bliesgau; was the count of Bar and duke of Lorraine, co-reigning with his father from 1019. On the Emperor Henry II's death in 1024, he joined Ernest II, Duke of Swabia, in revolt against the new king, Conrad II. Soon they made peace and recognised the new king. Frederick died soon after. He married Matilda of Swabia, daughter of Herman II, Duke of Swabia, and sister-in-law of Conrad. They had three children:", 'title': 'Frederick II, Duke of Upper Lorraine'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Hell's House is a 1932 American Pre -Code drama film starring Junior Durkin, featuring Bette Davis and directed by Howard Higgin. The screenplay by Paul Gangelin and B. Harrison Orkow, set during the waning days of the Prohibition era, is based on a story by Higgin.", 'title': "Hell's House"}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Prakash Mehra( 13 July 1939 – 17 May 2009) was an Indian film director and producer known for his blockbuster Hindi films. He was one of the pioneers of masala films, along with Nasir Hussain, and Manmohan Desai. His collaborations with the actor Amitabh Bachchan resulted in several box office blockbusters and classics, due to which Mehra was considered among the' Golden Directors' of his time.", 'title': 'Prakash Mehra'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ben Palmer is a British film and television director who is known for being the director of" Bo\' Selecta" and" The Inbetweeners".', 'title': 'Ben Palmer'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Muqaddar Ka Faisla is a 1987 Indian Bollywood film directed by Prakash Mehra and produced by Yash Johar. It stars Raaj Kumar, Raakhee, Raj Babbar, Meenakshi Seshadri, Tina Munim and Pran in pivotal roles.', 'title': 'Muqaddar Ka Faisla'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Hell House is a 2002 documentary that was directed by George Ratliff that focuses on the idea of a hell house, a Christian- themed haunted attraction, in Cedar Hill, Texas. The film follows the youth group of the Cedar Hill Trinity Church, documenting the work involved in creating the hell house, the performances themselves, and the personal lives of some of the participants.', 'title': 'Hell House (film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Legend of Hell House is a 1973 British supernatural horror film directed by John Hough and based on the novel" Hell House" by Richard Matheson, who also wrote the screenplay. The film stars Pamela Franklin, Roddy McDowall, Clive Revill, and Gayle Hunnicutt as a group of researchers who spend a week in a purportedly haunted English mansion in which previous investigators were killed.', 'title': 'The Legend of Hell House'}
