 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Tom Madsen( Dutch Harbor) Airport is a state owned, public use airport in City of Unalaska, on Amaknak Island in the Aleutian Islands, off the coast of the U.S. state of Alaska. It is located near the Bering Sea coast of Unalaska Island, southwest of Anchorage and from Seattle. The official name of the City of Unalaska\'s port is Dutch Harbor. That name is also applied to the portion of Unalaska on Amaknak Island, which is located across a bridge from the rest of the city on Unalaska Island. Therefore, the airport is sometimes referred to as Dutch Harbor Airport. In 2002, the State of Alaska renamed it Tom Madsen Airport in honor of Charles Thomas Madsen Sr., a bush pilot who was killed in an airplane accident that year. However, the Federal Aviation Administration still refers to it as Unalaska Airport. Scheduled commercial airline service is provided by PenAir, a code share partner of Alaska Airlines. At one point Alaska Airlines operated Boeing 737- 200 Combi jetliners to the airport with these aircraft transporting a combination of passengers and freight on the main deck of the aircraft. However, due to load restrictions as a result of the short runway as well as cancellations due to weather, Alaska Airlines then contracted the service via a code sharing arrangement to PenAir in 2004. PenAir currently operates Saab 340 and Saab 2000 regional turboprop aircraft into the airport. AirPac also previously served the airport with British Aerospace BAe 146-100 jets with this aircraft type having enhanced short runway takeoff and landing performance. The airfield runway is 4,100 feet long which is quite short for jet operations when compared with typical runways normally used by mainline jet aircraft. Other airlines that served the airport in the past included MarkAir operating Boeing 737- 200 Combi jet aircraft and Reeve Aleutian Airways flying Lockheed L- 188 Electra turboprops via a code sharing agreement with Alaska Airlines. As per Federal Aviation Administration records, the airport had 28,234 passenger boardings( enplanements) in calendar year 2008, 26,705 enplanements in 2009, and 26,711 in 2010. It is included in the National Plan of Integrated Airport Systems for 2011– 2015, which categorized it as a" primary commercial service" airport( more than 10,000 enplanements per year).', 'title': 'Unalaska Airport'}
