[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Brigadier Simon Joseph Fraser, 14th Lord Lovat and 3rd Baron Lovat, (25 November 1871 – 18 February 1933), was a leading Roman Catholic aristocrat, landowner, forester, soldier, politician and the 23rd Chief of Clan Fraser. He was the son of Simon Fraser, 13th Lord Lovat, and Alice Mary Weld-Blundell. While legally the 14th Lord Lovat (and 3rd Baron Lovat), he was referred to as the 16th Lord.', 'title': 'Simon Fraser, 14th Lord Lovat'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Thomas Fraser, 10th Lord Lovat( 1631 – 1699), was a younger son of Hugh, 6th Lord Lovat( 1591 – 1646), hereditary chief of the Clan Fraser. He was known as Thomas of Beaufort, which marked him as the belonging to the second line of the family tree after the chiefly family, the Lovats. As an eighteen year old, he led 1000 Fraser men in support of the deposed Stuarts in a battle with Oliver Cromwell ’s army in 1651 at the Battle of Worcester. Losing, he was kept in jail at Inverness for several years. Eventually released, he married Sybilla McLeod, the daughter of John McLeod, chief of the Clan McLeod. They had fourteen children together, although nine died in childhood. The eldest son, Alexander( 1664- 1689), died of wounds while leading Frasers in support of the deposed Stuart King James II forces at the Battle of Killiecrankie. Described as thoughtful and scholarly, he became the 10th Lord Lovat in 1696 following the death of his cousin Hugh, 9th Lord Lovat, whose only infant son had predeceased him in the same year. Thomas was not able to enjoy his title and estates for long, since he was placed under sentence of death for the reckless behaviour of his son Simon in 1697. This included Simon threatening to hang the son of a noble, and his forced marriage and rape of Hugh ’s widow, Amelia Murray. As a result, both Thomas and his son were forced to flee the ancestral home of the Lovat Frasers, Dounie Castle, and take refuge in the highlands. Thomas died at Dunvegan Castle on Skye at the age of 69. He was buried there, but his son Simon, who eventually became the 11th Lord Lovat, made amends for his father's exile by placing a large memorial stone for him at Wardlaw Mausoleum, near Beauly.", 'title': 'Thomas Fraser, 10th Lord Lovat'}
