 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Thomas Alexander Fraser, 12th Lord Lovat and 1st Baron Lovat, KT( 17 June 1802 – 28 June 1875) was a Scottish peer. He was also the 21st MacShimidh, the traditional Gaelic Patronym for the Chiefs of the Clan Fraser. In 1815, upon the death of Archibald Campbell Fraser( who outlived all of his children), Fraser became the 21st Chief of the Clan Fraser, through his descent from the second son of the 4th Lord Lovat. He also inherited the Lovat estates at Beauly in Inverness- shire. On 28 January 1837 he was created Baron Lovat, of Lovat in the County of Inverness, in the Peerage of the United Kingdom. In 1854, the attainder of the 11th Lord Lovat( who had been attainted and executed in 1747) was reversed, and Lovat thereby became 12th Lord Lovat in the Peerage of Scotland. He notably served as Lord Lieutenant of Inverness from 1853 to 1873 and was made a Knight of the Thistle in 1865. Lord Lovat married Charlotte Georgina Stafford- Jerningham, the daughter of George William Stafford- Jerningham, 8th Baron Stafford, in 1823. He died in June 1875, aged 73, and was succeeded in his titles by his son Simon. Lady Lovat died in 1876. The couple had three daughters and four sons. Lord Lovat's legacy is that of the present 16th Lord Lovat, and the good standing of the present Clan Fraser. He completed the restoration of Lovat titles and lands, which had been started by the 11th Lord's son, General Simon Fraser of Lovat.", 'title': 'Thomas Fraser, 12th Lord Lovat'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Simon Fraser, 13th Lord Lovat and 2nd Baron Lovat (21 December 1828 – 6 September 1887), was a Scottish peer. While legally the 13th Lord, he was referred to as the 15th Lord Lovat. Lovat was the son of Thomas Alexander Fraser, 12th Lord Lovat, and Charlotte Georgina Stafford-Jerningham. He succeeded his father in 1875. Lord Lovat resided at Beaufort Castle, and was the 22nd Chief of the Clan Fraser, or "MacShimidh". He also served as Lord Lieutenant of Inverness between 1873 and 1887. Lord Lovat married Alice Mary Weld-Blundell, daughter of Thomas Weld-Blundell, in 1866. He died in September 1887, aged 58, and was succeeded by his son Simon. Lady Blundell survived her husband by over fifty years and died in 1938, aged 92. They had nine children.', 'title': 'Simon Fraser, 13th Lord Lovat'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Honor Fraser( born 1973) is a Scottish art dealer in California and a former fashion model. She is the sister of the 16th Lord Lovat and was brought up at the family seat Beaufort Castle in Scotland. Fraser is the granddaughter of British Commando Simon Fraser, 15th Lord Lovat, and sister of the current Lord Lovat, chief of Clan Fraser of Lovat. She was born and brought up at the clan seat, Beaufort Castle. She left St. Mary\'s Calne College with three\' A\' levels. After school she began an internship at British Vogue, where it was suggested that she try modelling. Fraser was the cover girl on the Bryan Ferry& Roxy Music compilation album" More Than This", released in 1995. Her first magazine cover was for French" Elle"( 11 March 1996). From 1997- 2002, she wrote a column for the Scottish magazine" Spectrum". Fraser married Stavros Merjos in 2004. She lives in Marina del Rey, California, and owns an art gallery, Honor Fraser Inc., in Los Angeles.', 'title': 'Honor Fraser'}
