 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Henry Ford II( September 4, 1917 – September 29, 1987), sometimes known as" HF2" or" Hank the Deuce", was the eldest son of Edsel Ford and eldest grandson of Henry Ford. He was president of the Ford Motor Company from 1945 to 1960, chief executive officer( CEO) from 1945 to 1979, and chairman of the board of directors from 1960 to 1980. Notably, under the leadership of Henry Ford II, Ford Motor Company became a publicly traded corporation in 1956. From 1943 to 1950, he also served as president of the Ford Foundation.', 'title': 'Henry Ford II'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Henry Ford (July 30, 1863 – April 7, 1947) was an American industrialist and a business magnate, the founder of the Ford Motor Company, and the sponsor of the development of the assembly line technique of mass production. Although Ford did not invent the automobile or the assembly line, he developed and manufactured the first automobile that many middle-class Americans could afford. In doing so, Ford converted the automobile from an expensive curiosity into a practical conveyance that would profoundly impact the landscape of the 20th century. His introduction of the Model T automobile revolutionized transportation and American industry. As the owner of the Ford Motor Company, he became one of the richest and best-known people in the world. He is credited with "Fordism": mass production of inexpensive goods coupled with high wages for workers. Ford had a global vision, with consumerism as the key to peace. His intense commitment to systematically lowering costs resulted in many technical and business innovations, including a franchise system that put dealerships throughout most of North America and in major cities on six continents. Ford left most of his vast wealth to the Ford Foundation and arranged for his family to control the company permanently.\nFord was also widely known for his pacifism during the first years of World War I, and for promoting antisemitic content, including "The Protocols of the Elders of Zion", through his newspaper "The Dearborn Independent" and the book "The International Jew", having an alleged influence on the development of Nazism and Adolf Hitler.', 'title': 'Henry Ford'}
