 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Edsel Bryant Ford (November 6, 1893 – May 26, 1943) was the son of Clara Jane Bryant Ford and the only child of Henry Ford. He was the president of Ford Motor Company from 1919 until his death in 1943. His eldest son was Henry Ford II. He worked closely with his father, as sole heir to the business, but was keen to develop cars more exciting than the Model T ("Tin Lizzie"), in line with his personal tastes. Even as president, he had trouble persuading his father to allow any departure from this formula. Only a change in market conditions enabled him to develop the more fashionable Model A in 1927. Edsel also founded the Mercury division and was responsible for the Lincoln Zephyr and Lincoln Continental. He introduced important features, such as hydraulic brakes, and greatly strengthened the company\'s overseas production. Ford was a major art benefactor in Detroit and also financed Admiral Richard Byrd\'s polar explorations. He died of stomach cancer aged 49, with his father resuming the presidency of the company, before handing it over to Henry Ford II.', 'title': 'Edsel Ford'}
