[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Thankmar (or Tammo) (c. 908 – 28 July 938) was the eldest (and only) son of Henry I of Germany by his first wife, Hatheburg of Merseburg (or Liutgard). His mother had been previously married and widowed, after which she entered a convent. Because she left the convent to marry Henry, her second marriage was considered invalid and the couple split. Thankmar's legitimacy was, therefore, in question. In 929, Henry I arranged for his succession and had the arrangement ratified by an assembly at Erfurt, just before his death. After his death, his lands and wealth were divided between his four sons: Thankmar, Otto, Henry, and Bruno. Otto, however, was designated by his father to receive the crown. The only succession dispute was between Otto and his younger full brother Henry, who was kept under house arrest in Bavaria during Otto's coronation. After the death of his cousin, Siegfried, Count of Merseburg (they were related in the maternal line), in 937, Thankmar claimed Merseburg. Otto, however, appointed Gero, Siegfried's brother. During this dispute, Eberhard of Franconia and Wichmann the Elder revolted against Otto and Thankmar joined them. Later, Thankmar was besieged in Eresburg. He was killed by a spear thrown through the window of the church of Saint Peter, while he was seeking refuge inside.", 'title': 'Thankmar'}
