 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Henry Ι the Fowler (or) (876 – 2 July 936) was the duke of Saxony from 912 and the elected king of East Francia from 919 until his death in 936. As the first non-Frankish king of East Francia, he established the Ottonian dynasty of kings and emperors, and he is generally considered to be the founder of the medieval German state, known until then as East Francia. An avid hunter, he obtained the epithet "the Fowler" because he was allegedly fixing his birding nets when messengers arrived to inform him that he was to be king. He was born into the Liudolfing line of Saxon dukes. His father Otto I of Saxony died in 912 and was succeeded by Henry. The new duke launched a rebellion against the king of East Francia, Conrad I of Germany, over the rights to lands in the Duchy of Thuringia. They reconciled in 915 and on his deathbed in 918, Conrad recommended Henry as the next king, considering the duke the only one who could hold the kingdom together in the face of internal revolts and external Magyar raids. Henry was elected and crowned king in 919. He went on to defeat the rebellious dukes of Bavaria and Swabia, consolidating his rule. Through successful warfare and a dynastic marriage, Henry acquired Lotharingia as a vassal in 925. Unlike his Carolingian predecessors, Henry did not seek to create a centralized monarchy, ruling through federated autonomous stem duchies instead. Henry built an extensive system of fortifications and mobile heavy cavalry across Germany to neutralize the Magyar threat and in 933 routed them at the Battle of Riade, ending Magyar attacks for the next 21 years and giving rise to a sense of German nationhood. Henry greatly expanded German hegemony in Europe with his defeat of the Slavs in 929 at the Battle of Lenzen along the Elbe river, by compelling the submission of Duke Wenceslaus I of Bohemia through an invasion of the Duchy of Bohemia the same year and by conquering Danish realms in Schleswig in 934. Henry\'s hegemonic status north of the Alps was acknowledged by King Rudolph of West Francia and King Rudolph II of Upper Burgundy, who both accepted a place of subordination as allies in 935. Henry planned an expedition to Rome to be crowned emperor by the pope, but the design was thwarted by his death. Henry prevented a collapse of royal power, as had happened in West Francia, and left a much stronger kingdom to his successor Otto I. He was buried at Quedlinburg Abbey, established by his wife Matilda in his honor.', 'title': 'Henry the Fowler'}
