 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Ella Marija Lani Yelich-O\'Connor (born 7 November 1996), known professionally as Lorde (pronounced "lord"), is a New Zealand singer and songwriter. Taking inspiration from aristocracy for her stage name, she is known for employing unconventional musical styles and thoughtful songwriting. Born in the Auckland suburb of Takapuna and raised in neighbouring Devonport, Lorde expressed interest in performing at local venues in her early teens. She signed with Universal Music Group in 2009 and collaborated with producer Joel Little in 2011 to start recording material. Universal Music commercially released the pair\'s first collaborative effort, an extended play (EP) titled "The Love Club", in 2013. The EP\'s international chart-topping single "Royals" helped Lorde rise to prominence. Her debut studio album "Pure Heroine" followed that year and achieved critical and commercial success. The following year, Lorde curated for the 2014 film  and recorded several tracks, including the single "Yellow Flicker Beat". Her second studio album "Melodrama" (2017) garnered widespread acclaim and debuted at number one in the United States. Lorde\'s music is primarily electropop and contains elements of subgenres such as dream pop and indie-electro. Her accolades include two Grammy Awards, two Brit Awards and a Golden Globe nomination. She appeared in "Time"s list of the most influential teenagers in 2013 and 2014, and the 2014 edition of "Forbes" 30 Under 30. In addition to her solo work, she has co-written songs for other artists, including Broods, Ariana Grande, and Bleachers. As of June 2017, Lorde has sold over five million albums worldwide.', 'title': 'Lorde'}
