 {'idx': 8, 'is_supporting': True, 'paragraph_text': '"Hard Feelings/Loveless" is a medley song recorded by New Zealand singer-songwriter Lorde for her second album, "Melodrama" (2017). She wrote and co-produced the track with Jack Antonoff, with additional production from Frank Dukes. It draws influences from genres such as industrial music, noise music, and electronica and uses a distorted synthesizer. " Loveless" includes two samples: the first two lines of the song are taken from a documentary about Paul Simon\'s album "Graceland" (1986), and the transitional drum solo was from Phil Collins\' 1981 song " In the Air Tonight". The lyrics detail the emotions of falling out of love while mocking the current generation\'s lengths to pretend to be unaffected by love. The song received positive reviews from music critics, many of whom praised the song\'s lyrics and production. The lyrics were compared to the 1987 psychological thriller film "Fatal Attraction", while its production was likened to Kanye West\'s work on "Yeezus" (2013). The track\'s themes center on the effects of heartbreak and social issues around love. Lorde performed "Hard Feelings/Loveless", with six other songs, as part of a re-imagined Vevo series at the Electric Lady Studios where she recorded most of her album. It was also part of the set list of her Melodrama World Tour (2017–18).', 'title': 'Hard Feelings/Loveless'}
