[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Santosham( English translation:" Happiness") is a Telugu romantic comedy film produced by Dr. K. L. Narayana under the Sri Durga Arts banner, directed by Dasharath. The film stars Nagarjuna Akkineni and Shriya Saran making her second release in Telugu after" Ishtam" in lead with Gracy Singh making her debut in the Telugu cinema industry after her lead role in the Hindi film" Lagaan", while Prabhu Deva makes his comeback to Telugu cinema after a long gap in an extended cameo appearance. The music was composed by R. P. Patnaik. The movie was well received by critics and successful at the box office. It borrowed shades of the Hindi movie" Kuch Kuch Hota Hai". It was dubbed in Tamil as" Santhosha Vanille" and was also dubbed in Hindi as" Pehli Naazar ka Pehla Pyaar". The film was remade in Bengali as" Bandhan", starring Jeet and Koyel and in Kannada as" Ugadi", with V. Ravichandran. The film was recorded as a" Super Hit" at the box office.', 'title': 'Santosham (2002 film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Raja Hindustani is a 1996 Indian Hindi- language romantic drama film directed by Dharmesh Darshan. It tells the story of a cab driver from a small town who falls in love with a rich young woman. Aamir Khan and Karisma Kapoor play the lead roles. Released on 15 November 1996, this film\'s plot was inspired from the 1965 film" Jab Jab Phool Khile", starring Shashi Kapoor and Nanda. The film\'s music was composed by Nadeem- Shravan, with lyrics by Sameer. It went on to win five Filmfare Awards, including the awards for Best film and Best Actors, and seven Screen Awards. " Raja Hindustani" was the third most commercially successful Hindi film of the 1990s in terms of net gross. Made on a budget of 57.5 million, the film went on to gross 763.4 million worldwide, becoming the highest- grossing film of the year, and the fourth highest- grossing film in India of the 1990s behind" Hum Aapke Hain Koun ..! Dilwale Dulhania Le Jayenge" and" Kuch Kuch Hota Hai". The film\'s music became popular and was successful, especially in the central and eastern states of India. Karisma Kapoor was complimented for her looks and performance as Aarti: a rich, beautiful, sensitive, young woman full of dreams and desires. It is Kapoor\'s biggest commercial success till date and is regarded as one of her best performances; it was a major turning point in her career. She won the Filmfare Best Actress Award for her role. The chemistry between the lead pair of Aamir Khan and Karishma Kapoor was praised and there was a much talked about kissing scene. The film was remade in Kannada as" Naanu Naane" in 2002, starring Upendra and Sakshi Shivanand in lead roles and in Odia as" Priya Mo Priya" in 2005.', 'title': 'Raja Hindustani'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Kuch Kuch Hota Hai ( English:" Something ... Something Happens") also known as KKHH, is a 1998 Indian Hindi- language romantic drama film, released in India and the United Kingdom on 16 October 1998. It was written and directed by Karan Johar, and starred the popular on- screen pair of Shah Rukh Khan and Kajol in their fourth film together. Rani Mukerji featured in a supporting role, while Salman Khan also had an extended- cameo appearance. Sana Saeed, who was featured in a supporting role, made her debut in this film. The plot combines two love triangles set years apart. The first half covers friends on a college campus, while the second tells the story of a widower\'s young daughter who tries to reunite her dad with his old friend. Filmed in India, Mauritius, and Scotland, this was Johar\'s directorial debut. One of his goals for the film was to set a new level for style in Hindi cinema. The music was composed by Jatin- Lalit, was the biggest seller of the year. " Kuch Kuch Hota Hai" received a positive reception, with praise for Kajol\'s performance. The film was successful in India and abroad, becoming the highest- grossing Indian film of the year and the third highest- grossing Indian film at that time behind" Hum Aapke Hain Koun ..!"( 1994) at number 1 and also Shah Rukh Khan and Kajol starrer" Dilwale Dulhania Le Jayenge"( 1995) at number 2. Outside India, the film was the highest grossing Hindi film ever until its record was broken by Karan\'s next directorial," Kabhi Khushi Kabhie Gham ..."( 2001). The film received numerous accolades, including the National Film Award for Best Popular Film Providing Wholesome Entertainment and awards in the" Best Film" category at the Filmfare Awards, Zee Cine Awards, Screen Awards, and Bollywood Movie Awards. The film won 8 Filmfare Awards and is the only film to win all four acting awards at the ceremony, namely Best Actor, Best Actress, Best Supporting Actor and Best Supporting Actress.', 'title': 'Kuch Kuch Hota Hai'}
