 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Hum Tumhare Hain Sanam is a 2002 Hindi romantic drama film directed by K. S. Adhiyaman. It features Salman Khan, Shah Rukh Khan, and Madhuri Dixit in the lead roles, with Aishwarya Rai in a cameo appearance. The movie is K. S. Adhiyaman\'s first in Hindi, a remake of his own Tamil film," Thotta Chinungi". It took five years to make, with huge sabbaticals between shoots due to production problems. The rights of the film was owned by Shah Rukh Khan\'s Red Chillies Entertainment. " Hum Tumhare Hain Sanam" is the third film to feature the two- Khans together after the blockbusters" Karan Arjun"( 1995) and" Kuch Kuch Hota Hai"( 1998). Dixit was cast opposite both Khans for the fourth time – she worked with Salman Khan in the flop" Dil Tera Aashiq"( 1993) and the blockbusters" Saajan"( 1991) and" Hum Aapke Hain Koun ..!"( 1994); and with Shah Rukh Khan in" Anjaam"( 1994)," Koyla"( 1997), and" Dil To Pagal Hai"( 1997).', 'title': 'Hum Tumhare Hain Sanam'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Kalakalappu 2  is a 2018 Indian Tamil language comedy film written and directed by Sundar C and produced by Kushboo. Despite the title, it is not a sequel to the 2012 film "Kalakalappu", but a spiritual successor. The film features Jiiva, Jai, Shiva, Nikki Galrani and Catherine Tresa in the lead roles. The film grossed 50.35 crores in worldwide box-office. Though talks were going on since 2012, the film began production in October 2017 and progressed in locations including Varanasi, Karaikudi, Pune and Hyderabad. The film was released on 9 February 2018.', 'title': 'Kalakalappu 2'}
