 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Bade Miyan Chote Miyan is an Indian 1998 Hindi- language action comedy film directed by David Dhawan starring Amitabh Bachchan and Govinda in dual roles alongside Raveena Tandon, Ramya Krishnan, Anupam Kher, and Paresh Rawal, with Madhuri Dixit making a special appearance. " Bade Miyan Chote Miyan" was Bachchan\'s first box office hit since his comeback to Bollywood after a hiatus of few years, and its muharat shot was done by Bachchan\'s daughter Shweta Nanda on 22 December 1998. Produced on a budget of," Bade Miyan Chote Miyan" was theatrically released on 16 October 1998 alongside Karan Johar\'s" Kuch Kuch Hota Hai"; though the latter emerged as the biggest success of the year, it became the second biggest hit in the list and went on to gross over worldwide.', 'title': 'Bade Miyan Chote Miyan'}
