 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Sir Leopold Halliday Savile, KCB (31 August 1870 – 28 January 1953) was a Scottish civil engineer. Savile was born at Bridge of Earn, Perthshire, the son of Lieutenant-Colonel John Walter Savile and Sarah Emma Stoddart. He was a great grandson of the MP Christopher Atkinson (later Savile). He was educated at Marlborough College and King's College London. He was a pupil of Sir John Wolfe Barry and Henry Marc Brunel from 1891–96. In 1931, Savile was elected a member of the Smeatonian Society of Civil Engineers and was their president in 1948. Savile was appointed to the panel of qualified civil engineers required by the Reservoirs Act of 1930 where he was responsible for the design, construction and inspection of reservoirs. At this time he was working for Alexander Gibb and partners. He served as president of the Institution of Civil Engineers between November 1940 and November 1941. He was appointed a Companion of the Order of the Bath on 1 January 1925. He was appointed a Knight Commander of the same order on 1 March 1929. In 1904, Savile married Evelyn Stileman, daughter of Frank Stileman, consulting engineer to the Furness Railway Company. They had one daughter. After her death died in 1920, he married secondly, in 1929, Lilith Savile (who was his first cousin once removed), daughter of Brigadier-General Walter Clare Savile.\nHe died in 1953.", 'title': 'Leopold Halliday Savile'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Henry Marc Brunel (27 June 1842 – 7 October 1903) was an English civil engineer. Brunel was the second son of the celebrated engineer Isambard Kingdom Brunel, and followed his father\'s footsteps. Brunel attended King\'s College London from 1859–1861, and afterward attained experience in civil engineering through serving out various apprenticeships. He developed an interest in acting as a hobby, becoming a member of the Scientific and Amateur Dramatic Societies, and also contributed to his brother\'s biography of their father. Henry is noted for a partnership from 1878 with Sir John Wolfe Barry, with whom he designed the Blackfriars Railway Bridge over the River Thames in central London. Their other works included the docks at Barry in south Wales and the Creagan Bridge, a railway bridge over the narrows of Loch Creran in Scotland (jointly credited to Wolfe Barry, Brunel and E.M. Crutwell). Sir Alexander Gibb was a pupil of Brunel and Wolfe Barry in 1895. He also designed the SS "Chauncy Maples", which was built in Glasgow in 1899 and transported overland to Lake Nyasa in Africa, where it served for more than one hundred years as a mission and hospital clinic. Brunel is buried with his father, grandfather, and other family members at Kensal Green Cemetery in London.', 'title': 'Henry Marc Brunel'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Michael Lane( 26 October 1802 – 27 February 1868) was a British civil engineer who served as the Chief Engineer of the Great Western Railway( GWR). A protégé of Isambard Kingdom Brunel, he worked with both Brunel and Brunel's father Marc on various projects before joining the younger Brunel on the GWR. He eventually succeeded that Brunel as the railway's Chief Engineer, serving in the position for nearly eight years before his death.", 'title': 'Michael Lane (engineer)'}]

