 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Infanta Blanca of Spain (7 September 1868 – 25 October 1949) was the eldest child of Carlos, Duke of Madrid, Carlist claimant to the throne of Spain and his wife Princess Margherita of Bourbon-Parma. Blanca was a member of the House of Bourbon and - according to the Carlists - an Infanta of Spain by birth. In 1889 she married Archduke Leopold Salvator of Austria. The couple had ten children. The family left Austria after the end of the Monarchy and finally settled in Barcelona. When the male line of Blanca's family died out at the death of her uncle, Alfonso Carlos, Duke of San Jaime, some of the Carlists recognized her as the legitimate heiress to the Spanish throne.", 'title': 'Infanta Blanca of Spain'}
