 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Charles II, also known as Charles the Lame (1254 – 5 May 1309), was King of Naples, Count of Provence and Forcalquier (1285–1309), Prince of Achaea (1285–1289), and Count of Anjou and Maine (1285–1290); he also styled himself King of Albania and claimed the Kingdom of Jerusalem from 1285. He was the son of Charles I of Anjouone of the most powerful European monarchs in the second half of the 13th centuryand Beatrice of Provence. His father granted Charles the Principality of Salerno in the Kingdom of Sicily (or "Regno") in 1272 and made him regent in Provence and Forcalquier in 1279. After the uprising known as the Sicilian Vespers against Charles\' father, the island of Sicily became an independent kingdom under the rule of Peter III of Aragon in 1282. A year later, his father made Charles regent in the mainland territories of the "Regno" (or the Kingdom of Naples). Charles held a general assembly where unpopular taxes were abolished and the liberties of the noblemen and clerics were confirmed. He could not prevent the Aragonese from occupying Calabria and the islands in the Gulf of Naples. The Sicilian admiral, Roger of Lauria, captured him in a naval battle near Naples in 1284. As he was still in prison when his father died on 7 January 1285, his realms were ruled by regents.', 'title': 'Charles II of Naples'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'John of Gravina (1294 – 5 April 1336), Count of Gravina 1315–1336, Prince of Achaea 1318-1332, Duke of Durazzo 1332–1336 and ruler of the Kingdom of Albania (although he never used a royal title), was a younger son of Charles II of Naples and Maria of Hungary. He was a younger brother of (among others) Charles Martel of Anjou, Saint Louis of Toulouse, Robert of Naples and Philip I of Taranto. On 3 September 1313 he was named Captain-General of Calabria. In 1315, he succeeded his brother Peter, Count of Gravina after the latter was killed at the Battle of Montecatini. The death of Louis of Burgundy in 1316 widowed Matilda of Hainaut, Princess of Achaea. Her suzerain, John\'s brother Philip I of Taranto, had her brought by force to Naples in 1318 to marry John, a design intended to bring the Principality of Achaea into the Angevin inheritance. The marriage, celebrated in March 1318, failed of its objective: Matilda refused to surrender her rights to Achaea to her husband and ultimately contracted a secret marriage with Hugh de La Palice. This violated the marriage contract of her mother Isabelle, which had pledged that Isabelle and all her female heirs should not marry without permission of their suzerain. On these grounds, Philip stripped her of Achaea and bestowed it upon John: the marriage was annulled for non-consummation, and Matilda was imprisoned in the Castel dell\'Ovo. On 14 November 1321, John took a second wife, Agnes of Périgord, daughter of Helie VII, Count of Périgord and Brunissende de Foix. They had three sons:\nIn a tardy reaction to the Byzantine advances in the central Morea, in 1325 John launched a military expedition, financed by the Acciaiuoli, to Achaea. While he re-established his authority in Cefaphonia and Zante, he was unable to recapture Skorta from the control of the Byzantine Empire. In 1332, Philip of Taranto died and was succeeded by his son Robert of Taranto, who became the new suzerain of Achaea. Not wishing to swear fealty to his nephew, John arranged to surrender Achaea to him in exchange for Robert\'s rights to the Kingdom of Albania and a loan of 5,000 ounces of gold raised upon Niccolo Acciaiuoli, and thenceforth adopted the style of "Duke of Durazzo".', 'title': 'John, Duke of Durazzo'}
