 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'March of the Penguins( French La Marche de l\'empereur) is a 2005 French feature- length nature documentary directed and co-written by Luc Jacquet, and co-produced by Bonne Pioche and the National Geographic Society. The documentary depicts the yearly journey of the emperor penguins of Antarctica. In autumn, all the penguins of breeding age( five years old and over) leave the ocean, which is their normal habitat, to walk inland to their ancestral breeding grounds. There, the penguins participate in a courtship that, if successful, results in the hatching of a chick. For the chick to survive, both parents must make multiple arduous journeys between the ocean and the breeding grounds over the ensuing months. It took one year for the two isolated cinematographers Laurent Chalet and Jérôme Maison to shoot the documentary, which was shot around the French scientific base of Dumont d\' Urville in Adélie Land. " March of the Penguins" was released in France on January 26, 2005 by Buena Vista International and in the United States by Warner Independent Pictures on June 24, 2005. The documentary won the 2006 Oscar for Best Documentary Feature. On June 1, 2010, a home video release in France included the movie in the Disneynature collection. The documentary had a 2007 follow- up movie," Arctic Tale", which only took in at the box office$ 1.8 million worldwide. A direct sequel titled" March of the Penguins 2: The Next Step"( aka" March of the Penguins 2: The Call") was released in France in 2017 by Disneynature. It was released in the United States exclusively on Hulu on March 23, 2018.', 'title': 'March of the Penguins'}
