 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Dark Knight Rises is a 2012 superhero film directed by Christopher Nolan, who co-wrote the screenplay with his brother Jonathan Nolan, and the story with David S. Goyer. Based on the DC Comics character Batman, the film is the final installment in Nolan\'s "The Dark Knight Trilogy", and the sequel to "The Dark Knight" (2008). Christian Bale stars as Bruce Wayne / Batman, alongside Michael Caine, Gary Oldman, Anne Hathaway, Tom Hardy, Marion Cotillard, Joseph Gordon-Levitt, and Morgan Freeman. Eight years after the events of "The Dark Knight", merciless revolutionary Bane forces Bruce Wayne to resume his role as Batman and save Gotham City from nuclear destruction. Christopher Nolan was hesitant about returning to the series for a third film, but agreed after developing a story with his brother and Goyer that he felt would conclude the series on a satisfactory note. Nolan drew inspiration from Bane\'s comic book debut in the 1993  storyline, the 1986 series "The Dark Knight Returns", and the 1999 storyline . Filming took place from May to November 2011 in locations including Jodhpur, London, Nottingham, Glasgow, Los Angeles, New York City, Newark, and Pittsburgh. Nolan used IMAX 70 mm film cameras for much of the filming, including the first six minutes of the film, to optimize the quality of the picture. A vehicle variation of the Batplane and Batcopter termed the "Bat", an underground prison set, and a new Batcave set were created specifically for the film. As with "The Dark Knight", viral marketing campaigns began early during production. When filming concluded, Warner Bros. refocused its campaign: developing promotional websites, releasing the first six minutes of the film, screening theatrical trailers, and sending out information regarding the film\'s plot. "The Dark Knight Rises" premiered in New York City on July 16, 2012. The film was released in the United States and the United Kingdom on July 20, 2012. The film received positive reviews, with praise being directed toward the performances, (particularly Bale and Hardy), action sequences, screenplay, direction, musical score, and emotional depth, with many critics deeming it a solid conclusion to the trilogy. The consensus at Rotten Tomatoes calls it "ambitious, thoughtful, and potent". The film grossed over $1 billion worldwide, making it the second film in the "Batman" film series to earn $1 billion. In addition to being Nolan\'s highest-grossing film, it became the seventh-highest-grossing film of all time, as well as the third-highest-grossing film of 2012.', 'title': 'The Dark Knight Rises'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'James Newton Howard( born June 9, 1951) is an American composer, conductor, and music producer. He has scored over 100 films and is the recipient of a Grammy Award, Emmy Award, and eight Academy Award nominations. His film scores include" Pretty Woman"( 1990)," Grand Canyon"( 1991)," The Fugitive"( 1993)," The Devil\'s Advocate"( 1997)," Dinosaur"( 2000),( 2001)," Treasure Planet"( 2002)," King Kong"( 2005)," Batman Begins"( 2005)," Blood Diamond"( 2006)," The Dark Knight"( 2008)," The Bourne Legacy"( 2012)," The Hunger Games" series( 2012–2015) and" Fantastic Beasts and Where to Find Them"( 2016) and( 2018). He has collaborated with directors M. Night Shyamalan, having scored nine of his films since" The Sixth Sense", Christopher Nolan, having collaborated with Hans Zimmer on" The Dark Knight" Trilogy excluding" The Dark Knight Rises", Peter Jackson, composing the score for his 2005 remake of" King Kong", and Francis Lawrence, having scored all of his films since" I Am Legend".', 'title': 'James Newton Howard'}
