 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Dark Knight is a 2008 superhero film directed, co-produced, and co-written by Christopher Nolan. Based on the DC Comics character Batman, the film is the second installment of Nolan\'s" The Dark Knight Trilogy" and a sequel to 2005\'s" Batman Begins", starring Christian Bale and supported by Michael Caine, Heath Ledger, Gary Oldman, Aaron Eckhart, Maggie Gyllenhaal, and Morgan Freeman. In the film, Bruce Wayne/ Batman( Bale), Police Lieutenant James Gordon( Oldman) and District Attorney Harvey Dent( Eckhart) form an alliance to dismantle organized crime in Gotham City, but are menaced by an anarchistic mastermind known as the Joker( Ledger), who seeks to undermine Batman\'s influence and turn the city to chaos. Nolan\'s inspiration for the film was the Joker\'s comic book debut in 1940, the 1988 graphic novel, and the 1996 series, which retold Harvey Dent\'s origin. The" Dark Knight" nickname was first applied to Batman in" Batman"# 1( 1940), in a story written by Bill Finger. " The Dark Knight" was filmed primarily in Chicago, as well as in several other locations in the United States, the United Kingdom, and Hong Kong. The film was the first mainstream feature to partially utilize IMAX 70 mm cameras, with Nolan using them for 28 minutes of the film, including the Joker\'s first appearance. Warner Bros. initially created a viral marketing campaign for" The Dark Knight", developing promotional websites and trailers highlighting screenshots of Ledger as the Joker. Ledger died on January 22, 2008, some months after he completed filming and six months before the film\'s release from a toxic combination of prescription drugs, leading to intense attention from the press and movie- going public. A co-production of the United States and the United Kingdom," The Dark Knight" was released on July 18, 2008, in the United States and on July 25, 2008, in the United Kingdom. Considered one of the best films of its decade and one of the best superhero films of all time, the film received highly positive reviews, particularly for its action, score, screenplay, performances( particularly Ledger\'s), visual effects, and direction, setting numerous records during its theatrical run. " The Dark Knight" appeared on 287 critics\' top- ten lists, more than any other film of 2008 with the exception of" WALL- E", and more critics( 77) named" The Dark Knight" the best film released that year. With over$ 1 billion in revenue worldwide, it became the highest- grossing film of 2008 and is the 45th- highest- grossing film of all time, unadjusted for inflation( 4th at the time of release); it also set the record for highest- grossing domestic opening with$ 158 million, a record it held for three years. The film received eight Academy Award nominations; it won the award for Best Sound Editing and Ledger was posthumously awarded Best Supporting Actor. " The Dark Knight Rises", the final film in the trilogy, was released on July 20, 2012.', 'title': 'The Dark Knight (film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Heath Andrew Ledger( 4 April 197922 January 2008) was an Australian actor and music video director. After performing roles in several Australian television and film productions during the 1990s, Ledger left for the United States in 1998 to further develop his film career. His work comprised nineteen films, including" 10 Things I Hate About You"( 1999)," The Patriot"( 2000)," A Knight\'s Tale"( 2001)," Monster\'s Ball"( 2001)," Lords of Dogtown"( 2005)," Brokeback Mountain"( 2005)," The Dark Knight"( 2008), and" The Imaginarium of Doctor Parnassus"( 2009), the latter two being posthumous releases. He also produced and directed music videos and aspired to be a film director. For his portrayal of Ennis Del Mar in" Brokeback Mountain", Ledger won the New York Film Critics Circle Award for Best Actor and the Best International Actor Award from the Australian Film Institute; he was the first actor to win the latter award posthumously. He was nominated for the BAFTA Award for Best Actor in a Leading Role and the Academy Award for Best Actor. Posthumously, he shared the 2007 Independent Spirit Robert Altman Award with the rest of the ensemble cast, the director, and the casting director for the film" I\'m Not There", which was inspired by the life and songs of American singer- songwriter Bob Dylan. In the film, Ledger portrayed a fictional actor named Robbie Clark, one of six characters embodying aspects of Dylan\'s life and persona. Ledger died on the afternoon of 22 January 2008 due to a drug overdose. A few months before his death, Ledger had finished filming his performance as the Joker in" The Dark Knight". At the time of his death," The Dark Knight" was in its editing- phase, and" The Imaginarium of Doctor Parnassus" was in the midst of filming, in which he was playing his last role as Tony. His untimely death also affected the subsequent promotion of" The Dark Knight". His role as the Joker in" The Dark Knight" earned him widespread acclaim and popularity from fans and critics alike. Ledger also received numerous posthumous accolades for his performance in" The Dark Knight", including the Academy Award for Best Supporting Actor, a Best Actor International Award at the 2008 Australian Film Institute Awards, the 2008 Los Angeles Film Critics Association Award for Best Supporting Actor, the 2009 Golden Globe Award for Best Supporting Actor – Motion Picture, and the 2009 BAFTA Award for Best Supporting Actor.', 'title': 'Heath Ledger'}
