 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Richard Leland Bare (August 12, 1913 – March 28, 2015) was an American director, producer, and screenwriter of television shows and short films. Born in Turlock, California, he attended USC School of Cinematic Arts where he directed his most notable student film, "The Oval Portrait", an adaptation of Edgar Allan Poe\'s story. He became notable post-graduation for writing and directing the Joe McDoakes series of short films for Warner Brothers between 1942 and 1956, featuring George O\'Hanlon in the title role. On television, he directed seven classic "The Twilight Zone" episodes: "To Serve ManWhat\'s in the Box?The FugitiveThird from the SunThe Purple TestamentNick of Time" and "The Prime Mover". He directed virtually every episode of the 1960s-1970s CBS television series "Green Acres". He also directed feature films, including "Shoot-Out at Medicine Bend" and "Wicked, Wicked". On May 2, 2014, he acquired the rights with producer Phillip Goldfine to produce a movie and Broadway play based on "Green Acres". His memoir, "Confessions of a Hollywood Director" discusses his directorial work, as well as behind-the-scenes information, and his service as a captain in the Army Air Forces\' First Motion Picture Unit. Bare also wrote "The Film Director: A Practical Guide to Motion Picture and Television Techniques" (1971), a text to teach the craft of directing to aspiring filmmakers. On November 19, 2007, Bare announced that he was working on a revival of "Green Acres." He died on March 28, 2015, at the age of 101 at his home in Newport Beach, California.', 'title': 'Richard L. Bare'}
