 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'William Randolph Hearst Jr.( January 27, 1908 – May 14, 1993) was an American businessman and newspaper publisher. He was the second son of the publisher William Randolph Hearst. He became editor- in- chief of Hearst Newspapers after the death of his father in 1951. He won a Pulitzer Prize for his interview with Soviet premier, Nikita Khrushchev, and associated commentaries in 1955. Hearst attended the University of California, Berkeley and was a member of the Phi Delta Theta Fraternity. Hearst was instrumental in restoring some measure of family control to the Hearst Corporation, which under his father\'s will is( and will continue to be while any grandchild alive at William Randolph Hearst Sr.\'s death in 1951 is still living) controlled by a board of thirteen trustees, five from the Hearst family and eight Hearst executives. When tax laws changed to prevent the foundations his father had established from continuing to own the corporation, he arranged for the family trust( with the same trustees) to buy the shares and for longtime chief executive Richard E. Berlin, who was going senile, to be eased out to become chairman of the trustees for a period. Later, William Randolph Hearst Jr. himself headed the trust and served as chairman of the executive committee of the corporation. Today, his branch of the family is represented on the trustees by his son, William Randolph Hearst III. Hearst was a member of the Sons of the American Revolution. He makes a brief appearance in the musical adaptation of" Newsies" as Bill.', 'title': 'William Randolph Hearst Jr.'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'George Randolph Hearst Jr. (July 13, 1927 – June 25, 2012) was chairman of the board of the Hearst Corporation from 1996 through to his death in 2012, succeeding his uncle Randolph Apperson Hearst. He was a director at the company for over forty years. Non-family executives are a majority on the trust that controls the corporation, and this trust will not dissolve until all grandchildren alive at the death of William Randolph Hearst have died. George Jr. was one of the oldest grandchildren. However, there are five family seats among the 13 trustees, and George represented his branch of the family. Hearst first joined the Naval Air Corps. Later, he joined the United States Army and served in the Korean War.', 'title': 'George Randolph Hearst Jr.'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Phoebe Millicent Hearst Cooke( July 13, 1927 – November 18, 2012) was an American businesswoman and philanthropist. She served on the board of directors of the Hearst Corporation from 1962 to 1998. She was a granddaughter of William Randolph Hearst. Her twin brother was former Hearst Corporation chairman George Randolph Hearst Jr., who died in June 2012. She spent much of her life in Woodside, California, and was particularly involved in the equestrian community, including horse- assisted therapy through the National Center For Equine Facilitated Therapy. In her elder years, she faced disputes with family over the management of her estate, which concluded in 2009 with a conservatorship. In 1996, she was inducted into the Hall of Great Westerners of the National Cowboy& Western Heritage Museum.', 'title': 'Phoebe Hearst Cooke'}
