[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Saint Rumbold( or" RumoldRomuold") was an Irish or Scottish Christian missionary, although his true nationality is not known for certain. He was martyred near Mechelen by two men, whom he had denounced for their evil ways. Saint Rumbold\'s feast day is celebrated by the Roman Catholic Church, and Western Rite Orthodox Churches, on 24 June; and it is celebrated in Ireland on 3 July. He is the patron saint of Mechelen, where St. Rumbold\'s Cathedral possesses an elaborate golden shrine on its high altar, containing relics attributed to the saint. It is rumoured that his remains are buried inside the cathedral. Twenty- five paintings in the choir illustrate his life.', 'title': 'Rumbold of Mechelen'}
