 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Vyacheslav Alekseyevich Zaytsev (born 12 November 1952) is a Russian former volleyball player who competed for the Soviet Union in the 1976 Summer Olympics, in the 1980 Summer Olympics, and in the 1988 Summer Olympics. Zaytsev was born in Leningrad. In 1976, he was part of the Soviet team which won the silver medal in the Olympic tournament. He played all five matches. Four years later, he won a gold medal with the Soviet team in the 1980 Olympic tournament. He played five matches. With the Soviet Union, Zaytsev won two other Olympic silver medals, two World Championships and seven European titles. He was a major player to help Soviet Union men's national volleyball team to dominate the World in late 1970s to early 1980s by winning 1977 FIVB Men's World Cup, 1978 FIVB Men's World Championship, 1980 Moscow Olympic Games, 1981 FIVB Men's World Cup and 1982 FIVB Men's World Championship in row. At the 1988 Games, he was a member of the Soviet team which won the silver medal in the Olympic tournament. He played five matches. Zaytsev played for Avtomobilist Leningrad (now Spartak St. Petersburg), with which he won two CEV Top Teams Cup and two Challenge Cups in 1982–1983. He finished his career in Italy, playing in Spoleto, Agrigento and Città di Castello.", 'title': 'Vyacheslav Zaytsev'}
