 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Main Street to Broadway is a 1953 light drama -comedy film by independent producer Lester Cowan, his final credit, in collaboration with The Council of the Living Theatre, which provided tie- up with a number of well- known Broadway names. Release was by MGM. The backstage story features Tom Morton as an aspiring playwright who hopes to stage a Broadway production, Mary Murphy, as a young lady from Indiana, and radio- TV humorist Herb Shriner in a rare acting role as a hardware store owner. Tallulah Bankhead is featured in a parody sequence of herself. The list of Broadway luminaries also playing themselves, in smaller cameos, includes Ethel Barrymore, Lionel Barrymore( in his last film), Shirley Booth, Louis Calhern, Faye Emerson, Rex Harrison, Helen Hayes, Mary Martin, Lilli Palmer, John Van Druten and Cornel Wilde. Included is New York baseball manager Leo Durocher. Many others are unidentified, such as Vivian Blaine, glimpsed in a theater lobby. In one scene, Richard Rodgers and Oscar Hammerstein II create a new song," There\'s Music in You", then perform it for their friends, with Rodgers at the piano and Hammerstein singing the vocals. Mary Martin is later seen rehearsing the song for director Joshua Logan. The black- and- white film, which has a running time of 97 minutes, was directed by Tay Garnett, screenplay by Samson Raphaelson, based on a story Robert E. Sherwood, and photographed by James Wong Howe. Sequences were filmed in New York, with shots at the Martin Beck and old Empire theaters( the Empire was set to be demolished the year the film was released). Others as story characters include Gertrude Berg, as a landlady, Agnes Moorehead, Rosemary de Camp, Arthur Shields, and, in a fantasy sequence, Florence Bates, Madge Kennedy, Carl Benton Reid, Frank Ferguson, and Robert Bray.', 'title': 'Main Street to Broadway'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Jacques Demy( 5 June 1931 – 27 October 1990) was a French director, lyricist, and screenwriter. He appeared in the wake of the French New Wave alongside contemporaries like Jean- Luc Godard and François Truffaut. Demy\'s films are celebrated for their sumptuous visual style. Demy\'s style drew upon such diverse sources as classic Hollywood musicals, the documentary realism of his New Wave colleagues, fairy- tales, jazz, Japanese manga, and the opera. His films contain overlapping continuity( i.e., characters cross over from film to film), lush musical scores( typically composed by Michel Legrand) and motifs like teenaged love, labor rights, incest, and the intersection between dreams and reality. He is best known for the two musicals he directed in the mid-1960s:" The Umbrellas of Cherbourg"( 1964) and" The Young Girls of Rochefort"( 1967).', 'title': 'Jacques Demy'}
