 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Edward Harley, 3rd Earl of Oxford and Earl Mortimer (c. 1699 – 11 April 1755, in Bath) was a British peer and Member of Parliament. Harley was the son of Edward Harley and his wife Sarah Foley and was educated at Westminster School and Christ Church, Oxford. He succeeded his father in 1735 to the Eywood estate at Titley, Herefordshire and his cousin Edward Harley, 2nd Earl of Oxford and Earl Mortimer in 1741 to the earldom and the family seat at Brampton Bryan. One of his first acts on succeeding his brother was to auction off his predecessor\'s art and coin collection through the auctioneer Cock, at an art sale held under the Piazza, Covent Garden, on 8 March 1741/2 and the five following days, with six more days being required by the coins. Nearly all the leading men of the day, including Horace Walpole, attended or were represented at this sale, and the prices varied from five shillings for an anonymous bishop\'s "head" to 165 guineas for van Dyck\'s group of "Sir Kenelm Digby, lady, and son". He was returned to Parliament as the member for Herefordshire in 1727, sitting until 1741.', 'title': 'Edward Harley, 3rd Earl of Oxford and Earl Mortimer'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Edward Harley, 4th Earl of Oxford and Earl Mortimer (2 September 1726 – 11 October 1790), styled Lord Harley from 1741 to 1755, was a British peer and Tory politician. Harley was the eldest son of Edward Harley, 3rd Earl of Oxford and Earl Mortimer and Martha Morgan, daughter of Welsh politician William Morgan. His two younger brothers were John Harley, Dean of Windsor and then Bishop of Hereford; and the politician Thomas Harley, who was Lord Mayor of London and also sat in Parliament. He was educated at Westminster School (1735–44); and then Christ Church, Oxford, graduating with a Doctor of Civil Law in 1748. Harley was elected as MP for Herefordshire in at the 1747 general election, even though he was only 20 years old. Prior to the election, Lord Foley wrote to Harley\'s father, "As he is under age I am in great fear lest some trick should be played on him on the day of election ... which if it should happen I think would be of the most evil consequence to your family as well as to the interest of the county." He returned unopposed and took a seat on the treasury board, serving until in 1755 he succeeded to his father\'s titles and estates, including the family seat of Brampton Bryan Castle and Hall. He was High Steward of Hereford from 1755, a Lord of the Bedchamber from 1760, and Lord Lieutenant of Radnorshire from 1766, all until his death. He was also Harleian Trustee at the British Museum from 1755 until his death. In 1751, he married heiress Susannah Archer, daughter of William Archer, who brought a dowry of £50,000 . He died at Brampton Bryan Hall at the age of 64. As he had no children, his titles and estates passed to his nephew Edward Harley.', 'title': 'Edward Harley, 4th Earl of Oxford and Earl Mortimer'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Henrietta Harley, Countess of Oxford and Countess Mortimer ("née" Lady Henrietta Cavendish Holles; 11 February 1694 – 9 December 1755) was an English noblewoman, the only child and heiress of John Holles, 1st Duke of Newcastle and his wife, the former Lady Margaret Cavendish, daughter of Henry Cavendish, 2nd Duke of Newcastle-upon-Tyne. Her hand was sought in marriage even in her youth as a means of alliance with her powerful father. Suitors included the Intendant of the Court of a Count of the Holy Roman Empire in December 1703, the Elector of Hanover\'s son (later George I of Great Britain) in June 1706, the Duke of Somerset\'s son Lord Hertford in 1707–1711, Count Nassau in 1709, and finally Lord Danby (grandson of Thomas Osborne, 1st Duke of Leeds) in 1711, before her father settled on Edward Harley, 2nd Earl of Oxford and Earl Mortimer. They were married on 31 August 1713, at Wimpole Hall. She brought, through inheritance, Welbeck Abbey in Nottinghamshire and Wimpole Hall in Cambridgeshire to her husband. They had two children. Their son, Henry Cavendish Harley, Lord Harley, lived only four days. Their only child to attain maturity was Margaret (1715–1785), and so whilst Margaret inherited most of the combined Holles-Harley fortunes on her parents\' deaths, the title of Earl of Oxford and Earl Mortimer passed to Edward\'s cousin (also Edward). Henrietta Place (previously Henrietta Street) in Marylebone in the City of Westminster in central London was named after the Countess. Nearby Harley Street was named after her husband. The general area was owned by the Harleys and developed during their lifetimes, hence other streets are named after their family, too. This includes Oxford Street, Wigmore Street and Wimpole Street. She was buried 26 December 1755 in the Duke of Newcastle\'s vault in Westminster Abbey.', 'title': 'Henrietta Harley, Countess of Oxford and Countess Mortimer'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Alfred Harley, 6th Earl of Oxford and Earl Mortimer( 10 January 1809 – 19 January 1853), styled Lord Harley between 1828 and 1849, was a British peer and the last holder of the title of Earl of Oxford and Mortimer. Harley was the second but eldest surviving son of Edward Harley, 5th Earl of Oxford and Earl Mortimer, by Jane Elizabeth, daughter of Reverend James Scott. He became known by the courtesy title Lord Harley on the death of his elder brother in 1828. In 1848 he succeeded his father in the earldom and the family seat at Brampton Bryan Hall in Herefordshire. Due to his mother\'s numerous love affairs, doubts were often raised about his paternity: he and his siblings were often called" the Harleian Miscellany". Lord Oxford married Eliza Nugent[ 1806- 1877], the illegitimate daughter of George Nugent, 1st Marquess of Westmeath, on 17 February 1831. He died in January 1853, aged 44, when the title became extinct. His estates passed to his sister Jane, who was married to Lord Langdale, from whom they eventually passed to a distant relative, William Daker Harley.', 'title': 'Alfred Harley, 6th Earl of Oxford and Earl Mortimer'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Edward Harley, 5th Earl of Oxford and Earl Mortimer( 20 February 1773 – 28 December 1848) was an English nobleman. Harley was the son of John Harley( dean of Windsor) and Roach Vaughan. Edward succeeded to the titles and estates( including the Harley family seat at Brampton Bryan) of his father's elder brother Edward Harley, 4th Earl of Oxford and Earl Mortimer on the 4th Earl's death without issue in 1790. In 1803 Henry Bickersteth became the Earl's medical attendant whilst the Earl was on a tour of Italy, staying with him until 1805. Edward became Bickersteth's friend and patron and in 1835 Bickersteth married the earl's eldest daughter. In 1804 Edward sold the Ewyas Lacy tithes by auction. He commissioned work from the architect Robert Smirke.", 'title': 'Edward Harley, 5th Earl of Oxford and Earl Mortimer'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Edward Harley( 7 June 1664 – 30 August 1735), of Eywood, Titley, Herefordshire was a British Member of Parliament and Auditor of the Imprests. He was second son of Edward Harley of Brampton Bryan, Herefordshire and the younger brother of Robert Harley, 1st Earl of Oxford and Earl Mortimer. He was educated at Westminster School and the Middle Temple( 1681), where he was called to the bar in 1688. He represented Droitwich in Parliament from 1695 to 1698, after which he was a member for Leominster, almost continuously until 1722. He was appointed Recorder of Leominster for 1692- 1732 and joint Auditor of the Imprests for life in 1702. He purchased the Eywood estate at Titley, Herefordshire and there around 1705 built a new house, which was demolished in 1958. He married Sarah Foley, third daughter of Thomas Foley. Their eldest son( Edward) succeeded as 3rd Earl of Oxford on the death of his brother Robert's son Edward, the 2nd earl, without male issue. Their second son Robert died in infancy, after which came a daughter named Abigail and finally another son Robert Harley, Recorder of Leominster and twice Member of Parliament for that town.", 'title': 'Edward Harley (1664–1735)'}]

