 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Sam Newfield, born Samuel Neufeld,( December 6, 1899- November 10, 1964), also known as Sherman Scott or Peter Stewart, was an American B-movie director, one of the most prolific in American film history —he is credited with directing over 250 feature films in a career which began during the silent era and ended in 1958. In addition to his staggering feature output, he also directed one- and two- reel comedy shorts, training films, industrial films, TV episodes and pretty much anything anyone would pay him for. Because of this massive output—he would sometimes direct more than 20 films in a single year —he has been called the most prolific director of the sound era. Many of Newfield's films were made for PRC Pictures. This was a film production company headed by his brother Sigmund Neufeld. The films PRC produced were low- budget productions, the majority being westerns, with an occasional horror film or crime drama.", 'title': 'Sam Newfield'}
