 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Kings and Desperate Men is a 1981 Canadian hostage drama film directed, co-written and produced by Alexis Kanner. The film stars Patrick McGoohan as radio talk show host John Kingsley, Margaret Trudeau as his wife Elizabeth, and Kanner with Andrea Marcovicci as terrorists. The story is set within one day during Christmas Eve. The movie was made on a budget of 1.2 million and was filmed in Montreal. Its title is derived from a line in John Donne\'s poem "Death Be Not Proud" (Holy Sonnet X): "Thou art slave to Fate, Chance, kings, and desperate men." Film director Kanner later took legal action against the film producers of "Die Hard" in the late 1980s, alleging the producers stole the idea for "Die Hard" from his film "Kings and Desperate Men". Kanner lost his case. Trudeau was the wife of Canadian Prime Minister Pierre Trudeau, who was in office at the time of both the film\'s production and its eventual release.', 'title': 'Kings and Desperate Men'}]

