 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Leaving Home is a full- length documentary film on the Indian music band Indian Ocean, directed by Jaideep Varma. The film was shot in 2006 and edited in 2007/ 8. It made history in 2010 by becoming the first documentary film in the history of Indian cinema to release nationally in theatres. Besides travelling to a few film festivals in India and abroad, it was the opening film at the Goa International Film Festival in November 2010 and at the 58th National Film Awards, the documentary went on to win the Award for Best Arts/ Cultural Film. The film was produced by Cartwheel Features, a now- defunct subsidiary of an advertising agency called Cartwheel. The film chronicles the members of the band Indian Ocean since their formation in 1990 till the end of 2006, and showcases their music. The film received good reviews in the Indian media when it released in 2010. It was also the first documentary ever in India to be reviewed so heavily. A 286- minute version of the film( entitled" The Longer Trip") was released on DVD in December 2010, which included an updating of the band ’s story, including the death of Asheem Chakravarty in 2009. It also included several new chapters and facets that could not be covered in the theatrical version.', 'title': 'Leaving Home – the Life & Music of Indian Ocean'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Jaideep Varma is an Indian writer, screenwriter and filmmaker. He has made 5 feature films –" Hulla"( 2008, fiction)," Leaving Home – the Life& Music of Indian Ocean"( 2010, non-fiction)," Baavra Mann – a Film on Sudhir Mishra& Other Indian Realities"( 2013, non fiction)., I Am Offended!( 2015, non fiction) and Par Ek Din( 2017, non fiction). The last three films were made part- time, and therefore on a limited scale. In 2013," Hulla" was included in a book on unsung Mumbai cinema classics over 50 years, a book called" 40 Retakes" by Avijit Ghosh. " Leaving Home" was the first documentary in the history of Indian cinema to release nationally in theatres. It also opened the Indian Panorama at the Goa International Film Festival in 2010 and won the National Film Award in 2011. At the 58th National Film Awards, the documentary went on to win the Award for Best Arts/ Cultural Film. " Baavra Mann" won the" Best Documentary" award at the Washington DC South Asian Film Festival, 2013. His third full- length documentary film was on stand- up comedy in India and the larger context of contemporary Indian humour. The film is called" I Am Offended" and it released free on Youtube in February 2015 and has over 1.5 million views- the only Indian full- length feature online to have these many views. Before that, he published a novel(" Local") in 2005. Between 1989 and 2000, he worked in advertising as a copywriter( in agencies like Mudra Communications, Ogilvy& Mather, Everest Saatchi& Saatchi, Nexus Equity and Cornerstone). He also wrote for various publications primarily on music, most notably for the magazine" Gentleman( magazine)" between 1998 and 2001. In March 2009, he accidentally created the Impact Index – an alternative statistical system in cricket. It has gone on to become the most written about alternative statistical system in the history of the game. From 2010 to 2017, he worked full- time on this. In early- 2017, he also released a book Numbers Do Lie- 61 Hidden Cricket Facts on behalf of Impact Index( conceived by him) with cricketer and commentator" Aakash Chopra"( published by HarperCollins). Cricket legend" Greg Chappell" had this to say after reading the book- This book has started a fascinating conversation that will change the face of the way we look at the game and those who have played it."', 'title': 'Jaideep Varma'}
