 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Coney Island Baby is a 2003 comedy- drama in which film producer Amy Hobby made her directorial debut. Karl Geary wrote the film and Tanya Ryno was the film\'s producer. The music was composed by Ryan Shore. The film was shot in Sligo, Ireland, which is known locally as" Coney Island". The film was screened at the Newport International Film Festival. Hobby won the Jury Award for" Best First Time Director". The film made its premiere television broadcast on the Sundance Channel.', 'title': 'Coney Island Baby (film)'}
