 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Basic Instinct 2( also known as Basic Instinct 2: Risk Addiction) is a 2006 erotic thriller film and the sequel to 1992\'s" Basic Instinct". The film was directed by Michael Caton- Jones and produced by Mario Kassar, Joel B. Michaels and Andrew G. Vajna. The screenplay was by Leora Barish and Henry Bean. It stars Sharon Stone, who reprises her role of Catherine Tramell from the original, and David Morrissey. The film is an international co-production of Germany, the United Kingdom, the United States and Spain. The film follows novelist and suspected serial killer Catherine Tramell, who is once again in trouble with the authorities. Scotland Yard appoints psychiatrist Dr. Michael Glass to evaluate her after. As with Detective Nick Curran in the first film, Glass becomes a victim of Tramell\'s seductive games. After being in development limbo for several years, the film was shot in London from April to August 2005, and was released on 31 March 2006. Following numerous cuts, it was released with an R rating for" strong sexuality, nudity, violence, language, and some drug content". Unlike its predecessor, the film received negative reviews and fell short of commercial expectations.', 'title': 'Basic Instinct 2'}
