 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Broadway Rhythm( 1944) is a Metro- Goldwyn- Mayer Technicolor musical film. It was produced by Jack Cummings and directed by Roy Del Ruth. The film was originally announced as" Broadway Melody of 1944" to follow MGM\'s" Broadway Melody" films of 1929, 1936, 1938, and 1940. It was originally slated to star Eleanor Powell and Gene Kelly, but Louis B. Mayer and MGM loaned Kelly out to Columbia to play opposite Rita Hayworth in" Cover Girl"( 1944). The film instead starred George Murphy, who had appeared in" Broadway Melody of 1938" and" Broadway Melody of 1940." Mayer then replaced Powell with Ginny Simms. Other cast members included Charles Winninger, Gloria DeHaven, Lena Horne, Nancy Walker, Eddie" Rochester" Anderson, the Ross Sisters, and Ben Blue, as well as Tommy Dorsey and his orchestra.', 'title': 'Broadway Rhythm'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Norman Rae Taurog( February 23, 1899 – April 7, 1981) was an American film director and screenwriter. From 1920 to 1968, Taurog directed 180 films. At the age of 32, he received the Academy Award for Best Director for" Skippy"( 1931). He is the second youngest person ever to win the award after Damien Chazelle, who won for" La La Land" in 2017. He was later nominated for Best Director for the film" Boys Town"( 1938). He directed some of the best- known actors of the twentieth century, including his nephew Jackie Cooper, Spencer Tracy, Mickey Rooney, Judy Garland, Deanna Durbin, Fred Astaire, Gene Kelly, Deborah Kerr, Peter Lawford, Dean Martin, Jerry Lewis, and Elvis Presley. Taurog directed six Martin and Lewis films, and nine Elvis Presley films, more than any other director. For his contribution to the motion picture industry, Norman Taurog has a star on the Hollywood Walk of Fame at 1600 Vine Street.', 'title': 'Norman Taurog'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Nikita Sergeyevich Mikhalkov( born 21 October 1945) is a Russian filmmaker, actor, and head of the Russian Cinematographers\' Union. Mikhalkov is a three- time laureate of the State Prize of the Russian Federation( 1993, 1995, 1999) and is a Full Cavalier of the Order" For Merit to the Fatherland". Nikita Mikhalkov won the Golden Lion of the Venice Film Festival( 1991) and nominated for the Academy Award( 1993) in the category" Best Foreign Language Film" for the film" Close to Eden". Winner of the Academy Award( 1995) in the category" Best Foreign Language Film" and the Grand Prix of the Cannes Film Festival( 1994) for the film" Burnt by the Sun". Mikhalkov received the" Special Lion" of the Venice Film Festival( 2007) for his contribution to the cinematography and nominated for the Oscar( 2008) in the category" Best Foreign Language Film" for the film" 12".', 'title': 'Nikita Mikhalkov'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Broadway Melody of 1936 is a musical film released by Metro- Goldwyn- Mayer in 1935. In New York, the film opened at the Capitol Theatre, the site of many prestigious MGM premieres. It was a follow- up of sorts to the successful" The Broadway Melody", which had been released in 1929, although, there is no story connection with the earlier film beyond the title and some music. The film was written by Harry W. Conn, Moss Hart, Jack McGowan and Sid Silvers. It was directed by Roy Del Ruth and starred Jack Benny, Eleanor Powell, Robert Taylor, June Knight, Frances Langford, Sid Silvers, Buddy Ebsen and Vilma Ebsen( in their first film debut). It was nominated for the Academy Award for Best Picture.', 'title': 'Broadway Melody of 1936'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Broadway Melody of 1940 is a 1940 MGM film musical starring Fred Astaire, Eleanor Powell and George Murphy. It was directed by Norman Taurog and features music by Cole Porter, including" Begin the Beguine". The film was the fourth and final entry in MGM\'s" Broadway Melody" series of films, and is notable for being the only on- screen pairing of Astaire and Powell, who were considered the finest film musical dancers of their time.', 'title': 'Broadway Melody of 1940'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Broadway Melody, also known as The Broadway Melody of 1929, is a 1929 American pre-Code musical film and the first sound film to win an Academy Award for Best Picture. It was one of the first musicals to feature a Technicolor sequence, which sparked the trend of color being used in a flurry of musicals that would hit the screens in 1929 – 1930. Today the Technicolor sequence is lost; only a black and white copy survives in available versions. The film was the first musical released by Metro- Goldwyn- Mayer and was Hollywood\'s first all- talking musical. " The Broadway Melody" was written by Norman Houston and James Gleason from a story by Edmund Goulding, and directed by Harry Beaumont. Original music was written by Arthur Freed and Nacio Herb Brown, including the popular hit" You Were Meant for Me". The George M. Cohan classic" Give My Regards to Broadway" is used under the opening establishing shots of New York City, its film debut. Bessie Love was nominated for an Academy Award for Best Actress for her performance.', 'title': 'The Broadway Melody'}
