 {'idx': 1, 'is_supporting': True, 'paragraph_text': "John Quinn( April 14, 1870 in Tiffin, Ohio – July 28, 1924 in Fostoria, Ohio) was an Irish- American cognoscente of the art world; and a lawyer in New York City who fought to overturn censorship laws restricting modern literature and art from entering the United States. Quinn was an important patron of chief figures in Post-impressionism and literary Modernism; a major collector of modern art and original manuscripts; and the first to exhibit these works after winning legal battles against censorship and cultural isolation. In the 1920s he owned the largest single collection of modern European paintings in the world. He fought key legal battles that opened American culture to 20th century art movements, including his Congressional appeals to overturn the Payne – Aldrich Tariff Act. He staged the first great exhibit of European modern art in America at the 69th Regiment( Fightin' Irish) Armory, New York, in 1913.", 'title': 'John Quinn (collector)'}
