 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Professor Marston and the Wonder Women is a 2017 American biographical drama film about American psychologist William Moulton Marston, who created the fictional character Wonder Woman. The film, directed and written by Angela Robinson, stars Luke Evans as Marston, Rebecca Hall as his legal wife Elizabeth and Bella Heathcote as the Marstons' polyamorous life partner, Olive Byrne. JJ Feild, Oliver Platt and Connie Britton also feature. The film premiered at the 2017 Toronto International Film Festival and was released in the United States on October 13, 2017. It received positive reviews from critics, who praised Robinson's direction and the performances of its stars.", 'title': 'Professor Marston and the Wonder Women'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'John Joseph Feild( born 1978) is a British- American film, television and theatre actor. He started his television career in 1999. Feild played Fred Garland in Philip Pullman\'s" The Ruby in the Smoke" and" The Shadow in the North" television adaptations. In 2007, he starred as Henry Tilney in the television film" Northanger Abbey". The following year, he made his West End debut in a production of" Ring Round the Moon". From 2014–2016, Feild portrayed Major John André in. Feild\'s film credits include" Telstar"( 2009),( 2011)," Austenland"( 2013), and" Professor Marston and the Wonder Women"( 2017).', 'title': 'JJ Feild'}
