 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Rebecca Maria Hall( born 3 May 1982) is a British actress. Hall made her first onscreen appearance at age 10 in the 1992 television adaptation of" The Camomile Lawn", directed by her father Peter Hall. Her professional stage debut came in her father\'s 2002 production of" Mrs. Warren\'s Profession", which earned her enthusiastic reviews and the Ian Charleson Award. Following her film debut in" Starter for 10"( 2006), Hall got her breakthrough role that same year in Christopher Nolan\'s thriller film" The Prestige". In 2008, Hall starred as Vicky in Woody Allen\'s romantic comedy- drama" Vicky Cristina Barcelona", for which she received a Golden Globe nomination for Best Actress. She then appeared in a wide array of films, including Ron Howard\'s historical drama" Frost/ Nixon"( 2008), Ben Affleck\'s crime drama" The Town"( 2010), the horror thriller" The Awakening"( 2011), the superhero movie" Iron Man 3"( 2013), the science fiction film" Transcendence"( 2014), the psychological thriller" The Gift"( 2015) and the biographical drama" Professor Marston and the Wonder Women"( 2017). In 2016, Hall was praised by critics for her portrayal of reporter Christine Chubbuck in the biographical drama" Christine". Hall has also made several notable appearances on British television. She won the British Academy Television Award for Best Supporting Actress for the 2009 Channel 4 miniseries" Red Riding: 1974". In 2013, she was nominated for the British Academy Television Award for Best Actress for her performance in BBC Two\'s" Parade\'s End".', 'title': 'Rebecca Hall'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Luke George Evans( born 15 April 1979) is a Welsh actor and singer. Evans began his career on the stage, performing in many of London\'s West End productions such as" RentMiss Saigon", and" Piaf" before making his film breakthrough in the" Clash of the Titans" 2010 remake. Following his debut, Evans was cast in such action and thriller films as" Immortals"( 2011)," The Raven"( 2012), and the re-imagined" The Three Musketeers"( 2011). In 2013, Evans starred as the main antagonist Owen Shaw in the blockbuster" Fast& Furious 6", and also played Bard the Bowman in Peter Jackson\'s three- part adaptation of J. R. R. Tolkien\'s" The Hobbit". Evans also portrayed the vampire Dracula in the character\'s film origin story," Dracula Untold". In 2017, Evans starred as Gaston in Disney\'s live- action adaptation of" Beauty and the Beast", and portrayed American psychologist William Moulton Marston, creator of fictional character Wonder Woman, in the biographical drama" Professor Marston and the Wonder Women". He released his debut album" At Last" on 22 November 2019.', 'title': 'Luke Evans'}]

