 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Louis, Prince of Nassau- Saarbrücken( 3 January 1745 in Saarbrücken – 2 March 1794 in Aschaffenburg) was the last ruling prince of Nassau- Saarbrücken. He ruled from 1768 until the French Revolution.', 'title': 'Louis, Prince of Nassau-Saarbrücken'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Charles William( 9 November 1735 – 17 May 1803) was Prince of Nassau- Usingen from 1775 until his death. From 1797 until his death, he was also titular Prince of Nassau- Saarbrücken, however, Nassau- Saarbrücken was occupied by France during that period. He was born in Usingen, the eldest son of Prince Charles of Nassau- Usingen and his wife, Christina Wilhelmina, the daughter of Duke John William III of Saxe- Eisenach. In 1770, Charles William became Lieutenant- General in the Dutch army. In 1789, he was promoted to general and in 1790 to colonel of the Walloon regiment and captain of the grenadiers. In 1775, he succeeded his father as Prince of Nassau- Usingen. In 1783, he concluded a treaty of inheritance with the princes of Nassau- Saarbrücken, Nassau- Weilburg and Nassau- Dietz( i.e., Orange- Nassau), in which it was agreed that the Nassau lands were indivisible and that mutual succession among the various branches based on primogeniture would be observed. In 1797, Prince Henry Louis of Nassau- Saarbrücken died childless and Charles William inherited his principality. However, under the Treaty of Lunéville, the territories on the left bank of the Rhine were lost to France. The Reichsdeputationshauptschluss of 1803 compensated Charles William with territories taken from the Electorate of Mainz, the Electorate of Cologne, Electorate of the Palatinate and Hesse. Charles William died later that year. Since he had no male heir, he was succeeded by his younger brother Frederick Augustus.', 'title': 'Charles William, Prince of Nassau-Usingen'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Crato, Count of Nassau-Saarbrücken (7 April 1621 – 25 July 1642, Straelen), was the oldest son of Count William Louis of Nassau-Saarbrücken and his wife, Landgravine Anna Amalia of Baden-Durlach. He succeeded his father as Count of Nassau-Saarbrücken in 1640. However, as he was still a minor at the time, he stood under the regency of his mother. Crato was killed in battle at Straelen in 1642. He was succeeded by his younger brother John Louis.', 'title': 'Crato, Count of Nassau-Saarbrücken'}
