 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Philip IV of Nassau- Weilburg, also known as Philip III of Nassau- Saarbrücken( 14 October 1542 in Weilburg – 12 March 1602 in Saarbrücken) was Count of Nassau- Weilburg from 1559 until his death and since 1574 also Count of Nassau- Saarbrücken. Both possessions belonged to the Walram line of the House of Nassau. In Weilburg, he was the fourth count named Philip, but only the third in Saarbrücken, because his father, Philip III of Nassau- Weilburg never held Nassau- Saarbrücken.', 'title': 'Philip IV, Count of Nassau-Weilburg'}
