[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Aldetrude (died c. 696, or 526) was a Christian saint and from 684 was abbess of Maubeuge Abbey in the County of Hainault, now in northern France. She is also known as Aldetrude de Maubeuge, Aldetrude of Maubod, Aldetrudis and Adeltrude. She was one of the four children of Saint Waltrude, also known as Waldetrude, her siblings being Saint Landericus, a bishop of Paris; Saint Dentelin who died very young; and Saint Madelberta, who was also abbess of Maubeuge. Her aunt Aldegonde, her mother\'s sister, was the first abbess of Maubeuge; Aldetrude was sent into her care as a girl and then succeeded her, and her sister Madelberte was the third abbess. She died and is celebrated on the 25 or 27 February. The exact year of her death is unknown though some sources say c. 696, and she is said to have lived to an advanced age. In "The Book of Saints: A Comprehensive Biographical Dictionary" (2015), "edited ... on behalf of the Benedictine Monks of St. Augustine\'s Abbey, Chilworth" it is stated that "Her extant biography is unreliable" and "The revised Roman Martyrology has her 170 years earlier", giving a death date of 526.', 'title': 'Aldetrude'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The place of birth( POB) or birthplace is the place where a person was born. This place is often used in legal documents, together with name and date of birth, to uniquely identify a person. As a general rule with respect to passports, the place of birth is determined to be the country that currently has" sovereignty" over the actual place of birth, regardless of when the birth actually occurred. The place of birth is not necessarily the place where the parents of the new baby live. If the baby is born in a hospital in another place, that place is the place of birth. In many countries, this also means that the government requires that the birth of the new baby is registered in the place of birth. Some countries place less or no importance on the place of birth, instead using alternative geographical characteristics for the purpose of identity documents. For example, Sweden has used the concept of" födelsehemortdomicile of birth") since 1947. This means that the domicile of the baby\'s mother is the registered place of birth. The location of the maternity ward or other physical birthplace is considered unimportant. Similarly, Switzerland uses the concept of" Heimatortlieu d\'origineluogo d\'origineplace of origin" in German, French and Italian respectively). A child born to Swiss parents is automatically assigned the place of origin of the parent with the same last name, so the child either gets their mother\'s or father\'s place of origin. A child born to one Swiss parent and one foreign parent acquires the place of origin of their Swiss parent. In a Swiss passport and identity card, the holder\'s place of origin is stated, not their place of birth. In some countries( primarily in the Americas), the place of birth automatically determines the nationality of the baby, a practice often referred to by the Latin phrase" jus soli". Almost all countries outside the Americas instead attribute nationality based on the nationality( ies) of the baby\'s parents( referred to as" jus sanguinis"). There can be some confusion regarding the place of birth if the birth takes place in an unusual way: when babies are born on an airplane or at sea, difficulties can arise. The place of birth of such a person depends on the law of the countries involved, which include the nationality of the plane or ship, the nationality( ies) of the parents and/ or the location of the plane or ship( if the birth occurs in the territorial waters or airspace of a country). Some administrative forms may request the applicant\'s" country of birth". It is important to determine from the requester whether the information requested refers to the applicant\'s" place of birth" or" nationality at birth". For US citizens born abroad who under the US Constitution acquire US citizenship at the time of birth, the nationality at birth will be USA( American), while the place of birth would be the country in which the actual birth takes place.', 'title': 'Place of birth'}
