 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Paul Maurice Kelly (born 13 January 1955) is an Australian rock music singer-songwriter and guitarist. He has performed solo, and has led numerous groups, including the Dots, the Coloured Girls, and the Messengers. He has worked with other artists and groups, including associated projects Professor Ratbaggy and Stardust Five. Kelly\'s music style has ranged from bluegrass to studio-oriented dub reggae, but his core output straddles folk, rock, and country. His lyrics capture the vastness of the culture and landscape of Australia by chronicling life about him for over 30 years. David Fricke from "Rolling Stone" calls Kelly "one of the finest songwriters I have ever heard, Australian or otherwise. " Kelly has said, "Song writing is mysterious to me. I still feel like a total beginner. I don\'t feel like I have got it nailed yet". After growing up in Adelaide, Kelly travelled around Australia before settling in Melbourne in 1976. He became involved in the pub rock scene and drug culture, and recorded two albums with Paul Kelly and the Dots. Kelly moved to Sydney by 1985, where he formed Paul Kelly and the Coloured Girls. The band was renamed Paul Kelly and the Messengers, initially only for international releases, to avoid possible racist interpretations. At the end of the 1980s, Kelly returned to Melbourne, and in 1991 he disbanded the Messengers. Kelly was married and divorced twice; he has three children and resides in St Kilda, a suburb of Melbourne. Dan Kelly, his nephew, is a singer and guitarist in his own right. Dan performed with Kelly on "Ways and Means" and "Stolen Apples". Both were members of Stardust Five, which released a self-titled album in 2006. On 22 September 2010 Kelly released his memoir, "How to Make Gravy", which he described as "it\'s not traditional; it\'s writing around the A–Z theme – I tell stories around the song lyrics in alphabetical order". His biographical film, , directed by Ian Darling, was released to cinemas in October 2012. Kelly\'s Top 40 singles include "Billy BaxterBefore Too LongDarling It HurtsTo Her Door" (his highest-charting local hit in 1987) , "Dumb Things" (appeared on United States charts in 1988), and "Roll on Summer". Top-20 albums include "GossipUnder the SunComedySongs from the South" (1997 compilation), "... Nothing but a DreamStolen ApplesSpring and FallThe Merri Soul SessionsSeven Sonnets and a SongDeath\'s Dateless Night" (with Charlie Owen) , "Life Is Fine" – his first number-one album – and "Nature". Kelly has won 14 Australian Recording Industry Association (ARIA) Music Awards, including his induction into their Hall of Fame in 1997. In 2001 the Australasian Performing Right Association (APRA) listed the Top 30 Australian songs of all time, which included Kelly\'s "To Her Door", and "Treaty", written by Kelly and members of Yothu Yindi. Aside from "Treaty", Kelly wrote or co-wrote several songs on Indigenous Australian social issues and historical events. He provided songs for many other artists, tailoring them to their particular vocal range. The album "Women at the Well" from 2002 had 14 female artists record his songs in tribute. Kelly was appointed as an Officer of the Order of Australia in 2017 for distinguished service to the performing arts and to the promotion of the national identity through contributions as a singer, songwriter and musician.', 'title': 'Paul Kelly (Australian musician)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Kaarin Louise Fairfax (born 30 September 1959) is an Australian actress, director and singer who played the role of \'Dolour Darcy\' in two TV miniseries "The Harp in the South" (1986) and its sequel "Poor Man\'s Orange" (1987) based on books of the same names by Ruth Park. She has also acted in other Australian television series throughout the 1980s, 1990s and 2000s, and recorded music under the name of Mary-Jo Starr. Fairfax had the role of \'Deb Mathieson\' on Australian Broadcasting Corporation TV series, "Bed of Roses" (2008, 2010). Fairfax played the mother in the Rachel Perkins 2001 short film "One Night the Moon", a story of racial prejudice in the outback. Fairfax is the former partner of Australian musician Paul Kelly—they met in 1988— their two children are Madeleine (born 1991) and Memphis (born 1993). Memphis appeared with her parents in "One Night the Moon", the couple separated not long after the film\'s release. She appeared in the Australian sitcom "Col\'n Carpenter", a spin-off from "The Comedy Company", after Vicki Blanche left the series. By 2008, Fairfax had established The Little Theatre Company in Frankston, Victoria, in honour of her father George Fairfax. Fairfax directed "Frankston Lights" in January 2009, it was a musical which included songs co-written by Madeleine and Memphis and Robert McHugh. Kaarin has been working extensively since that time, joining forces with Sally Baillieu and directing The Wetlands Project, One Last Chance- performed in the Wetlands at Tootgarook. She runs with Sally The Lineup at Frankston Arts Centre Cube37. A musical mentorship program for young emerging artists. In January 2012 she directed "Good People" for Red Stitch Actors Theatre. Her children Madeleine and Memphis have recorded their first EP with additional band member Sam Humphrey. The band\'s name is Wishful, the EP is called Fifty Days and it was produced by their father Paul Kelly. Kaarin and Sally have an Arts program on 3RPP Radio Port Phillip on the Mornington Peninsula, called Arts About. In 2015, she co-starred in the film "StalkHer".', 'title': 'Kaarin Fairfax'}
