 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Eystein Glumra(" Eystein the Noisy" or" Eystein the Clatterer"; Modern Norwegian" Øystein Glumra") also known as Eystein Ivarsson, was reputedly a petty king on the west coast of Norway, during the 9th Century. The" Heimskringla" saga states that Eystein Glumra was the father of Rognvald Eysteinsson and Sigurd Eysteinsson:" The first earl in the Orkney Islands was called Sigurd, who was a son of Eystein Glumra, and brother of Ragnvald earl of More. After Sigurd, his son Guthorm was earl for one year. After him Torf- Einar, a son of Ragnvald, took the earldom, and was long earl, and was a man of great power". According to the" Orkneyinga Saga", Eystein Glumra was the son of Ivar the jarl of Uplanders and grandson of Halfdan the Old. " Orkneyinga Saga" also named Eystein Glumra as the father of Rognvald Eysteinsson:" Heiti, Gorr ’s son, was father of Sveiði the sea-king,[ who was] the father of Halfdan the old,[ who was] the father of Ivar the Uplanders ’ earl,[ who was] the father of Eystein the noisy,[ who was] the father of earl Rognvald the mighty and wise in council". Linnea Hartsuyker\'s books The Half- drowned King and The Sea Queen cover the lives of Eystein\'s children.', 'title': 'Eystein Glumra'}
