 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Emperor Go- Daigo( 後醍醐天皇" Go- Daigo- tennō") ( November 26, 1288 – September 19, 1339) was the 96th emperor of Japan, according to the traditional order of succession. He successfully overthrew the Kamakura shogunate in 1333 and established the short lived Kenmu Restoration to bring the Imperial House back into power. This was to be the last time the emperor had any power until the Meiji Restoration in 1868. The Kenmu restoration was in turn overthrown by Ashikaga Takauji in 1336, ushering in the Ashikaga shogunate, and split the imperial family into two opposing factions between the Ashikaga backed Northern Court situated in Kyoto and the Southern Court based in Yoshino led by Go- Daigo and his later successors. This 14th- century sovereign personally chose his posthumous name after the 9th- century Emperor Daigo and" go-"( 後), translates as" later", and he is thus sometimes called the" Later Emperor Daigo", or, in some older sources," Daigo, the second" or as" Daigo II".', 'title': 'Emperor Go-Daigo'}]

