 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Marie Antoinette (born Maria Antonia Josepha Johanna; 2 November 1755 – 16 October 1793) was the last Queen of France before the French Revolution. She was born an Archduchess of Austria and was the penultimate child and youngest daughter of Empress Maria Theresa and Francis I, Holy Roman Emperor. She became Dauphine of France in May 1770 at age 14 upon her marriage to Louis-Auguste, heir apparent to the French throne. On 10 May 1774, her husband ascended the throne as Louis XVI and she assumed the title Queen of France and Navarre, which she held until September 1791, when she became Queen of the French as the French Revolution proceeded, a title that she held until 21 September 1792. After eight years of marriage, Marie Antoinette gave birth to Marie Thérèse, the first of her four children. A growing percentage of the population came to dislike her, accusing her of being profligate and promiscuous and of harboring sympathies for France's enemies, particularly her native Austria. The Affair of the Diamond Necklace damaged her reputation further. During the Revolution, she became known as Madame Déficit because the country's financial crisis was blamed on her lavish spending and her opposition to the social and financial reforms of Turgot and Necker. Several events were linked to Marie Antoinette during the Revolution after the government had placed the royal family under house arrest in the Tuileries Palace in October 1789. The June 1791 attempted flight to Varennes and her role in the War of the First Coalition had disastrous effects on French popular opinion. On 10 August 1792, the attack on the Tuileries forced the royal family to take refuge at the Assembly, and they were imprisoned in the Temple Prison on 13 August. On 21 September 1792, the monarchy was abolished. Louis XVI was executed on 21 January 1793. Marie Antoinette's trial began on 14 October 1793, and two days later she was convicted by the Revolutionary Tribunal of high treason and executed by guillotine on the Place de la Révolution.", 'title': 'Marie Antoinette'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Marie-Thérèse Charlotte of France (19 December 1778 – 19 October 1851), "Madame Royale", was the eldest child of Louis XVI and Marie Antoinette, and the only one to reach adulthood (her siblings all dying before the age of 11). She was married to Louis Antoine, Duke of Angoulême, who was the eldest son of the future Charles X, her father\'s younger brother; thus the bride and groom were also first cousins. After her marriage, she was known as the Duchess of Angoulême. She became the Dauphine of France upon the accession of her father-in-law to the throne of France in 1824. Technically she was Queen of France for twenty minutes, on 2 August 1830, between the time her father-in-law signed the instrument of abdication and the time her husband, reluctantly, signed the same document.', 'title': 'Marie Thérèse of France'}]

