[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Esmé Stewart, 1st Duke of Lennox, 1st Earl of Lennox (154226 May 1583) was the son of John Stewart, 5th Lord of Aubigny, who was the younger brother of Matthew Stewart, 4th Earl of Lennox, and his wife Anne de la Queuille. Sir James Melville described him as "of nature, upright, just, and gentle".', 'title': 'Esmé Stewart, 1st Duke of Lennox'}
