 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Ludovic Stewart, 2nd Duke of Lennox and 1st Duke of Richmond( 29 September 157416 February 1624), was a Scottish nobleman and politician. He was the son of Esmé Stewart, 1st Duke of Lennox, and his wife, Catherine de Balsac. Ludovic was involved in the Plantation of Ulster in Ireland and the colonization of Maine in New England. Richmond's Island and Cape Richmond, as well as Richmond, Maine( formerly Fort Richmond), are named for him.", 'title': 'Ludovic Stewart, 2nd Duke of Lennox'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Lord Bernard Stewart( 1623 – 26 September 1645) was a Scottish aristocrat who served as a Royalist commander in the English Civil War. He was the youngest of the five sons of Esmé Stewart, 3rd Duke of Lennox, and his wife Katherine Clifton, 2nd Baroness Clifton, and the brother of James Stewart, 1st Duke of Richmond. Lord Bernard was to be created Earl of Lichfield by King Charles I for his actions at the first and second battles of Newbury and Naseby but died of injuries received leading a sortie against besieging Parliamentary forces in the Battle of Rowton Heath in September 1645, before the patent could be implemented. The titles of Baron Newbury and Earl of Lichfield were instead created in December 1645 for his six- year- old nephew, Charles Stewart( 1639 – 1672), the son of Bernard's elder brother George Stewart, 9th Seigneur d'Aubigny, who had been killed at the Battle of Edgehill in 1642. His brother John was also killed in the war.", 'title': 'Lord Bernard Stewart'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Marie Stewart, Countess of Mar( d. 1644), was a Scottish courtier. Marie was the daughter of Esmé Stewart, 1st Duke of Lennox, a favourite of James VI of Scotland, and Catherine de Balsac.', 'title': 'Marie Stewart, Countess of Mar'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Esmé Stewart, 3rd Duke of Lennox KG (157930 July 1624) was the son of Esmé Stewart, 1st Duke of Lennox and Catherine de Balsac. He was a patron of the playwright Ben Jonson, who lived in his household for five years. At the death of his brother the 2nd Duke of Lennox, he was already Earl of March and Lord Clifton of Leighton Bromswold in the peerage of England (1619) as well as 7th Seigneur d\'Aubigny. On 9 February 1608 he performed in the masque "The Hue and Cry After Cupid" at Whitehall Palace as a sign of the zodiac, to celebrate the wedding of John Ramsay, Viscount Haddington to Elizabeth Radclyffe . He married Katherine Clifton, 2nd Baroness Clifton, in 1609. They had eleven children: He died in 1624 and was interred, on 6 August 1624, in Westminster Abbey.', 'title': 'Esmé Stewart, 3rd Duke of Lennox'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Lord John Stewart( 23 October 1621 – 29 March 1644) was a Scottish aristocrat who served as a Royalist commander in the English Civil War. He was one of five sons of Esmé Stewart, 3rd Duke of Lennox and his wife Katherine Clifton, 2nd Baroness Clifton, and the brother of James Stewart, 1st Duke of Richmond. With his youngest brother, Lord Bernard Stewart, he embarked on a three- year tour of the continent in 1639, before returning to join the King ’s cause in the Civil War as a General. He was killed at the Battle of Cheriton near Alresford, Essex, on 29 March 1644. Only one of his brothers, Lodovic, survived the war to see the restoration of the monarchy in 1660.', 'title': 'Lord John Stewart'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Charles Stewart, 3rd Duke of Richmond, 6th Duke of Lennox KG( 7 March 1639 December 1672) was the only son of George Stewart, 9th Seigneur d\'Aubigny and Katherine Howard, daughter of Theophilus Howard, 2nd Earl of Suffolk. He was the grandson of Esmé Stewart, 3rd Duke of Lennox. On 10 December 1645 he was created Baron Stuart of Newbury, Berkshire, and Earl of Lichfield, titles conferred on him" to perpetuate the titles which were intended to have been conferred on his uncle" Lord Bernard Stewart, youngest son of the Duke of Lennox, who had been killed in the Battle of Rowton Heath in the English Civil War in September of that year. In January 1658, Charles Stewart went into exile in France, and took up his residence in the house of his uncle, Ludovic, seigneur d\'Aubigny. In the following year he fell under the displeasure of The Protectorate\'s Council of State, and warrants were issued for seizing his person and goods. Charles Stewart married, firstly, Elizabeth Rogers, after June 1659. He married, secondly, Margaret Banaster( widow of William Lewis) on 31 March 1662. He married, thirdly, Frances Teresa Stewart, granddaughter of Walter Stewart, 1st Lord Blantyre, in March 1667. This last marriage was famous, as Frances Stewart, known at court as" Le Belle Stuart" had been desired by Richmond\'s cousin, King Charles II, as a mistress. Charles Stewart returned to England with Charles II in 1660, and sat in the Convention Parliament, showing great animosity towards the supporters of the Commonwealth. On the death of his 10- year- old cousin Esmé Stewart on 10 August 1660, Charles Stewart succeeded as third Duke of Richmond and sixth Duke of Lennox. In that same year he was created Hereditary Great Chamberlain of Scotland, Hereditary Great Admiral of Scotland, and Lord- Lieutenant of Dorset. On 15 April 1661 he was invested with the Order of the Garter. On the death of his uncle, Ludovic Stuart, he succeeded him as 12th Seigneur D\'Aubigny, for which title he did homage by proxy to Louis XIV of France on 11 May 1670. In July 1667, on the death of his cousin, Mary Butler, countess of Arran, he became Baron Clifton, and on 4 May 1668 he was made lord lieutenant and vice admiral of Kent jointly with the Earl of Winchilsea. In 1671 he was sent as ambassador to the Danish court to persuade Denmark to join England and France in a projected attack on the Dutch. While there he died( by drowning) in 1672, aged 33 at Elsinore, without issue, and his titles became extinct, with the exception of Baron Clifton, which passed with most of his property to his sister Katherine, Lady O\'Brien. His wife, however, had had the Lennox estates granted to her for life. He was buried on 20 September 1673 at Westminster Abbey. The titles Duke of Richmond, Duke of Lennox and Earl of March, were resurrected for Charles II\'s illegitimate son by Louise de Kérouaille, Charles Lennox, 1st Duke of Richmond and Lennox, in 1675.', 'title': 'Charles Stewart, 3rd Duke of Richmond'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "James Stewart, 1st Duke of Richmond, 4th Duke of Lennox KG ( 6 April 1612 – 30 March 1655) was a British nobleman. He was the eldest son of Esmé Stewart, 3rd Duke of Lennox and his wife Katherine Clifton, 2nd Baroness Clifton. James Stewart inherited the Dukedom of Lennox on his father's death( 30 June 1624) and was made a gentleman of the bedchamber in 1625, and knighted on 29 June 1630. He was invested as a knight of Order of the Garter in 1633. He married Mary Villiers, daughter of George Villiers, 1st Duke of Buckingham on 3 August 1637. A third cousin of Charles I of England, Stewart was a Privy Councillor and key member of Royalist party in the English Civil War. In 1641 – 42, he served as Lord Warden of the Cinque Ports. He spent five months in exile in 1643, returning to England to defend the city of Oxford for the king. He died on 30 March 1655 at age 42 and was buried in Westminster Abbey.", 'title': 'James Stewart, 1st Duke of Richmond'}]

