 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Adolf II of Berg- Hövel( Huvili), count of Berg, count in Auelgau and Siegburg, Vogt of Werden( died 1090/ 1106), was the son of Adolf I of Berg. He married Adelaide of Lauffen, a daughter of Heinrich II count von Laufen( died 1067) and Ida von Werl- Hövel( 1030? – 1090), and heiress of Hövel/ Huvili, Unna, Telgte, Warendorf, etc. At the beginning of the 12th century Adolf II of Berg donated the site of their old ancestral castle, Schloss Berg, to Cistercian monks from Burgundy. Adolf IV later built the Altenberg Abbey. He had issue:', 'title': 'Adolf II of Berg'}]

