 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'William de Courcy (sometimes William de Curci; died 1171) was an Anglo-Norman nobleman and baron. William was the son of William de Courcy and Avice de Rumilly, the daughter of William Meschin. William can be considered the baron of Stogursey in Somerset, through his paternal grandmother, who was the heiress of William de Falaise. The "head" of the barony was at Stogursey, but it also held lands in Northamptonshire, Oxfordshire, Devonshire, Wiltshire, and Essex. The bulk of the lands, however, were in Northamptonshire and Oxfordshire. In 1166, William owed just over 29 knight\'s fees for his lands from his father, plus another 17 fees for lands he inherited from his mother. In later years, William owed scutage on 24.75 fees for Stogursey and 16.5 for his mother\'s lands. He was royal steward, or dapifer. William married Gundrada, the daughter of Reginald de Warenne. Gundrada was the widow of Peter de Valognes. William died in 1171. His heir was a son, William de Courcy, who died in 1194. The elder William also had a daughter, Alice, who was his eventual heiress, after the death of her brother. Alice married Henry de Cornhill first and then after his death she married Warin fitzGerold.', 'title': 'William de Courcy (died 1171)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'René de Saussure( 17 March 1868 – 2 December 1943) was a Swiss Esperantist and professional mathematician( he defended in 1895 a doctoral thesis on a subject in geometry in Geneva), who composed important works about Esperanto and interlinguistics from a linguistic viewpoint. He was born in Geneva, Switzerland. His chef d\'oeuvre is an analysis on the logic of word construction in Esperanto," Fundamentaj reguloj de la vortteorio en EsperantoFundamental rules of word theory in Esperanto"), defending the language against several Idist critiques. He developed the concept of" neceso kaj sufiĉonecessity and sufficience") by which he opposed the criticism of Louis Couturat that Esperanto lacks recursion. In 1907, de Saussure proposed the international currency spesmilo. It was used by the Ĉekbanko esperantista and other British and Swiss banks until the First World War. Beginning in 1919, de Saussure proposed a series of Esperanto reforms, and in 1925, he renounced Esperanto in favor of his language Esperanto II. He later became a consultant for the International Auxiliary Language Association, the linguistic research body that standardized and presented Interlingua. He died on 2 December 1943 in Berne, Switzerland. René was the brother of the famous linguist Ferdinand de Saussure and the scholar of ancient Chinese astronomy, Léopold de Saussure. His father was the famous scientist, Henri Louis Frédéric de Saussure. A new silver Esperanto coin for 100 Steloj was struck in 2018 for the 150th birthday of René de Saussure.', 'title': 'René de Saussure'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'William Ford De Saussure (February 22, 1792March 13, 1870) was a United States Senator from South Carolina. Born in Charleston, the son of Henry William de Saussure and Elizabeth Ford De Saussure.', 'title': 'William F. De Saussure'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Henry William de Saussure (August 16, 1763 – March 26, 1839) was an American lawyer, state legislator and jurist from South Carolina who became a political leader as a member of the Federalist Party following the Revolutionary War. He was appointed by President George Washington as the 2nd Director of the United States Mint, was a co-sponsor of the legislation that established the South Carolina College which was to become the University of South Carolina and was given the title of Chancellor as a justice of the SC Equity Court, also known as chancery court. In this capacity he wrote and codified much of the state\'s equity law still in use today. He served as Intendant (Mayor) of Charleston while his son, William Ford de Saussure, likewise, served as Intendant (Mayor) of Columbia, SC. He was a principal investor in founding what was originally intended to be the city\'s Federalist leaning newspaper, the "Charleston Courier" in 1803. The newspaper still exists today as it was merged with others over the course of two centuries to become "The Post and Courier". As a sitting appellate court judge, his opinions on a variety of issues were widely published under a pseudonym, which was the custom then for public officials, particularly judges, who wished to express their views away from the bench. His opinions were highly critical of the summary abridgment of rights of the accused during the Denmark Vesey trials, purportedly in the name of public safety. He and others like him suspected there was less substance to the charges of a conspiracy to organize a slave revolt than the public in Charleston was being led to believe. He openly opposed Nullification along with other leading South Carolinians. After the Federalist Party faded in the early 1820s, he was a voice for Unionist moderation before a rising tide of States Rights supporters swept the stage of all others in South Carolina a generation later. Though deep political differences would eventually separate them, John C. Calhoun studied law in the offices of Henry de Saussure and Timothy Ford, his partner and brother-in-law. As a founder and early trustee of the University of South Carolina in Columbia, one of the original buildings located on the Horseshoe at the center of the campus, DeSaussure College, was named in his honor.', 'title': 'Henry William de Saussure'}
