 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Brian Boru (modern ; c. 94123 April 1014), was an Irish king who ended the domination of the High Kingship of Ireland by the Uí Néill. Bestowed the title of "Imperator Scottorum" or "Emperor of the Gaels" (commonly translated as "Emperor of the Irish"), he built on the achievements of his father, Cennétig mac Lorcain, and especially his elder brother, Mathgamain, Brian first made himself King of Munster, then subjugated Leinster, eventually becoming High King of Ireland. He was the founder of the O\'Brien dynasty, and is widely regarded as one of the most successful and unifying monarchs in medieval Ireland. With a population of under 500,000 people, Ireland had over 150 kings, with greater or lesser domains. The Uí Néill king Máel Sechnaill mac Domnaill, abandoned by his northern kinsmen of the Cenél nEógain and Cenél Conaill, acknowledged Brian as High King at Athlone in 1002. In the decade that followed, Brian campaigned against the northern Uí Néill, who refused to accept his claims, against Leinster, where resistance was frequent, and against the Norse-Gaelic Kingdom of Dublin. Brian\'s hard-won authority was seriously challenged in 1013 when his ally Máel Sechnaill was attacked by the Cenél nEógain king Flaithbertach Ua Néill, with the Ulstermen as his allies. This was followed by further attacks on Máel Sechnaill by the Dubliners under their king Sihtric Silkbeard and the Leinstermen led by Máel Mórda mac Murchada. Brian campaigned against these enemies in 1013. In 1014, Brian\'s armies confronted the armies of Leinster and Dublin. The resulting Battle of Clontarf saw Brian killed, his army nonetheless victorious against the Leinstermen and Norsemen. The battle is widely lauded as an instrumental moment in Irish history, and is well known in popular memory. Brian was well regarded by contemporary chroniclers. The Norse-Gaels and Scandinavians also produced works mentioning Brian, including "Njal\'s Saga", the "Orkneyinga Saga", and the now-lost "Brian\'s Saga". Brian\'s war against Máel Mórda and Sihtric was to be inextricably connected with his complicated marital relations, in particular his marriage to Gormlaith, Máel Mórda\'s sister and Sihtric\'s mother, who had been in turn the wife of Amlaíb Cuarán, king of Dublin and York, then of Máel Sechnaill, and finally of Brian.', 'title': 'Brian Boru'}
