 {'idx': 1, 'is_supporting': False, 'paragraph_text': '" To Dream Again" was the Maltese entry in the Eurovision Song Contest 2003, performed in English by Lynn. The song is a moderately up- tempo number, with Lynn telling her lover that he" made me dream again" and begging him not to let her" fall apart" by breaking her heart. Somewhat unusually among Contest entries, the title is never sung in its full form, however" dream again" makes several appearances in the lyrics. Lynn appeared playing a grand piano at the start of the song, but after the gentle opening, she discarded this, came out onto the front of the stage, and sang the rest of the song from there. She sported a pink top and white trousers. The song was performed fifth on the night( following Turkey\'s Sertab Erener with" Everyway That I Can" and preceding Bosnia and Herzegovina\'s Mija Martina with" Ne brini"). At the close of voting, it had received 4 points, placing 25th in a field of 26, at the time Malta\'s worst showing at the Contest. It was succeeded as Maltese representative at the 2004 Contest by Julie& Ludwig with" On Again ... Off Again". Official Versions and Remixes To Dream Again( Eurovision mix) To Dream Again( Radio Mix) To Dream Again( Club Mix) To Dream Again( Da Silva Chill Out Mix)', 'title': 'To Dream Again'}
