 {'idx': 8, 'is_supporting': False, 'paragraph_text': "David Ludovic George Hopetoun Carnegie, 11th Earl of Northesk (24 September 1901 – 7 November 1963) was elected a Scottish representative peer. He was also a skeleton competitor who won a bronze medal at the 1928 Winter Olympics. Carnegie was the son of David Carnegie, 10th Earl of Northesk and Elizabeth Boyle Hallowes. He was born at 6 Hans Crescent, London SW1 and educated at St. Aubyns Preparatory School, Rottingdean and Gresham's School, Holt. He succeeded his father as 11th earl on 5 December 1921 and won a bronze medal in skeleton at the 1928 Winter Olympics. From 1921 to 1923 he was on the supplementary list or reserve of Officers for the Coldstream Guards. On 19 July 1923 he married Jessica Ruth Brown, they divorced in 1928. He then married Elizabeth Vlasto, daughter of Anthony Augustus Vlasto, on 7 August 1929. During the Second World War he served in the Intelligence Corps and was demobilised as a Major in 1945, having finished his war time service at the Intelligence Corps Depot. He later farmed at Beer Farm, Binfield, Bracknell, Berkshire, as well as his parliamentary duties. He died childless in November 1963, and was succeeded by his first cousin John Carnegie, 12th Earl of Northesk. Northesk was one of a group of men who re-founded Reading Society of Model Engineers after WW2.", 'title': 'David Carnegie, 11th Earl of Northesk'}
