 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Rudolf I, also known as Rudolf of Habsburg (1 May 1218 – 15 July 1291), was Count of Habsburg from about 1240 and King of Germany from 1273 until his death. Rudolf\'s election marked the end of the "Great Interregnum" in the Holy Roman Empire after the death of the Hohenstaufen emperor Frederick II in 1250. Originally a Swabian count , he was the first Habsburg to acquire the duchies of Austria and Styria in opposition to his mighty rival, the Přemyslid king Ottokar II of Bohemia, whom he defeated in the 1278 Battle on the Marchfeld. The territories remained under Habsburg rule for more than 600 years, forming the core of the Habsburg Monarchy and the present-day country of Austria. Rudolf was the first king of the Romans of the Habsburg dynasty, and he played a vital role in raising the comital house to the rank of Imperial princes. He was also the first of a number of late medieval count-kings, so called by the historian Bernd Schneidmüller, from the rival noble houses of Habsburg, Luxembourg, and Wittelsbach, all striving after the Roman-German royal dignity, which ultimately was taken over by the Habsburgs in 1438.', 'title': 'Rudolf I of Germany'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Judith (13 March 1271 – 21 May 1297), also named Guta , a member of the House of Habsburg, was the youngest daughter of King Rudolf I of Germany and his wife Gertrude of Hohenburg. She was Queen of Bohemia and Poland from 1285 until her death by her marriage with the Přemyslid king Wenceslaus II.', 'title': 'Judith of Habsburg'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Rudolph II( or Rudolph the Kind)( died 10 April 1232) was Count of Habsburg in the Aargau and a progenitor of the royal House of Habsburg. He was the only son of Count Albert III of Habsburg and Ita of Pfullendorf. He married Agnes of Staufen. Rudolph was the father of Count Albert IV of Habsburg and Count Rudolph III of Habsburg and the grandfather of King Rudolph I of Germany.', 'title': 'Rudolph II, Count of Habsburg'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Judith of Hohenstaufen, also known as" Judith of Hohenstaufen" or" Judith of Swabia"( – 7 July 1191), a member of the Hohenstaufen dynasty, was Landgravine of Thuringia from 1150 until 1172 by her marriage with the Ludovingian landgrave Louis II. She was baptized as" Judith", but was commonly called" Jutta" or" Guta". Sometimes the Latinate form" Clementia" was used, or" Claritia" or" Claricia".', 'title': 'Judith of Hohenstaufen'}
