 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Adelaide of Poland( c. late 1170s/ early 1180s – 8 December 1211), was a Polish princess and member of the Piast dynasty. She was the daughter of Casimir II the Just, Duke of Sandomierz and High Duke of Poland, by his wife Helena of Znojmo, a Přemyslid princess. On basis of the inscription of her tombstone at the Dominican Church and Convent of St. James in Sandomierz and two different reports of Jan Długosz, modern historians agreed with the origin and facts from Adelaide's life. Today existed a dominant view in historiography consistent with her filiation and death date. According to them, Adelaide was indeed the daughter of Casimir II the Just and died in 1211, but was n't the foundress of the Convent of St. James and only another nun there. In the 19th century, appeared a theory which states that Adelaide was the daughter of Casimir I of Kuyavia, who entered in the Convent of St. James as a nun and died there in 1291. This view, accepted by several scholars, has been disputed. More recent historiography recognized her as the daughter of Casimir II the Just, founder of the Convent, in which was she buried after her death in 1211.", 'title': 'Adelaide of Poland'}
