 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Euphemia of Kuyavia( c. 1265 – March 18, 1308) was a Kuyavian princess, who was Queen consort of Galicia- Volhynia. She was the daughter of Casimir I of Kuyavia by his third wife Euphrosyne, daughter of Casimir I of Opole. Euphemia was sister of Władysław I the Elbow- high, she was wife of Yuri I of Galicia and mother of Andrew of Galicia and Lev II of Galicia. The only preserved evidence of Euphemia's existence is from Jan Długosz's Yearbooks, which reported that on March 18, 1308 Euphemia died and that she was the daughter of Prince Casimir and the wife of Yuri I, who died in the same year on April 21, which was also his birthday.", 'title': 'Euphemia of Kuyavia'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Gaze of Orpheus is derived from the antiquarian Greek myth of Orpheus and Eurydice. Following his descent into the Underworld Orpheus disobeys Hades ’ and Persephone ’s condition for release of his wife Eurydice. " To you this tale refers, Who seek to lead your mind Into the upper day; For he who overcome should turn back his gaze Towards the Tartarean cave, Whatever excellence he takes with him He loses when he looks on those below." [ “ Boethius, Consolation of Philosophy 3.52] The Gaze of Orpheus has since been evaluated by many a philosopher and literary critic. Common analogies are made between Orpheus ’s gaze and writing processes, philosophical interpretation, and artistic origins. Some of the most famous uses of the gaze of Orpheus can be found in Maurice Blanchot ’s work The Gaze of Orpheus, Geoffrey Sirc ’s, The Composition ’s Eye/ Orpheus ’s Gaze/ Cobain ’s Journals, and Jaques Lacan ’s work on the mirror stage', 'title': 'The Gaze of Orpheus'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'L\'Orfeide is an opera composed by Gian Francesco Malipiero who also wrote the Italian libretto, partly based on the myth of Orpheus and incorporating texts by Italian Renaissance poets. The work consists of three parts –" La morte delle maschere"( The death of the masks)," Sette canzoni"( Seven songs), and" Orfeo, ovvero L\'ottava canzone"( Orpheus, or The eighth song). It received its first complete performance on 5 November 1925 at the Stadttheater in Düsseldorf.', 'title': "L'Orfeide"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Testament of Youth is the first instalment, covering 1900 – 1925, in the memoir of Vera Brittain( 1893 – 1970). It was published in 1933. Brittain\'s memoir continues with" Testament of Experience", published in 1957, and encompassing the years 1925 – 1950. Between these two books comes" Testament of Friendship"( published in 1940), which is essentially a memoir of Brittain\'s close colleague and friend Winifred Holtby. A final segment of memoir, to be called" Testament of Faith" or" Testament of Time", was planned by Brittain but remained unfinished at her death. " Testament of Youth" has been acclaimed as a classic for its description of the impact of World War I on the lives of women and the middle- class civilian population of Great Britain. The book shows how the impact extended into the postwar years. It is also considered a classic in feminist literature for its depiction of a woman\'s pioneering struggle to forge an independent career in a society only grudgingly tolerant of educated women.', 'title': 'Testament of Youth'}
