 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Blood of a Poet( 1930) is an avant- garde film directed by Jean Cocteau, financed by Charles de Noailles and starring Enrique Riveros, a Chilean actor who had a successful career in European films. Photographer Lee Miller made her only film appearance in this movie, which features an appearance by the famed aerialist Barbette. It is the first part of the Orphic Trilogy, which is continued in" Orphée"( 1950) and concludes with" Testament of Orpheus"( 1960).', 'title': 'The Blood of a Poet'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Testament of Orpheus is a 1960 black- and- white film with a few seconds of color film spliced in. Directed by and starring Jean Cocteau, who plays himself as an 18th- century poet, the film includes cameo appearances by Pablo Picasso, Jean Marais, Charles Aznavour, Jean- Pierre Leaud and Yul Brynner. It is considered the final part of the Orphic Trilogy, following" The Blood of a Poet"( 1930) and" Orphée"( 1950). One critic described it as a" wry, self- conscious re-examination of a lifetime\'s obsessions" with Cocteau placing himself at the center of the mythological and fictional world he spun throughout his books, films, plays and paintings. The film includes numerous instances of" double takes", including one scene where Cocteau, walking past himself, looks back to see himself in what was described by one scholar as" a retrospective on the Cocteau" œuvre. " The New York Times" calls it" self- serving", noting that the pretension of the film was certainly intended by Cocteau as his last statement made on film:" as much a long- winded self- analysis as an extraordinary succession of visually arresting images".', 'title': 'Testament of Orpheus'}
