 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Tha Carter III is the sixth studio album by American rapper Lil Wayne, released on June 10, 2008, by Cash Money and Universal Motown. It follows a long string of mixtape releases and guest appearances on other hip hop and R&B artists records, helping to increase his exposure in the mainstream. Amid release delays and leaks, "Tha Carter III" became one of the most anticipated releases of 2008. It is widely regarded as one of Wayne’s best projects. The album debuted at number one on the U.S. "Billboard" 200 chart, selling 1,006,000 copies in its first week. It reached sales of 2.88 million copies by the end of 2008 and produced four singles that achieved chart success, including the international hit "Lollipop" and "Billboard" hits "A MilliGot Money", and "Mrs. Officer". Upon its release, "Tha Carter III" received universal acclaim from music critics and earned Lil Wayne several accolades, including a spot on "Rolling Stone"s list of the 500 Greatest Albums of All Time. It has been certified triple-platinum by the Recording Industry Association of America. " Tha Carter III" features appearances from Jay-Z, T-Pain, Robin Thicke, Busta Rhymes, and Kanye West, among others. It also features Static Major, who is credited posthumously following his death in February 2008.', 'title': 'Tha Carter III'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"( Drawing) Rings Around the World" is a song by Super Furry Animals and was the second single taken from the band\'s fifth album," Rings Around the World". The track reached number 28 on the UK Singles Chart on release in October 2001. Singer Gruff Rhys has described the song as being about" rings of communication around the world. All the rings of pollution". Critical reaction to the track was generally positive with many reviewers comparing the song to the work of other groups such as Status Quo, ELO and The Beach Boys. A promotional music video was produced to accompany"( Drawing) Rings Around the World"\'s release as a single. Directed by Pedro Romhanyi the video features images of fictional television stations including" SFA TV", which shows the band playing along with the track. An alternative video, directed by Sean Hillen, was included on the DVD version of" Rings Around the World" on its release in July 2001. This video features the lyrics to the track scrolling slowly from the bottom of the screen upwards in front of an image of a globe. The DVD version of" Rings Around the World" also includes a Llwybr Llaethog remix of"( Drawing) Rings Around the World".', 'title': '(Drawing) Rings Around the World'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Rings Around the World is the fifth studio album and the major label debut by Super Furry Animals. Released on 23 July 2001 by Epic Records in the United Kingdom, it was the first album by any artist to be simultaneously released on both audio CD and DVD. The record reached number 3 in the UK Albums Chart and includes the singles "Juxtapozed with U(Drawing) Rings Around the World" and "It\'s Not the End of the World?". The album, which singer Gruff Rhys describes as "a very ambitious project", was recorded between April and September 2000 at Monnow Valley Studios in Rockfield, Monmouthshire, Wales and Bearsville Studios, New York with the band acting as co-producers alongside Chris Shaw. The majority of the songs on "Rings Around the World" were written by Rhys on guitar and piano with keyboardist Cian Ciaran contributing "[A] Touch Sensitive" and "Miniature" as well as collaborating with other members of the band on "Run! Christian, Run!Alternate Route to Vulcan Street" and "No Sympathy". Ex-Beatle Paul McCartney and former Velvet Underground member John Cale make cameo appearances on the album. Musically "Rings Around the World" is an eclectic record incorporating pop, prog, punk, jungle, electronica, techno and death metal. Rhys has offered several explanations of the album\'s lyrical content, claiming the record is "about Earth, and the pollution of space" and also that it addresses the human condition. Critics meanwhile have referred to the record as "thematically eccentric" and lacking an "overarching theme". Critical reception was generally positive, with the album being nominated for 2001\'s Mercury Music Prize and placing at number one in "Mojo\'sbest albums of 2001" feature. Some reviews claimed it to be the best record of the band\'s career although the "NME" described it as the band\'s worst album.', 'title': 'Rings Around the World'}
