 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Trajan (18 September 538August 117) was Roman emperor from 98 to 117. Officially declared by the Senate "optimus princepsbest ruler"), Trajan is remembered as a successful soldier-emperor who presided over the greatest military expansion in Roman history, leading the empire to attain its maximum territorial extent by the time of his death. He is also known for his philanthropic rule, overseeing extensive public building programs and implementing social welfare policies, which earned him his enduring reputation as the second of the Five Good Emperors who presided over an era of peace and prosperity in the Mediterranean world. Trajan was born in Italica, close to modern Seville in present-day Spain, an Italic settlement in the Roman province of Hispania Baetica. Although misleadingly designated by some later writers as a provincial, his family came from Umbria and he was born a Roman citizen. Trajan rose to prominence during the reign of emperor Domitian. Serving as a legatus legionis in Hispania Tarraconensis, in 89 Trajan supported Domitian against a revolt on the Rhine led by Antonius Saturninus. In September 96, Domitian was succeeded by the old and childless Nerva, who proved to be unpopular with the army. After a brief and tumultuous year in power, culminating in a revolt by members of the Praetorian Guard, he was compelled to adopt the more popular Trajan as his heir and successor. Nerva died in 98 and was succeeded by his adopted son without incident. As a civilian administrator, Trajan is best known for his extensive public building program, which reshaped the city of Rome and left numerous enduring landmarks such as Trajan\'s Forum, Trajan\'s Market and Trajan\'s Column. Early in his reign, he annexed the Nabataean Kingdom, creating the province of Arabia Petraea. His conquest of Dacia enriched the empire greatly, as the new province possessed many valuable gold mines. Trajan\'s war against the Parthian Empire ended with the sack of the capital Ctesiphon and the annexation of Armenia and Mesopotamia. His campaigns expanded the Roman Empire to its greatest territorial extent. In late 117, while sailing back to Rome, Trajan fell ill and died of a stroke in the city of Selinus. He was deified by the Senate and his ashes were laid to rest under the Column. He was succeeded by his cousin Hadrian, whom Trajan supposedly adopted on his deathbed.', 'title': 'Trajan'}
