 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Mess was a French girl group who took part in season 5 of French reality television series "Popstars" in 2013 on French channel D8 winning the final on 2 July 2013 against eventual runner-up, the electro pop-rock duo Oslo made up of Eugénie and Vincent. The 3-member jury made up of La Fouine, Alexia Laroche-Joubert and Philippe Gandilhon opted for The Mess made up of Megan, Léa, Chéraze and Kendy. Prior to their third single "Je t\'attendrai encore", Kendy left the band. Originally scheduled for 6 October 2014, The Mess\' debut album has finally been cancelled by their label Columbia/Sony Music and The Mess split amicably. The group was awarded a record deal that includes at least a debut single and a studio album. The debut single of the winning formation was "Au top" written by Maître Gims and Renaud Rebillaud. It entered the French SNEP official singles chart at number 34 the week following the finale. Their second single has been "Honneur aux dames", that featured French rapper Canardo, but failed to chart.also mark is a mess', 'title': 'The Mess'}
