[{'idx': 0, 'is_supporting': True, 'paragraph_text': "King Zhao of Wei  (died 277 BC), personal name Wei Chi  was king of Wei from 296 BC to 277 BC. He was the son of King Xiang of Wei. During his reign, his state suffered from repeated attacks by the state of Qin. In 293 BC, he made an alliance with the state of Han against Qin but was defeated by the Qin general Bai Qi with the loss of 240,000 troops and 5 cities. In 287 BC, Quyang was attacked and in 286 BC, Anyi (the former capital of Wei) and Henei was attacked as well. In an attempt to assist in the attack on Anyi, Qin's ally, the state of Song was attacked in turn by the state of Qi and defeated at Wenyi (modern Wen County, Henan). After a brief alliance (285–284 BC) between the states of Yan, Qin, Han and Zhao against Qi (which was negotiated at the Zhou Dynasty capital, Luoyang), King Zhao broke the alliance and allied with Qi against Qin.", 'title': 'King Zhao of Wei'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'King Zhao of Zhou, personal name Jī Xiá, was the fourth king of the Chinese Zhou dynasty. He ruled from 977/75 BC until his death twenty years later. Famous for his disastrous war against the Chu confederation, his death in battle ended the Western Zhou ’s early expansion and marked the beginning of his dynasty ’s decline.', 'title': 'King Zhao of Zhou'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'King Xiang of Wei  (died 296 BC), personal name Wei Si , was king of Wei from 318 BC to 296 BC. He was the son of King Hui of Wei. In 318 BC, at the suggestion of the Wei minister, Gongsun Yan, he entered into an alliance against Qin created by King Huai of Chu which also included the states of Zhao, Han and Yan. Chu then betrayed this alliance. In 317 BC, at the suggestion of chancellor Zhang Yi, King Xiang entered into an alliance with Qin. To punish Chu for its betrayal of the 5-state alliance, King Xiang sent an army in 312 BC to attack the city of Dengcheng in Chu (modern-day part of Shangshui County, Zhoukou, Henan Province). Wei itself was attacked by Qi in 310 BC, and King Xiang met King Wu of Qin at Linjin (modern day part of Linyi County, Yuncheng, Shanxi Province). In 308 BC, the two kings met again at Yingcheng (modern-day part of Xiaogan, Hubei) to plan an attack on Han. In 306 BC, after the death of King Wu of Qin, the alliance with Qin broke down, and Qin invaded, attacking and occupying the city of Puban. Qin chancellor Gan Mao defected to Wei and the invading forces were withdrawn. In 303 BC, Qin took advantage of Wei\'s alliance with Qi and Han against Chu to launch a second invasion. In 302 BC, relations between Wei and Qin normalized, and King Xiang met King Zhaoxiang of Qin and Han Ying (crown prince of Han) at Linjin, in which Qin agreed to return Puban. This allowed alliance of Wei, Han and Qi in inflict a major defeat on Chu in 301 BC. In 299 BC, King Xiang met with King Min of Qi and King Wuling of Zhao at Han\'s capital Xinzheng (modern day Henan) to propose a 4-state alliance of Qi, Han, Wei and Zhao against Qin. It was in this king\'s tomb that the "Bamboo Annals" were discovered in 279 AD, an event referred to as the Jizhong discovery.', 'title': 'King Xiang of Wei'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Xiong Ai( reigned c. 977 BCE) was the second viscount of the state of Chu during the early Zhou Dynasty of ancient China. He succeeded his father Xiong Yi, who was enfeoffed by King Cheng of Zhou and granted the hereditary noble rank of viscount. Ancient Chinese texts recorded that King Zhao of Zhou, the grandson of King Cheng of Zhou, led an expedition against Chu, but Zhou was defeated and King Zhao himself drowned in the Han River in 977 BCE. It is generally believed that Xiong Ai was the monarch of Chu at the time. Xiong Ai was succeeded by his son, Xiong Dan.', 'title': 'Xiong Ai'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'King Zhao of Chu( died 489 BC) was from 515 to 489 BC the king of the State of Chu during the Spring and Autumn period of ancient China. He was born Xiong Zhen( 熊珍) and King Zhao was his posthumous title. Documents unearthed in the former state also show his title as King Shao( 卲王). King Zhao was the son of King Ping of Chu.', 'title': 'King Zhao of Chu'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Lord Xinling( Chinese: 信陵君, d. 243 BC), born Wei Wuji( 魏無忌), was a prominent aristocrat, statesman and general of the Warring States period and one of the Four Lords of the Warring States. The son of King Zhao of Wei, and the half- brother of King Anxi of Wei, he served the State of Wei as Senior General.', 'title': 'Lord Xinling'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "King Jingmin of Wei( died 228 BC, ruled 242 BC- 228 BC), personal name Wei Wu was the penultimate king of Wei. He was son of King Anxi of Wei. He made an alliance with the states of Han, Zhao, Yan and Chu against the state of Qin. This alliance failed with Han's destruction by Qin in 230 BC.", 'title': 'King Jingmin of Wei'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Marquess Wen of Wei( Wèi Wén Hóu; died 396 BCE) was the first Marquess to rule the State of Wei during the Warring States period of Chinese history( 475 – 220 BCE). Born Wei Si( 魏斯), he belonged to the House of Wei, one of the noble houses that dominated Jin politics in the 5th and 6th centuries BC. He became ruler of Wei in 445 BCE, succeeding Wei Huan- Zi, and in 424 BCE adopted the title of" Marquess". In 403 BCE King Weilie of Zhou acknowledged Wei Si as Marquess of Wei while conferring similar titles on the leaders of the former vassal states of Han and Zhao, thereby effectively splitting the State of Jin into three and confirming the Partition of Jin. Sima Qian praised Marquess Wen of Wei for his eagerness to learn. The Marquess is said to have often consulted the Confucian scholar Zixia as well as Tian Zifang and Duangan Mu among others. Marquess Wen of Wei also appointed Legalist philosopher Li Kui, whose principles for the implementation of political reforms were" to eat one must labor, to receive a salary one must provide meritorious service; those who do not will be punished." As the State of Wei underwent these reforms it became rich and powerful. In turn, Marquess Wen defeated the State of Zhongshan while General Wu Qi attacked and took five cities in what would become Xihe Commandery within the borders of the State of Qin( between the Yellow River and Luo River spanning parts of modern- day Shaanxi and Shanxi Provinces). With Ximen Bao installed as magistrate of Ye( in modern- day Hebei Province), Běimén Kě in control of Suanzao and Zhai Huang as Senior Minister, Wei underwent political reforms and constructed irrigation systems. As a result, Wei became a powerful country during the early Warring States Period.', 'title': 'Marquess Wen of Wei'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'King Hui of Wei( simplified Chinese and traditional Chinese: 魏惠王; 400-319 BC), originally called Marquis Hui of Wei, and after 344, King Hui of Liang( simplified Chinese and traditional Chinese: 梁惠王) was the third ruler of the state of Wei during the Warring States period, ruling from approximately 369–319 BC. He was a grandson of Marquess Wen of Wei, the founder of the state, and a son of Marquess Wu of Wei. He was succeeded by his son, King Xiang of Wei. He came to the throne after a war of succession during which his state was nearly partitioned by Zhao and Han. For his wars and eventual defeat by Qi and Qin in 340, see Warring States period. He is notable for four policies: He also conducted several dialogues with the renowned Confucian Mencius.', 'title': 'King Hui of Wei'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Marquess Wu of Wei (died 370 BCE), was a ruler of the State of Wei during the Warring States period of ancient China. Born Wèi Jī, he was the son of the former ruler Marquess Wen of Wei. He became ruler in 395 BCE upon the death of his father. Marquess Wu of Wei died in 370 BCE and was succeeded by his son King Hui of Wei.', 'title': 'Marquess Wu of Wei'}]

