 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Guy of Ibelin (French: Guy d'Ibelin) (1215/1218 – after May 1255) was marshal and constable of the kingdom of Cyprus. He was the fifth son of John of Ibelin, the Old Lord of Beirut, and of Melisende of Arsuf. He had close relations with the king of Cyprus, Henry I, acting as witness for two royal decrees; he was probably one of the king's executors named in a papal bull of Pope Alexander IV. With his brother Baldwin of Ibelin, he led the Cypriot crusaders in the siege of Damietta in 1248. According to the medieval chronicler Jean de Joinville, he was one of the most accomplished knights of his generation and a benevolent ruler on Cyprus. Joinville recounts an episode when he, Guy and Baldwin had been taken prisoner by saracen rebels: Guy married Phillipa Berlais, daughter of Aimery Berlais. Their children were:", 'title': 'Guy of Ibelin, constable of Cyprus'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Guy of Ibelin( Fr:" Guy d\' Ibelin")( died 29 March 1367) was the dominican bishop of Limassol, Cyprus from 27 April 1357 until his death. He belonged to the noble Cypriot house of Ibelin, closely linked by intermarriage with the kings of Cyprus. His father Balian of Ibelin( d. 28 October 1333), Lord of Arsuf, was a direct descendant of the first Balian of Ibelin, an important crusader. His mother, Margaret of Ibelin, continued to hold the title Lady of Arsuf after her husband\'s death. In the second half of the fourteenth century the fortunes of the house of Ibelin were in decline, as the once- powerful family became extinct. Guy\'s brother Philip became the last Ibelin to hold the title Lord of Arsuf. He was executed in Genoa in late 1373 for taking part in the assassination of King Peter I of Cyprus in 1369; King James I of Cyprus subsequently bestowed the title on John of Neviles, viscount of Nicosia, in 1389. Instead of receiving a prebend, the normal path for a younger son of a high aristocratic family to join the church and enjoy the comfortable life of an ecclesiastical nobleman, Guy chose to join the austere dominican order, perhaps in the same monastery in Nicosia where he was later laid to rest. Two years after his elevation to bishop in 1357, he was the presiding bishop at the coronation of Peter I in the cathedral of St Sophia, Nicosia. It appears that he took part in the campaign to capture Alexandria in 1365, before succumbing to illness in his mansion in Nicosia in 1367. Guy bequeathed 20,000 bezants towards the construction of the cathedral of St Nicholas in Limassol. A detailed inventory of his belongings survives him; although his main residence, in addition to his three rural estates, was not furnished in an opulent manner, – Turkish carpets and cushions typical of the Latin orient replacing courtly tapestries – he still indulged in hunting, the favourite pastime of the nobility, having three falconers in his service, a modest number for the time.', 'title': 'Guy of Ibelin (bishop)'}]

