 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Joseph I (Joseph Jacob Ignaz Johann Anton Eustachius; 26 July 1678 – 17 April 1711) was Holy Roman Emperor from 1705 until his death in 1711. He was the eldest son of Emperor Leopold I from his third wife, Eleonor Magdalene of Neuburg. Joseph was crowned King of Hungary at the age of nine in 1687 and King in Germany at the age of eleven in 1690. He succeeded to the thrones of Bohemia and the Holy Roman Empire when his father died. Joseph continued the War of the Spanish Succession, begun by his father against Louis XIV of France, in a fruitless attempt to make his younger brother Charles (later Emperor Charles VI) King of Spain. In the process, however, owing to the victories won by his military commander, Prince Eugene of Savoy, he did succeed in establishing Austrian hegemony over Italy. Joseph also had to contend with a protracted revolt in Hungary, fomented by Louis XIV. Neither conflict was resolved until the Treaty of Utrecht, after his death. He also sanctioned the extermination of Romani people within the Holy Roman Empire. His motto was "Amore et Timore" (Latin for "Through Love and Fear").', 'title': 'Joseph I, Holy Roman Emperor'}
