 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Nagesh Kukunoor (born 30 March 1967) is an Indian film director, producer, screenwriter and actor known for his works predominantly in Bollywood. He is known for his works in parallel cinema, such as "Hyderabad Blues" (1998), "Rockford" (1999), "Iqbal" (2005), "Dor" (2006), "Aashayein" (2010), "Lakshmi" (2014), and "Dhanak" (2016). Kukunoor has received seven International Awards, and two National Film Awards for his works. In 2003, he directed "3 Deewarein", which was showcased among the Indian panorama section, at the 2003 International Film Festival of India. The film was also premiered at the Kolkata Film Festival. After having been screened at the Indian Film Festival of Los Angeles, where it was well received, the film was screened at the Commonwealth Festival at Manchester, it was nominated as one of the top five films, at the gala presentation. Nagesh Kukunoor has also received the Filmfare Award for Best Story. In 2006, he garnered the National Film Award for Best Film on Other Social Issues, for directing "Iqbal". In 2014, he received the Mercedes Benz Audience Award, for Best Narrative at the Palm Springs International Film Festival for "Lakshmi". In 2015 he directed the road movie, "Dhanak", which won the Crystal Bear Grand Prix for Best Children\'s Film, and Special Mention for the Best Feature Film by The Children\'s Jury for Generation Kplus at the 65th Berlin International Film Festival. The film has also garnered the Best Film Award in the main category-Children\'s Feature Film Competition-Cinema in Sneakers (film festival), and the Best Film Award - at the Montreal International Children\'s Film Festival (FIFEM). The film has garnered the National Film Award for Best Children\'s Film for 2016.', 'title': 'Nagesh Kukunoor'}
