[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Maurice Cloche( 17 June 1907, Commercy, Meuse – 23 March 1990, Bordeaux, France) was a French film director, screenwriter, photographer and film producer. Best known for his Oscar- winning film" Monsieur Vincent"( 1947) he won a 1948 Special Academy Award for Best Foreign Language Film.< nowiki>" </nowiki>Monsieur Vincent,< nowiki>"</ nowiki> a dramatization of the life of St. Vincent de Paul that starred Pierre Fresnay, won the Academy Award in 1947 for best foreign film. It also was honored as the best film in France that year. Mr. Cloche, whose career spanned more than a half- century, also made spy thrillers and films with religious and social themes. His best- known films include< nowiki>"</ nowiki> La Cage aux Oiseaux< nowiki>"</ nowiki>(< nowiki>" </nowiki> The Bird Cage< nowiki>"</ nowiki>);< nowiki>"</ nowiki> Le Docteur Laennec,< nowiki>"</ nowiki> the story of the inventor of the stethoscope;< nowiki>"</ nowiki> Ne de Pere Inconnu <nowiki>"</ nowiki>(< nowiki>"< /nowiki> Father Unknown< nowiki>"</ nowiki>) and< nowiki>"</ nowiki> La Cage aux Filles(< nowiki>"< /nowiki> The Girl Cage< nowiki>"</ nowiki>). In 1940, Mr. Cloche founded a film society for young talent. It later became France\'s leading film school, the Institute of Advanced Film Studies. He studied at the École des Beaux- Arts, then at the École nationale supérieure des arts décoratifs, before going to the cinema as an actor in 1933. He became artistic director and became director by shooting several short films. He created a production company and made his first feature film in 1937. After the Second World War, he is best known as a writer of films about great figures of Christian charity, hence his reputation in the profession of official Catholic filmmaker. He does not neglect the social subjects, nor even the series B. Maurice Cloche also realizes several documentaries on art: Terre d\'amour, Symphonie graphique, Alsace, Franche- Comté, Gothic images. In 1940, in the southern zone, he participated with Paul Legros( general director) and Pierre Gérin( deputy director), at the founding of the artistic and technical center of the young people of the cinema of which he ensures the artistic direction. 2009, Hôtel de Sully, National Gallery of the Jeu de Paume( collective exhibition). He died on March 20, 1990, at his home in Bordeaux after a long illness. He was 82 years old and had Parkinson\'s disease.> More on.> French filmography', 'title': 'Maurice Cloche'}
