 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Captain Blood is a 1935 American black-and-white swashbuckling pirate film from First National Pictures and Warner Bros. Pictures, produced by Harry Joe Brown and Gordon Hollingshead (with Hal B. Wallis as executive producer), directed by Michael Curtiz, that stars Errol Flynn, Olivia de Havilland, Basil Rathbone, and Ross Alexander. The film is based on the 1922 novel "Captain Blood" by Rafael Sabatini, with a screenplay by Casey Robinson, and concerns an enslaved doctor and his fellow prisoners who escape their cruel island imprisonment and become pirates in the West Indies. An earlier 1924 silent film version of "Captain Blood" starred J. Warren Kerrigan as Peter Blood, the physician-turned-pirate in this Vitagraph production. Warner Bros. Pictures took a serious risk in pairing two relatively unknown performers in the lead roles. Flynn\'s performance made him a major Hollywood star and established him as the natural successor to Douglas Fairbanks, Sr. and a "symbol of an unvanquished man" during the Depression. " Captain Blood" also established de Havilland, in just her fourth screen appearance, as a major star and was the first of eight films co-starring Flynn and de Havilland; in 1938 the two would be re-united with Rathbone in "The Adventures of Robin Hood". The same year, Basil Rathbone also starred with Flynn in "The Dawn Patrol" (1938). In 1962 Flynn\'s son Sean starred in "The Son of Captain Blood".', 'title': 'Captain Blood (1935 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Captain Blood is a 1924 American silent historical adventure film produced and distributed by The Vitagraph Company of America. The film is based on the novel," Captain Blood, His Odyssey", by Rafael Sabatini, and was directed by David Smith, brother of Vitagraph founder Albert E. Smith. Early silent film hero J. Warren Kerrigan stars along with resident Vitagraph leading actress Jean Paige.', 'title': 'Captain Blood (1924 film)'}
