 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Buildings at 825-829 Blue Hill Avenue are historic apartment buildings in the Mattapan neighborhood of Boston, Massachusetts. The three- story Colonial Revival masonry structures were designed by Samuel Levy and built in 1924 for Herman Barron, during a period in which Boston's Jewish population migrated to the area in large numbers from downtown Boston. The buildings occupy a triangular lot at the corner of Blue Hill Avenue and Calder Street. Both street- facing facades feature alternating projecting and recessed bays, and are laid in seven- course Flemish bond brick. At the corner the building has two single- bay facades, one of which houses an entrance. These faces are ornamented with corner quoining in concrete. The main entrances of the buildings are on Blue Hill Avenue, sheltered by gabled porticos supported by Tuscan columns. The buildings were listed on the National Register of Historic Places in 2014.", 'title': 'Buildings at 825-829 Blue Hill Avenue'}
