 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Bảo Đại (lit. "keeper of greatness", 22 October 1913 – 30 July 1997), born Nguyễn Phúc Vĩnh Thụy, was the 13th and final Emperor of the Nguyễn dynasty, the last ruling family of Vietnam. From 1926 to 1945, he was Emperor of Annam. During this period, Annam was a protectorate within French Indochina, covering the central two-thirds of the present-day Vietnam. Bảo Đại ascended the throne in 1932. The Japanese ousted the Vichy-French administration in March 1945 and then ruled through Bảo Đại. At this time, he renamed his country "Vietnam". He abdicated in August 1945 when Japan surrendered. From 1949 until 1955, Bảo Đại was the chief of state of the State of Vietnam (South Vietnam). Bảo Đại was criticized for being too closely associated with France and spending much of his time outside Vietnam. Prime Minister Ngô Đình Diệm eventually ousted him in a fraudulent referendum vote in 1955.', 'title': 'Bảo Đại'}
