[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Room is a 2003 American romantic drama film written, directed, produced by and starring Tommy Wiseau, and co-starring Greg Sestero and Juliette Danielle. The film centers on a melodramatic love triangle between amiable banker Johnny( Wiseau), his deceptive fiancée Lisa( Danielle) and his conflicted best friend Mark( Sestero). A significant portion of the film is dedicated to a series of unrelated subplots, most of which involve at least one supporting character and are left unresolved due to the film\'s inconsistent narrative structure. The work was reportedly intended to be semi-autobiographical in nature; according to Wiseau, the title alludes to the potential of a room to be the site of both good and bad events. The stage play from which the film is derived was so- called due to its events taking place in a single room. A number of publications have labeled" The Room" as one of the worst films ever made. An assistant professor of film studies was the first to describe" The Room" as" the" Citizen Kane" of bad movies". Originally shown only in a limited number of California theaters," The Room" quickly became a cult film due to its bizarre and unconventional storytelling, technical and narrative flaws, and Wiseau\'s off- kilter performance. Although Wiseau has retrospectively described the film as a black comedy, audiences have generally viewed it as a poorly made drama, an opinion shared by some of the cast. " The Disaster Artist", Sestero\'s memoir of the making of" The Room", was co-written with Tom Bissell and published in 2013. A film of the same name based on the book, directed by and starring James Franco, was released on December 1, 2017; the book and film received widespread acclaim and numerous award nominations. " The Room" also inspired an unofficial video game adaptation," The Room Tribute", released on Newgrounds in 2010.', 'title': 'The Room (film)'}
