 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Federico Fellini,( 20 January 1920 – 31 October 1993) was an Italian film director and screenwriter. Known for his distinct style that blends fantasy and baroque images with earthiness, he is recognized as one of the greatest and most influential filmmakers of all time. His films have ranked, in polls such as" Cahiers du cinéma" and" Sight& Sound", as some of the greatest films of all time. " Sight& Sound" lists his 1963 film" 8 ½" as the 10th- greatest film of all time. In a career spanning almost fifty years, Fellini won the Palme d\' Or for" La Dolce Vita", was nominated for twelve Academy Awards and won four in the category of Best Foreign Language Film, the most for any director in the history of the Academy. At the 65th Annual Academy Awards in Los Angeles, he received an honorary award for Lifetime Achievement. Besides" La Dolce Vita" and" 8 ½", his other well- known films include" La StradaNights of CabiriaJuliet of the SpiritsSatyricon Amarcord" and" Fellini\'s Casanova".', 'title': 'Federico Fellini'}
