[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Hasan Pasha (c. 1517 – 4 July 1572) was the son of Hayreddin Barbarossa and three-times "Beylerbey" of the Regency of Algiers. His mother was a Morisca. He succeeded his father as ruler of Algiers, and replaced Barbarossa\'s deputy Hasan Agha who had been effectively holding the position of ruler of Algiers since 1533.', 'title': 'Hasan Pasha (son of Barbarossa)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Tiryaki Hasan Pasha (Turkish: "Tiryaki Hasan Paşa"), also called Alacaatlı Hasan Pasha (1530 – 1611), was an Ottoman military commander, who participated in the Long Turkish War. He received his education in the Enderun school and was probably a devshirme.', 'title': 'Tiryaki Hasan Pasha'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Hayreddin Barbarossa , or Barbaros Kheireddin Pasha , born Khizr or Khidr (c. 1478 – 4 July 1546), was an Ottoman corsair and later admiral of the Ottoman Navy. Barbarossa\'s naval victories secured Ottoman dominance over the Mediterranean during the mid 16th century. Born on Lesbos, Khizr began his naval career as a corsair under his elder brother Oruç Reis. In 1516, the brothers captured Algiers from Spain, with Oruç declaring himself as Sultan. Following Oruç\'s death in 1518, Khizr inherited his brother\'s nickname, "BarbarossaRedbeard" in Italian). He also received the honorary name "Hayreddin" (from Arabic "Khayr ad-Dingoodness of the faith" or "best of the faith"). In 1529, Barbarossa retook Algiers from the Spaniards. In 1533, Barbarossa was appointed Kapudan Pasha (Grand admiral) of the Ottoman Navy by Suleiman the Magnificent. He led an embassy to France in the same year, conquered Tunis in 1534, achieved a decisive victory over the Holy League at Preveza in 1538, and conducted joint campaigns with the French in the 1540s. Barbarossa retired to Istanbul in 1545 and died the following year.', 'title': 'Hayreddin Barbarossa'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'He was a" Sharifian", a descendant of Hasan ibn Ali', 'title': 'Abd as-Salam ibn Mashish al-Alami'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Cenaze Hasan Pasha( also known as Meyyit Hasan Pasha or Kethüda Hasan Pasha; died 1810) was a short- term Ottoman grand vizier in 1789. His epithet" Cenaze"( or" Meyyit") means" corpse" because he was ill when appointed to the post.', 'title': 'Cenaze Hasan Pasha'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Hasan Pasha( also referred to as Mollacık Hasan Pasha or Kethüda Hasan Pasha; died 1700/ 1701) was an Ottoman statesman who served as the Ottoman governor of Egypt Eyalet( 1687), Baghdad Eyalet( 1687 – 1688, 1690–1691/92), and Shahrizor Eyalet( 1591/92–1595/96). He also served as the warden of the Ottoman Sanjak of Rhodes and was a vizier. While he was the warden of Rhodes, Hasan Pasha retired. In 1697 or 1698, his viziership was revoked, and he was exiled first to the Sanjak of Kocaeli and then to Saqqez. His viziership and warden post was restored in 1698 or 1699. He died in 1700 or 1701.', 'title': 'Mollacık Hasan Pasha'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Cezayirli Gazi Hasan Pasha or Hasan Pasha of Algiers( 1713 – 19 March 1790) was an Ottoman Grand Admiral( Kapudan Pasha)( 1770 – 90), Grand Vizier( 1790), and general in the late 18th century. He is known to have been bought as a Georgian slave in eastern Turkey by a Turkish merchant of Tekirdağ, who raised him in that city considering him on a par with his own sons. He rose through the ranks of the Ottoman military hierarchy and was for a time with the Barbary Coast pirates based in Algiers( whence his name" Cezayirli", meaning" from Algiers" in Turkish). He was a fleet commander during the Battle of Chesma aboard the" Real Mustafa" and was able to extract the forces under his command from the general disaster for the Turkish navy that occurred there. He arrived at the Ottoman capital with the bad news, but was highly praised for his own accomplishment and promoted, first to chief of staff and later to grand vizier. He dislodged the Russian fleet which had established a base on the Aegean island of Limni. Anecdotal evidence indicates that, immediately after the defeat at Chesma, he and his men were lodged by a local priest in Ayvalık who did not know who they were. Hasan Pasha did not forget the kindness shown at that hour of crisis and later accorded virtual autonomy to the Greek- dominated town of Ayvalık, paving the way for its becoming an important cultural center for that community in the Ottoman Empire in the 19th century. The defeat also prompted Hasan Pasha to establish the Naval Engineering Golden Horn Shipyard( later Turkish Naval Academy) in 1773. Hasan Pasha blockaded Acre in the summer of 1775 in order to check the power of the autonomous Arab ruler of Palestine, Zahir al- Umar. Hasan Pasha ordered Zahir to pay 50,000 piasters to relieve the siege. Zahir ultimately refused and consequently, Hasan Pasha\'s ships bombarded Acre, but the Turks manning Acre\'s cannons refused Zahir\'s orders to fire back at the ships and intentionally directed their fire away from Hasan Pasha\'s naval forces. Their loyalty to the Ottoman sultan precluded them from firing on his military. Zahir fled, but was killed by Hasan Pasha\'s troops before he could escape. In 1786, Hasan Pasha was ordered by the sultan Abdülhamid I to take troops to Egypt and drive out the Mamluk emirs led by Ibrahim Bey( Mamluk) and Murad Bey, who had become de facto rulers of the province. < ref name=" Jabarti Philipp1994-2/181" >< /ref> He arrived in Egypt in early August 1786 and was successful in this campaign( although the Mamluk emirs would regain power after his death) and remained the de facto Ottoman governor of Egypt for around a year. His long- time" kethüda"( assistant/ deputy) Ismail Pasha the Tripolitanian remained in Egypt and was soon appointed the Ottoman governor of Egypt himself( 1788 –89, 1789– 91)< ref name=" Jabarti Philipp1994-2/286–289" ></ ref> while his allied Mamluk emir Ismail Bey became the Shaykh al- Balad and de facto ruler. In the Russo- Turkish War of 1787- 1792, Hasan Pasha( then 85) commanded the Turkish troops in the beginning campaigns, taking part in the Action of 17 June 1788, the Battle of Fidonisi, and the Siege of Ochakov. He died on 19 March 1790, from illness or perhaps poisoned. His statue today graces the resort town of Çeşme, along with the lion that domesticated while in Africa and took along with him everywhere.', 'title': 'Cezayirli Gazi Hasan Pasha'}
