[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Eleanor of Aquitaine (1122 – 1 April 1204) was queen consort of France (1137–1152) and England (1154–1189) and duchess of Aquitaine in her own right (1137–1204). As a member of the Ramnulfids (House of Poitiers) rulers in southwestern France, she was one of the wealthiest and most powerful women in western Europe during the High Middle Ages. She was patron of literary figures such as Wace, Benoît de Sainte-Maure, and Bernart de Ventadorn. She led armies several times in her life and was a leader of the Second Crusade. As the duchess of Aquitaine, Eleanor was the most eligible bride in Europe. Three months after becoming duchess upon the death of her father, William X, she married King Louis VII of France, son of her guardian, King Louis VI. As queen of France, she participated in the unsuccessful Second Crusade. Soon afterwards, Eleanor sought an annulment of her marriage, but her request was rejected by Pope Eugene III. However, after the birth of her second daughter Alix, Louis agreed to an annulment, as 15 years of marriage had not produced a son. The marriage was annulled on 21 March 1152 on the grounds of consanguinity within the fourth degree. Their daughters were declared legitimate, custody was awarded to Louis, and Eleanor's lands were restored to her. As soon as the annulment was granted, Eleanor became engaged to the Duke of Normandy, who became King Henry II of England in 1154. Henry was her third cousin and 11 years younger. The couple married on Whitsun, 18 May 1152, eight weeks after the annulment of Eleanor's first marriage, in Poitiers Cathedral. Over the next 13 years, she bore eight children: five sons, three of whom became kings; and three daughters. However, Henry and Eleanor eventually became estranged. Henry imprisoned her in 1173 for supporting their son Henry's revolt against him. She was not released until 6 July 1189, when her husband Henry died and their second son, Richard the Lionheart, ascended the throne. As queen dowager, Eleanor acted as regent while Richard went on the Third Crusade. Eleanor also lived well into the reign of Richard's heir and her youngest son, John.", 'title': 'Eleanor of Aquitaine'}
