 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Shadow of Your Smile is an album by American pop singer Johnny Mathis that was released by Mercury Records in March 1966, and included covers of the same two Beatles songs(" Michelle" and" Yesterday") that would be in stores one month later on an Andy Williams album of the same name. Mathis also tackled recent easy listening fare on this album(" A Taste of HoneyQuiet Nights of Quiet Stars( Corcovado)") in addition to show tunes from" On a Clear Day You Can See Forever" and" West Side Story". The first single from the album," On a Clear Day You Can See Forever", debuted on" Billboard" magazine\'s list of the 40 most popular Easy Listening songs in the US a few months before the album\'s release, in the issue dated November 6, 1965, and made it to number 6 during a 15- week chart run. In the meantime it also spent two weeks on" Billboard"\'s Hot 100 that began in the December 18 issue and included a peak position at number 98. " The Shadow of Your Smile" had its first appearance on the magazine\'s Top LP\'s chart in the issue dated April 2, 1966, and began a run of 45 weeks there, where it got as high as number nine. This was the most number of weeks that an album of his stayed on their list since" Johnny\'s Mood" in 1960 and the highest chart position an album of his achieved since 1960\'s" The Rhythms and Ballads of Broadway". " The Shadow of Your Smile" was released for the first time on compact disc on November 6, 2012, as one of two albums on one CD, the second of the two being his previous LP," The Sweetheart Tree". Both were also included in Sony\'s Mathis box set" The Complete Global Albums Collection", which was released on November 17, 2014.', 'title': 'The Shadow of Your Smile (Johnny Mathis album)'}
