 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'On a Clear Day You Can See Forever is the soundtrack album to the 1970 American film of the same name. It was released by Columbia Records on July 1, 1970 and features singing by Barbra Streisand and Yves Montand, in addition to choral arrangements and live orchestration. No commercial singles were released from the soundtrack, but the reprise version of the title track was released as a promotional single on 7" vinyl by Columbia. Executively and solely produced by Wally Gold, the album\'s ten tracks were written by Alan Jay Lerner while the music was written by Burton Lane. The album was reissued on compact disc in 2008. Music critics highlighted the compilation\'s title track and Streisand\'s singing ability. Commercially, the soundtrack was once Streisand\'s lowest- performing entry on the" Billboard" 200, peaking at number 108 in September 1970. However, her other 1970 soundtrack album," The Owl and the Pussycat", would later take its place as Streisand\'s lowest- peaking album. Nonetheless," On a Clear Day You Can See Forever" served as Montand\'s only charting effort in the United States.', 'title': 'On a Clear Day You Can See Forever (soundtrack)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '" On a Clear Day( You Can See Forever)" is a song written by Burton Lane( music) and Alan Jay Lerner( lyrics) for the 1965 musical" On a Clear Day You Can See Forever". It was subsequently performed by American actress and vocalist Barbra Streisand in the 1970 film adaptation of the musical. Three variations of the song appear in the film and on the accompanying soundtrack album produced by Wally Gold: the initial version sung by co-star Yves Montand, a reprise version sung by Streisand, and an orchestral version performed alongside a live chorus. The Streisand rendition was released by Columbia Records as a promotional single on 7" vinyl( with a stereo mix on one side and mono on the other) in July 1970. The track received positive reviews from music critics, with many of them listing it as a highlight of the soundtrack.', 'title': 'On a Clear Day (You Can See Forever)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'On a Clear Day You Can See Forever is a 1970 American musical comedy- drama fantasy film directed by Vincente Minnelli. The screenplay by Alan Jay Lerner is adapted from his book for the 1965 stage production of the same name. The songs feature lyrics by Lerner and music by Burton Lane. The American Film Institute has listed" On a Clear Day You Can See Forever" as one of the 100 greatest musical films ever.', 'title': 'On a Clear Day You Can See Forever (film)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Stanislovas Goštautas( also called Stanisław Gasztołd or" Gasztołt" of Abdank in Polish)( ca. 1507 in Vilnius – 1542) was a notable member of the Lithuanian nobility and a high- ranking member of the Lithuanian administration. Born to Albertas Goštautas, the Voivode of Vilnius and Princess Sofia of Vereya, he was the last direct male descendant of the – once mighty – Goštautai family. A prominent member of the Grand Duchy\'s administration in the early times of the Polish – Lithuanian union, Goštautas held a number of important posts in the state\'s administration. Among others, since 1522 he held the post of the voivode of Navahrudak, although he did not rise to that office until 1530. Since 1542 he was also a voivode of Trakai. As one of the most notable and influential noblemen of his epoch, in 1542 he was also awarded with a royal pension of" 600 times the number of 60 Prague groschen" in exchange for his town of Upytė, which was bought by Sigismund Augustus of Poland. On 17 May 1537 he married Barbara Radziwiłł, later the second wife of the Grand Duke of Lithuania and King of Poland Sigismund II Augustus. Goštautas died on 18 December 1542, leaving some of his family fortune to his wife, who later might have passed it on to her branch of the Radziwiłł family, while the bulk of his estates was taken by the Grand Duke of Lithuania Sigismund II Augustus, as a matter of sovereign\'s right.', 'title': 'Stanislovas Goštautas'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Sigismund II Augustus (1 August 1520 – 7 July 1572) was the King of Poland and Grand Duke of Lithuania, the only son of Sigismund I the Old, whom Sigismund II succeeded in 1548. Sigismund was the only legitimate son of Italian-born Bona Sforza and Sigismund the Old. From the beginning he was groomed and extensively educated as a successor. In 1529 he was crowned "vivente rege" while his father was still alive. Sigismund Augustus continued a tolerance policy towards minorities and maintained peaceful relations with neighbouring countries, with the exception of the Northern Seven Years\' War which aimed to secure Baltic trade. Under his patronage the culture flourished in Poland; he was a collector of tapestries from the Low Countries and collected military memorabilia as well as swords and armours. Sigismund Augustus\' rule is widely considered as the apex of the Polish Golden Age. In 1569 he oversaw the signing of the Union of Lublin between Poland and the Grand Duchy of Lithuania, which formed the Polish-Lithuanian Commonwealth and introduced an elective monarchy. Sigismund Augustus married three times; his first wife, Elizabeth of Austria, died in 1545 at just eighteen. He was then involved in several relationships with mistresses, the most famous being Barbara Radziwiłł, who became Sigismund\'s second wife and Queen of Poland in spite of his mother\'s disapproval. The marriage was deemed scandalous and was fiercely opposed by the royal court and the nobility. Barbara died five months after her coronation, presumably due to ill health, however, rumours circulated that she was poisoned. Sigismund finally wedded Catherine of Austria, but remained childless throughout his life. Sigismund Augustus was last male member of the Jagiellons. Following the death of his sister Anna in 1596 the Jagiellonian Dynasty came to an end.', 'title': 'Sigismund II Augustus'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Diana di Cordona (1499 - after 1550) was an Italian noble and courtier. She was the lady-in-waiting to queen Bona of Poland and mistress of Sigismund II Augustus and Cesare I Gonzaga, who later in life went missing and was presumed to be dead in 1550.', 'title': 'Diana di Cordona'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Bona Sforza d’Aragona (2 February 1494 – 19 November 1557) was Queen of Poland and Grand Duchess of Lithuania. A member of the powerful House of Sforza, which ruled the Duchy of Milan since 1447, she became the second wife of Sigismund I the Old, the King of Poland and Grand Duke of Lithuania in 1518. Their marriage lasted 30 years until Sigismund's death in 1548. Ambitious and energetic, Bona became heavily involved in the political life of Poland–Lithuania. To increase state revenue, she implemented various economic and agricultural reforms, including the far-reaching Wallach Reform in the Grand Duchy of Lithuania. Her reforms made her the richest landowner in the Grand Duchy. In foreign policy, she opposed the Habsburgs and sought to secure her eldest daughter Isabella Jagiellon in the Kingdom of Hungary.", 'title': 'Bona Sforza'}
