[{'idx': 0, 'is_supporting': True, 'paragraph_text': "King Gong of Chu (600–560 BC) was from 590 to 560 BC the king of Chu, a major power during the Spring and Autumn period of ancient China. He was born Xiong Shen , and at the age of 10 succeeded his father King Zhuang of Chu, who was the Hegemon of China. However, in 575 BC King Gong was defeated by Chu's archrival Jin in the Battle of Yanling and Chu's power declined. He ruled for 31 years and was succeeded by his eldest son, King Kang of Chu. Three of King Gong's younger sons also ascended the throne, all by treacherous means.", 'title': 'King Gong of Chu'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'King Dao of Chu( died 381 BC) was the king of the state of Chu from 401 BC to 381 BC during the early Warring States period of ancient China. He was born Xiong Yi and King Dao was his posthumous title. King Dao succeeded his father King Sheng of Chu, who died in 402 BC. He died after a reign of 21 years and was succeeded by his son, King Su of Chu.', 'title': 'King Dao of Chu'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'King Huai of Chu( died 296 BC) was from 328 to 299 BC the king of the state of Chu during the Warring States period of ancient China. He was born Xiong Huai and King Huai( 懷, a different Chinese character) was his posthumous title. King Huai succeeded his father King Wei of Chu, who died in 329 BC. In 299 BC King Huai was trapped and held hostage by King Zhao of Qin when he went to the state of Qin for negotiation, and his son King Qingxiang of Chu ascended the throne. King Huai managed to escape but was recaptured by Qin. Three years later, he died in captivity. One of his grandsons was later reinstated as King of Chu as the Qin dynasty descended into chaos, also under the name" King Huai of Chu"; this grandson was later known as Emperor Yi of Chu.', 'title': 'King Huai of Chu'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'King Ai of Chu (died 228 BC), born Xiong You , was a king of Chu during the late Warring States period of ancient China. He was the son of King Kaolie of Chu and full younger brother of King You of Chu. Prince You succeeded his elder brother as king in 228 BC, but was murdered only two months later by the supporters of his elder half-brother Prince Fuchu. Prince Fuchu ascended the throne as king of Chu.', 'title': 'King Ai of Chu'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'King Zhuang of Chu (reigned 613-591 BC) was a monarch of the Zhou dynasty State of Chu during the Spring and Autumn period in ancient China. His personal name was Xiong Lü , his ancestral name was Mi , and his posthumous title was King Zhuang. He was one of the five rulers dubbed the Five Hegemons by Xunzi and attempted to wrest control of China from King Ding of Zhou. The son of King Mu of Chu, Zhuang ascended the throne in 613 BC. According to a legend in the "Records of the Grand Historian", for the first three years of his reign Zhuang wasted time in pleasure seeking, but, when challenged by two courtiers, reformed his ways. The king made Sunshu Ao his chancellor. Sunshu Ao began a series of major dam-works and an enormous planned reservoir in modern-day northern Anhui province. After some military successes, King Zhuang attempted to usurp King Ding of Zhou. According to a well known story, probably an invention of the Warring States period, he asked a messenger from Zhou about the weight of the legendary Nine Tripod Cauldrons which Zhou possessed, a euphemism for seeking ultimate power in China, but was rebuffed. This incident gave rise to the chengyu "to enquire about ding in the central plains", i.e. to have great ambitions (see the entry at wiktionary.) In the Battle of Bi, his army defeated the State of Jin. His progress from lazy regent to hegemon gave rise to the Chinese chengyu "amaze [others] with one cry" (see the entry at wiktionary). The virus genus "Mivirus" is named in his honor.', 'title': 'King Zhuang of Chu'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "King Cheng of Chu( died 626 BC) was from 671 to 626 BC king of the state of Chu during the Spring and Autumn period of ancient China. He was born Xiong Yun to King Wen of Chu, and King Cheng was his posthumous title. In 672 BC Xiong Yun's older brother king Du'ao tried to kill him, and he escaped to the state of Sui. He then attacked and killed Du'ao with the help of Sui, and succeeded Du'ao as king of Chu. In the summer of 648 BC, the State of Huang was annexed by the state of Chu. King Cheng's wife was Zheng Mao. Their son was possibly King Mu of Chu.", 'title': 'King Cheng of Chu'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "King Píng of Chu (died 516 BC). During the Spring and Autumn period of ancient China, he was king of the State of Chu from 528 BC to 516 BC. He was a son of King Gong of Chu and his consort (a sibling of King Zi'ao). Born Xiong Qiji , Píng changed his name to Xiong Ju  after ascending the throne, and King Píng was his posthumous title. The likely reason for his name change was his response to a naming taboo. He married Bo Ying and was succeeded by their son, King Zhao of Chu.", 'title': 'King Ping of Chu'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "King Kang of Chu( died 545 BC) was from 559 to 545 BC the king of Chu, a major power during the Spring and Autumn period of ancient China. Born Xiong Zhao, he succeeded his father King Gong of Chu. His reign was marked by constant wars with Jin, Chu's traditional enemy, and Wu, its new enemy. He ruled for 15 years and was succeeded by his son, Jia'ao, who would four years later be murdered by King Kang's younger brother King Ling of Chu.", 'title': 'King Kang of Chu'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'King Jian of Chu( died 408 BC) was from 431 to 408 BC the king of the state of Chu during the transition from the Spring and Autumn period to the Warring States period. He was born Xiong Zhong and King Jian was his posthumous title. King Jian succeeded his father King Hui of Chu, who died in 432 BC. He reigned for 24 years and was succeeded by his son, King Sheng of Chu.', 'title': 'King Jian of Chu'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Shenyin Shu or Shenyin Xu(? - 506 BC) was a general of the State of Chu during the Spring and Autumn period of ancient China. He was a great- grandson of King Zhuang of Chu.', 'title': 'Shenyin Shu'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The shear strength of a discontinuity in a soil or rock mass may have a strong impact on the mechanical behavior of a soil or rock mass. The shear strength of a discontinuity is often considerably lower than the shear strength of the blocks of intact material in between the discontinuities, and therefore influences, for example, tunnel, foundation, or slope engineering, but also the stability of natural slopes. Many slopes, natural and man-made, fail due to a low shear strength of discontinuities in the soil or rock mass in the slope. The deformation characteristics of a soil or rock mass are also influenced by the shear strength of the discontinuities. For example, the modulus of deformation is reduced, and the deformation becomes plastic( i.e. non-reversible deformation on reduction of stress) rather than elastic( i.e. reversible deformation). This may cause, for example, larger settlement of foundations, which is also permanent even if the load is only temporary. Furthermore, the shear strength of discontinuities influences the stress distribution in a soil or rock mass.', 'title': 'Shear strength (discontinuity)'}
