 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Daniel Kelly (1 June 1861 – 28 June 1880) was an Australian bushranger and outlaw. The son of an Irish convict, he was the younger brother of the bushranger Ned Kelly. Dan and Ned killed three policemen at Stringybark Creek in northeast Victoria, near the present-day town of Tolmie, Victoria. With two friends, Joe Byrne and Steve Hart, the brothers formed the Kelly Gang. They robbed banks, took over whole towns, and kept the people in Victoria and New South Wales frightened. For two years the Victorian police searched for them, locked up their friends and families, but could not find them. Dan Kelly died during the infamous siege of Glenrowan. More books have been written about the Kelly Gang than any other subject in Australian history. The Kelly Gang were the subject of the world\'s first full-length feature film, "The Story of the Kelly Gang", made in 1906.', 'title': 'Dan Kelly (bushranger)'}
