 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Sir Philip Wodehouse, 3rd Baronet( 24 July 1608 – 6 May 1681) was an English politician who sat in the House of Commons at various times between 1654 and 1660. Wodehouse was the son of Sir Thomas Wodehouse, 2nd Baronet, and Blanche, daughter of John Carey, 3rd Baron Hunsdon. In 1654, he was elected Member of Parliament for Norfolk in the First Protectorate Parliament. He was re-elected MP for Norfolk in 1656 for the Second Protectorate Parliament. He succeeded to the baronetcy on the death of his father on 18 March 1658. In 1660 he was elected MP for Thetford in the Convention Parliament. Wodehouse married Lucy, daughter of Sir Thomas Cotton, 2nd Baronet. His son Thomas predeceased him. He died in May 1681, aged 72, and was succeeded in the baronetcy by his grandson, John. Lady Wodehouse died in June 1684.', 'title': 'Sir Philip Wodehouse, 3rd Baronet'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Sir Philip Wodehouse, 1st Baronet (died 30 October 1623) was an English baronet, soldier and Member of Parliament. Wodehouse was the son of Sir Roger Wodehouse, of Kimberley, Norfolk, and Mary, daughter of John Corbet and was educated at Trinity College, Cambridge (1575) and trained in the law at Lincoln's Inn (1580). He sat as Member of Parliament for Castle Rising from 1586 to 1587. He was knighted in 1596 for his actions during the Capture of Cadiz and in 1611 he was created a Baronet, of Wilberhall in the County of Norfolk. He was appointed a Justice of the Peace for Norfolk from c. 1591 and High Sheriff of Norfolk for 1594–95. He was commissioner of musters for 1598 and Custos rotulorum in 1617. Wodehouse married Grizell, daughter of William Yelverton, on 22 December 1582. He died on 30 October 1623 and was succeeded in the baronetcy by his son, Thomas. Lady Wodehouse died in August 1635. He was an ancestor of the British humorist P. G. Wodehouse.", 'title': 'Sir Philip Wodehouse, 1st Baronet'}
