[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jabir ibn al-Ash\'ath ibn Yahya al-Ta\'i  was a governor of Egypt, from 811 to 812. He was appointed in March 811 by the caliph al-Amin, replacing Hatim ibn Harthamah ibn A\'yan. Soon afterwards however he was forced to contend with the outbreak of civil war between al-Amin and his brother al-Ma\'mun, and before long his continued loyalty to the former had put him at odds with a faction of the local "jund" led by al-Sari ibn al-Hakam, which favored recognizing al-Ma\'mun as caliph instead. In the spring of 812 the "jund", with the encouragement of al-Ma\'mun, openly switched their allegiance and revolted, and Jabir was overthrown from his position. A partisan of al-Ma\'mun, Abbad ibn Muhammad ibn Hayyan, then assumed the governorship and took up power in Fustat, but other parts of Egypt continued to remain loyal to al-Amin under the anti-governor Rabi\'ah ibn Qays ibn Zubayr al-Jurashi.', 'title': "Jabir ibn al-Ash'ath al-Ta'i"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Muttalib ibn Abdallah ibn Malik al- Khuza\'i was a son of the Abbasid general and administrator Abdallah ibn Malik al- Khuza\'i. During the civil war between al- Amin and al- Ma\'mun, he sided with the latter. In 811, he administered the oath of allegiance(" bay\'ah") to al- Ma\'mun for Mosul, and was named governor of Egypt briefly in 813 and again in 814–816. In 817, however, after al- Ma\'mun chose the Alid Ali al- Rida as his heir, Muttalib joined the uprising in Baghdad against al- Ma\'mun, and even administered the oath to the city\'s rival Caliph, Ibrahim ibn al- Mahdi.', 'title': 'Muttalib ibn Abdallah ibn Malik'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Al- Abbas ibn al- Ma'mun( died 838 CE) was an Abbasid prince and general, the son of the Abbasid Caliph al- Ma'mun. A distinguished military leader in the Arab – Byzantine wars, he was passed over in the succession in favour of his uncle al- Mu'tasim. In 838, he was arrested for his involvement in a failed conspiracy against al- Mu'tasim, and died in prison.", 'title': "Al-Abbas ibn al-Ma'mun"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Abu\'l- Abbas Ma\'mun ibn Ma\'mun( died March 1017) was the Ma\'munid ruler of Khwarazm from 1008 or 1009 until his death, having succeeded his brother Abu al- Hasan Ali in that post. He was the son of Ma\'mun I ibn Muhammad. The greatest threat to Ma\'mun\'s rule came in the form of the Ghaznavid sultan, Mahmud of Ghazni. Mahmud viewed Khwarazm as a strategically important province, as it would allow him to widen the front against his biggest enemy, the Karakhanids of Transoxiana. When the caliph al- Qadir sent Ma\'mun several awards, including an investiture patent for Khwarazm( confirming him as independent ruler) in 1014, Ma\'mun refused to accept the awards in his capital, fearing that personally accepting the symbols of independence would anger Mahmud. He instead sent out a delegation to accept the awards on the steppe. Ma\'mun also married Mahmud\'s sister Hurra- yi Kalji, who had previously been married to his brother, in 1015 or 1016. Despite these efforts to placate Mahmud, the Ghaznavid demanded that Ma\'mun put his name in the" khutba", in effect acknowledging his suzerainty. Although the nobility and the army were opposed to such measure, Ma\'mun had no choice but to give in. He agreed to place Mahmud\'s name in the" khutba" and to fulfil other humiliating demands. In response the army revolted and Ma\'mun was killed. The rebels placed his nephew Muhammad on the throne, but Mahmud used the death of his brother- in- law as a pretext for annexing Khwarazm. During Ma\'mun\'s reign several scholars, such as al- Biruni, resided in Khwarazm, and in fact one of Mahmud\'s demands upon the shah was that several of them be sent to him. Ma\'mun also was responsible for several building projects; a minaret that he ordered to be constructed still stands in Konya- Urgench.', 'title': "Ma'mun II"}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Abū Yūsuf Yaʿqūb ibn Yūsuf ibn Abd al-Muʾmin al-Manṣūr (c. 1160 Morocco – 23 January 1199 Marrakesh, Morocco), commonly known as Jacob Almanzor  or Moulay Yacoub , was the third Almohad Muslim Caliph. Succeeding his father, al-Mansur reigned from 1184 to 1199. His reign was distinguished by the flourishing of trade, architecture, philosophy and the sciences, as well as by victorious military campaigns in which he was successful in repelling the tide of Christian Reconquista in the Iberian Peninsula.', 'title': 'Abu Yusuf Yaqub al-Mansur'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Harthama ibn A'yan( died June 816) was a Khurasan- born general and governor of the early Abbasid Caliphate, serving under the caliphs al- Hadi, Harun al- Rashid and al- Ma'mun. He played an important role in the victory of al- Ma'mun in the Abbasid civil war, but was executed at his orders when he protested against the power of the Sahlid family that dominated his court.", 'title': "Harthama ibn A'yan"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Muhammad Ben Idris Al- Thani Ben Idris Al- Awal Ben Abdellah Al- Kamel known as Muhammad ibn Idris was one of the sons and successor of Idris II of Morocco. He took power in 828 and died in 836.', 'title': 'Muhammad ibn Idris'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ṭāhir ibn Ḥusayn(" Tâhereben Hoseyn Tahir bin al- Husayn"), also known as Dhul- Yamīnayn(" the ambidextrous"), and al- Aʿwar(" the one- eyed"), was an Iranian general and governor during the Abbasid caliphate. Specifically, he served under al- Ma\'mun during the Fourth Fitna and led the armies that would defeat al- Amin, making al- Ma\'mun the" caliph". He was then rewarded as governor of Khorasan, which marked the beginning of the Tahirid dynasty.', 'title': 'Tahir ibn Husayn'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Abu al-Ala Idris al-Ma’mun ("Abū Al-`lā Al-Mā\'mūn Idrīs ibn Al-Manṣūr"; died 16 or 17 October 1232) was an Almohad rival caliph who reigned in part of the empire from 1229 until his death. He was a son of Abu Yusuf Yaqub al-Mansur and brother of Muhammad al-Nasir and Abdallah al-Adil. At the death of Abdallah, a civil war broke out between Idris and his nephew Yahya, who had the support of the capital Marrakesh. Idris asked Ferdinand III of Castile for help, receiving 12,000 knights who allowed him to conquer that city and to massacre the sheikhs that had supported Yahya. Idris abandoned the Mahdi doctrine, in favour of the Sunni one. He went so far as to claim that the Mahdi was Jesus and not Ibn Tumart, the founder of his dynasty. This sacrilege caused the break away of the Hafsid dynasty in the Ifriqiya province. Following his victory, Idris honored the treaty with Ferdinand III and allowed the construction of a Christian church in Marrakesh in 1230, which was destroyed two years later by Yahya. The side changes of Idris soon lost him popular consent. In the early 1232, when he was besieging Ceuta, Yahya took the occasion to capture Marrakesh. Idris died during the march to reach the city, and was succeeded by his son Abd al-Wahid II. Idris’ other son was Abu al-Hasan as-Said al-Mutadid.', 'title': "Idris al-Ma'mun"}
