 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Etan Boritzer( born 1950) is an American writer of children ’s literature who is best known for his book" What is God?" first published in 1989. His best selling" What is?" illustrated children\'s book series on character education and difficult subjects for children is a popular teaching guide for parents, teachers and child- life professionals. Boritzer gained national critical acclaim after" What is God?" was published in 1989 although the book has caused controversy from religious fundamentalists for its universalist views. The other current books in the" What is?" series include What is Love?, What is Death?, What is Beautiful?, What is Funny?, What is Right?, What is Peace?, What is Money?, What is Dreaming?, What is a Friend?, What is True?, What is a Family?, What is a Feeling?" The series is now also translated into 15 languages. Boritzer was first published in 1963 at the age of 13 when he wrote an essay in his English class at Wade Junior High School in the Bronx, New York on the assassination of John F. Kennedy. His essay was included in a special anthology by New York City public school children compiled and published by the New York City Department of Education. Boritzer now lives in Venice, California and maintains his publishing office there also. He has helped numerous other authors to get published through" How to Get Your Book Published!" programs. Boritzer is also a yoga teacher who teaches regular classes locally and guest- teaches nationally. He is also recognized nationally as an erudite speaker on" The Teachings of the Buddha."', 'title': 'Etan Boritzer'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Edward Foley( 16 March 1747 – 22 June 1803) was the second son of Thomas, 1st Lord Foley. Like his brother, he was profligate with the great family wealth. His father's will settled the paternal estate at Stoke Edith, Herefordshire together with the manor of Malvern and property bought from Lord Montfort, but limited him to an annuity from the estate, the balance of the income being applied to pay his debts. He married firstly Lady Anne Coventry( daughter of George Coventry, 6th Earl of Coventry) without having children before the marriage was dissolved by Act of Parliament in 1786. In 1790, he married his distant cousin Eliza Maria Foley Hodgetts, by whom he had two sons, Edward Thomas Foley and John Hodgetts Hodgetts- Foley. She was the heiress of the Prestwood estate, formerly owned by Philip Foley. On their marriage, the Stoke Edith estate was settled to go to their eldest son and the Prestwood estate to their second. Edward Foley sat as Member of Parliament for Droitwich from April 1768 to May 1774; then for Worcestershire until his death.", 'title': 'Edward Foley (1747–1803)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Edward Thomas Foley( 21 December 1791 – 30 March 1846), of Stoke Edith, Herefordshire, was an English Tory( and later Conservative) politician. He was the eldest son of Hon. Edward Foley and his wife Eliza Maria Foley Hodgetts and elder brother of John Hodgetts Hodgetts- Foley and inherited the Stoke Edith estate from his father in 1803. He was educated at Brasenose College, Oxford( 1809) and appointed High Sheriff of Herefordshire for 1815 – 16. Foley was one of the Members of Parliament( MP) for Ludgershall from 1826 to 1832 and for Herefordshire from 1832 to 1841.', 'title': 'Edward Thomas Foley'}
