 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Ali ibn al- Husayn ibn Ali ibn Muhammad ibn al- Walid was the ninth Tayyibi Isma\'ili" Dāʿī al- Muṭlaq" in Yemen, from 1268 to his death in 1284. He was the son and chief assistant of the eighth" Dāʿī", al- Husayn ibn Ali, and thus a member of the Banu al- Walid al- Anf family, that dominated the office of" Dāʿī al- Muṭlaq" almost continuously in the 13th to early 16th centuries. During his tenure, Ali moved from his original seat at Sanaa to the Hamdanid fortress of Arus. He returned to Sanaa only after it was recaptured by the Hamdanids, and died there. He was succeeded by Ali ibn al- Husayn ibn Ali ibn Hanzala, the grandson of the sixth" Dāʿī", Ali ibn Hanzala, and son of Ali\'s own" maʾdhūn"( senior deputy).', 'title': 'Ali ibn al-Husayn (Ibn al-Walid)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'ʿ Alī ibn ʿ Īsā ibn Dā\'ūd ibn al- Jarrāḥ( Dayr Qunna, 859 – Baghdad, 1 August 946), was a Persian official of the Abbasid Caliphate. Descended from a family with long history of service in the Abbasid government, he rose to power in the Abbasid court, serving as vizier in 913–917, 918–923, and 927–928. Ali ibn Isa\'s political career, coinciding with the terminal decline of the Abbasid state, was turbulent, marked by a power struggle with his rival Abu\'l- Hasan Ali ibn al- Furat and his supporters, resulting in frequent periods of exile. In contrast to the largesse and extravagance of Ibn al- Furat, Ali ibn Isa was austere and a determined opponent of corruption, which earned him many enemies. Nevertheless, he was later remembered as the" good vizier" for his administrative talent and honesty.', 'title': 'Ali ibn Isa ibn al-Jarrah'}
