 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Ali ibn al- Husayn ibn Ali ibn Hanzala was the tenth Tayyibi Isma\'ili" Dāʿī al- Muṭlaq" in Yemen, from 1284 to his death in 1287. He was the son of al- Husayn, the" maʾdhūn"( senior deputy) to his predecessor, the ninth" Dāʿī", also named Ali ibn al- Husayn, and grandson of the sixth" Dāʿī", Ali ibn Hanzala. Ali and his grandfather belonged to the Banu Hamdan and were the only ones to break the monopoly of the Qurayshi Ibn al- Walid family on the office of" Dāʿī al- Muṭlaq" during the 13th century. He was succeeded by another Ibn al- Walid, Ibrahim ibn al- Husayn.', 'title': 'Ali ibn al-Husayn ibn Ali ibn Hanzala'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Abu'l-Hasan Ali ibn al-Ikhshid  was the third ruler of the autonomous Ikhshidid dynasty, which ruled Egypt, Syria and the Hejaz for Abbasid Caliphate. He was a younger son of the dynasty's founder, Muhammad ibn Tughj al-Ikhshid, and reigned from the death of his elder brother Unujur in 961. Actual power throughout his reign was held by the capable black eunuch Abu'l-Misk Kafur. The main events of his reign were a Nubian invasion in 963, as well as a resurgence of Bedouin unrest and raids both in the Western Desert and in the Syrian Desert, in the latter case accompanied by the reappearance of the Qarmatians. Anti-Christian riots were provoked by a defeat of the Ikhshidid fleet against the Byzantine navy in 960/963, as well as the Byzantine offensives under Nikephoros Phokas in Cilicia and northern Syria. After Ali's death in January 966, Kafur sidelined Ali's underage son Ahmad and became ruler in his own right. Kafur ruled until his death in 968, when Ahmad succeeded him. The Ikhshidid state was weakened by internal turmoil and a succession of bad harvests, however, leading to its fall to the Fatimids in 969.", 'title': "Abu'l-Hasan Ali ibn al-Ikhshid"}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Abū Bakr Muḥammad ibn Ṭughj ibn Juff ibn Yiltakīn ibn Fūrān ibn Fūrī ibn Khāqān (8 February 882 – 24 July 946), better known by the title al-Ikhshīd  after 939, was an Abbasid commander and governor who became the autonomous ruler of Egypt and parts of Syria (or Levant) from 935 until his death in 946. He was the founder of the Sunni Ikhshidid dynasty, which ruled the region until the Fatimid conquest of 969. The son of Tughj ibn Juff, a general of Turkic origin who served both the Abbasids and the autonomous Tulunid rulers of Egypt and Syria, Muhammad ibn Tughj was born in Baghdad but grew up in Syria and acquired his first military and administrative experiences at his father\'s side. He had a turbulent early career: he was imprisoned along with his father by the Abbasids in 905, was released in 906, participated in the murder of the vizier al-Abbas ibn al-Hasan al-Jarjara\'i in 908, and fled Iraq to enter the service of the governor of Egypt, Takin al-Khazari. Eventually he acquired the patronage of several influential Abbasid magnates, chiefly the powerful commander-in-chief Mu\'nis al-Muzaffar. These ties led him to being named governor first of Palestine and then of Damascus. In 933, he was briefly named governor of Egypt, but this order was revoked after the death of Mu\'nis, and Ibn Tughj had to fight to preserve even his governorship of Damascus. In 935, he was re-appointed to Egypt, where he quickly defeated a Fatimid invasion and stabilized the turbulent country. His reign marks a rare period of domestic peace, stability and good government in the annals of early Islamic Egypt. In 938 Caliph al-Radi granted his request for the title of "al-Ikhshid", which had been borne by the rulers of his ancestral Farghana Valley. It is by this title that he was known thereafter. Throughout his governorship, al-Ikhshid was engaged in conflicts with other regional strongmen for control over Syria, without which Egypt was vulnerable to invasion from the east, but unlike many other Egyptian leaders, notably the Tulunids themselves, he was prepared to bide his time and compromise with his rivals. Although he was initially in control of the entirety of Syria, he was forced to cede the northern half to Ibn Ra\'iq between 939 and 942. Following Ibn Ra\'iq\'s murder, al-Ikhshid reimposed his control over northern Syria, only to have it challenged by the Hamdanids. In 944 al-Ikhshid met Caliph al-Muttaqi at Raqqa; the caliph had fled there from the various strongmen vying to kidnap him and control the caliphal government in Baghdad. Although unsuccessful in persuading the caliph to come to Egypt, he received recognition of hereditary rule over Egypt, Syria and the Hejaz for thirty years. Following his departure, the ambitious Hamdanid prince Sayf al-Dawla seized Aleppo and northern Syria in the autumn of 944, and although defeated and driven out of Syria by Ibn Tughj himself in the next year, a treaty dividing the region along the lines of the agreement with Ibn Ra\'iq was concluded in October. Ibn Tughj died nine months later, leaving his son Unujur as ruler of his domains, under the tutelage of the powerful black eunuch Abu al-Misk Kafur.', 'title': 'Muhammad ibn Tughj al-Ikhshid'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Abu'l- Hasan Ali ibn Ubaydallah Sadiq, commonly known as Ali Daya( علی دایا), was a Tajik commander who served under the early Ghaznavid rulers, but later fell out of favor and was executed.", 'title': 'Ali Daya'}
