 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Andrew Esinhart( December 27, 1838 – ca 1915) was a merchant and political figure in Quebec. He represented La Prairie in the Legislative Assembly of Quebec from 1871 to 1875 as a Conservative. He was born in La Prairie, Lower Canada, the son of Andrew Eisenhart and Charlotte Barbeau, and became a merchant there. Esinhart owned a sawmill at Sainte- Clothilde and also operated a brick factory which failed in 1870. In 1867, he married Marie- Ézelda Valotte. He was defeated by Léon -Benoît- Alfred Charlebois when he ran for reelection to the Quebec assembly in 1875. In 1876, he moved to Iberville, where he owned a general store and grain warehouse. Esinhart was mayor of Iberville from 1882 to 1883. He later moved to the United States, where he died around 1915.', 'title': 'Andrew Esinhart'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Jacob Henry " Ol\' Jake" Eisenhart( October 3, 1922 – December 20, 1987) was an American left- handed pitcher in Major League Baseball who appeared in one game for the Cincinnati Reds in 1944. The 6\'3 ½", 195 lb. left- hander was a native of Perkasie, Pennsylvania. Eisenhart is one of many ballplayers who only appeared in the major leagues during World War II. After attending Juniata College, he was signed by the Reds to a 30- day trial contract, but his only big league action came on June 10, in a home game against the St. Louis Cardinals at Crosley Field. He entered the game with two out in the top of the ninth inning, and the Reds behind 18 – 0. The pitcher he came in to relieve was 15- year- old Joe Nuxhall, who had just made his major league debut. Eisenhart walked the first batter he faced, George Fallon, then got the last out, retiring opposing pitcher Mort Cooper on a foul out. His total major league experience ended up lasting only 1/ 3 of an inning. He was released by the Reds on June 24. Eisenhart also served in the Army during World War II, and toiled three years in the Philadelphia Athletics organization, but never made it back to the major leagues. He died in 1987 in Huntingdon, Pennsylvania.', 'title': 'Jake Eisenhart'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'David Longfen Ji is an American businessman who co-founded Apex Digital, an electronics manufacturer. In 2004, he was arrested in China following a dispute with Sichuan Changhong Electric, a supplier owned by the city of Mianyang and the province of Sichuan. Changhong accused him of defrauding them through bad checks. Ji was taken, according to an account by his lawyer, to the senior management and told, "I decide whether you live or die." He has been held in China without charges. Ji\'s case highlighted an "implicit racism" in dealings with American businessmen. As a U.S. citizen he was not granted the same treatment by authorities as non-ethnically Chinese businessmen sharing the same nationality.', 'title': 'David Ji'}]

