[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Andy Warhol (born Andrew Warhola; August 6, 1928 – February 22, 1987) was an American artist, director, and producer who was a leading figure in the visual art movement known as pop art. His works explore the relationship between artistic expression, advertising, and celebrity culture that flourished by the 1960s, and span a variety of media, including painting, silkscreening, photography, film, and sculpture. Some of his best known works include the silkscreen paintings "Campbell\'s Soup Cans" (1962) and "Marilyn Diptych" (1962), the experimental film "Chelsea Girls" (1966), and the multimedia events known as the "Exploding Plastic Inevitable" (1966–67). Born and raised in Pittsburgh, Warhol initially pursued a successful career as a commercial illustrator. After exhibiting his work in several galleries in the late 1950s, he began to receive recognition as an influential and controversial artist. His New York studio, The Factory, became a well-known gathering place that brought together distinguished intellectuals, drag queens, playwrights, Bohemian street people, Hollywood celebrities, and wealthy patrons. He promoted a collection of personalities known as Warhol superstars, and is credited with inspiring the widely used expression "15 minutes of fame. " In the late 1960s, he managed and produced the experimental rock band The Velvet Underground and founded "Interview" magazine. He authored numerous books, including "The Philosophy of Andy Warhol" and . He lived openly as a gay man before the gay liberation movement. After gallbladder surgery, Warhol died of cardiac arrhythmia in February 1987 at the age of 58. Warhol has been the subject of numerous retrospective exhibitions, books, and feature and documentary films. The Andy Warhol Museum in his native city of Pittsburgh, which holds an extensive permanent collection of art and archives, is the largest museum in the United States dedicated to a single artist. Many of his creations are very collectible and highly valuable. The highest price ever paid for a Warhol painting is US$105 million for a 1963 canvas titled "Silver Car Crash (Double Disaster)"; his works include some of the most expensive paintings ever sold. A 2009 article in "The Economist" described Warhol as the "bellwether of the art market".', 'title': 'Andy Warhol'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Lewis Allan Reed (March 2, 1942 – October 27, 2013) was an American musician, singer, songwriter and poet. He was the rhythm/lead guitarist, singer and principal songwriter for the rock band The Velvet Underground and had a solo career that spanned five decades. The Velvet Underground was not a commercial success during its existence, but became regarded as one of the most influential bands in the history of underground and alternative rock music. After leaving the band in 1970, Reed released twenty solo studio albums. His second, "Transformer" (1972), was produced by David Bowie and arranged by Mick Ronson, and brought mainstream recognition. After "Transformer", the less commercial "Berlin" reached No. 7 on the UK Albums Chart. "Rock \'n\' Roll Animal" (a live album released in 1974) sold strongly, and "Sally Can\'t Dance" (1974) peaked at No. 10 on the "Billboard" 200; but for a long period after, Reed\'s work did not translate into sales, leading him deeper into drug addiction and alcoholism. Reed cleaned up in the early 1980s, and gradually returned to prominence with "New Sensations" (1984), reaching a critical and commercial career peak with his 1989 album "New York". Reed participated in the reformation of the Velvet Underground in the 1990s, and made several more albums, including a collaboration album with John Cale titled "Songs for Drella" which was a tribute to their former mentor Andy Warhol. " Magic and Loss" (1992) would become Reed\'s highest-charting album on the UK Albums Chart, peaking at No. 6. He contributed music to two theatrical interpretations of 19th century writers, one of which he developed into an album titled "The Raven". He married his third wife Laurie Anderson in 2008, and recorded the collaboration album "Lulu" with Metallica. He died in 2013 of liver disease. Reed\'s distinctive deadpan voice, poetic lyrics and experimental guitar playing were trademarks throughout his long career. Reed has been inducted into the Rock and Roll Hall of Fame twice; as a member of the Velvet Underground in 1996 and as a solo act in 2015.', 'title': 'Lou Reed'}
