 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'John Alden Sr. (15981687) was a crew member on the historic 1620 voyage of the Pilgrim ship "Mayflower". Rather than return to England with the ship, he stayed and became a blacksmith at what became Plymouth Colony. He was hired in Southhampton, England, as the ship\'s cooper, responsible for maintaining the ship\'s barrels. He was a signatory to the Mayflower Compact. He married fellow "Mayflower" passenger Priscilla Mullins, whose entire family perished in the first winter. He served in a number of important government positions such as Assistant Governor, Duxbury Deputy to the General Court of Plymouth, Captain Myles Standish\'s Duxbury militia company, a member of the Council of War, Treasurer of Plymouth Colony, and Commissioner to Dartmouth.', 'title': 'John Alden'}
