 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Ottawa High School and Junior High School, located at 526 and 506 S. Main St. respectively, are the historic former high school and junior high school in Ottawa, Kansas. The high school was built in 1917, while the junior high school was built from 1927 to 1928; an enclosed hallway connecting the two buildings was built with the junior high school. The high school was the first school in Ottawa to be built solely as a high school and the eighth school built in Ottawa. George P. Washburn& Son designed the high school in the Collegiate Gothic style. When the junior high school was constructed ten years later, the firm, by then known as Washburn& Stookey, designed the building in the same style as the high school. In 1966, a new high school was built for the upper three classes of students; the freshman class moved to the building in 1976, and the old high school and junior high school became a middle school. The two buildings were connected by a multi-purpose room in the same year. The middle school later vacated the building. The school was added to the National Register of Historic Places on October 6, 2000.', 'title': 'Ottawa High School and Junior High School'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Santa Sabina College( abbreviated as Santa or SSC) is a multi-campus independent Roman Catholic single- sex early learning, primary and secondary day school for girls from Year 5 to Year 12; and a co-educational day school from early learning years through Year K to Year 4. Located on multiple sites in Strathfield, an inner- western suburb of Sydney; and in, in the Southern Highlands of New South Wales, Australia; students are educated in the Dominican tradition. Established in 1894, Santa Sabina has a non-selective enrolment policy and as of 2007 catered to approximately 1,400 students. The College is owned by the Congregation of Dominican Sisters of Eastern Australia and the Solomon Islands and located within the Archdiocese of Sydney. The College is affiliated with the Association of Heads of Independent Schools of Australia( AHISA), the Junior School Heads Association of Australia( JSHAA) and an affiliate member of the Association of Heads of Independent Girls' Schools( AHIGS).", 'title': 'Santa Sabina College'}
