[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Sanjay Gupta (born October 23, 1969) is an American neurosurgeon and medical reporter. He serves as associate chief of the neurosurgery service at Grady Memorial Hospital in Atlanta, Georgia, and as assistant professor of neurosurgery at the Emory University School of Medicine. Gupta is known for his many TV appearances on health-related issues. He is the chief medical correspondent and the host of CNN show Sanjay Gupta MD for which he has won multiple Emmy Awards. He is a frequent contributor to other CNN programs such as "American MorningLarry King Live" and "Anderson Cooper 360°". His reports from Charity Hospital, New Orleans, Louisiana, in the wake of Hurricane Katrina led to him winning a 2006 Emmy Award for "Outstanding Feature Story in a Regularly Scheduled Newscast". He is also a special correspondent for CBS News. In September 2019, Dr. Sanjay Gupta and Marc Hodosh (Co-Creator of TEDMED) announced a new event called Life Itself, set to launch in 2020 in partnership with CNN. Both Gupta and Hodosh will serve as hosts and organizers. In print, Gupta publishes a column in "Time" magazine, and authored a number of best selling books such as "Chasing Life" and "Cheating Death". In April 2019, "Chasing Life" was adapted as a six-show TV miniseries on CNN that took him to Japan, India, Bolivia, Norway, Italy, and Turkey. His novel "Monday Mornings" became an instant "New York Times" bestseller on its release in March 2012. It was adapted as a 2013 television series with David E. Kelley and Gupta serving as executive producers. From 1997 to 1998, he served as one of fifteen White House Fellows, primarily as an advisor to Hillary Clinton. In January 2009, it was reported that Gupta was offered the position of Surgeon General of the United States in the Obama administration, but he withdrew his name from consideration. In January 2011, he was named "one of the 10 most influential celebrities" by "Forbes" magazine