 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'No Highway in the Sky( a.k.a. No Highway) is a 1951 British black- and- white aviation film from 20th Century Fox, produced by Louis D. Lighton, directed by Henry Koster, that stars James Stewart, Marlene Dietrich, Glynis Johns, Niall MacGinnis, Janette Scott, and Jack Hawkins. The screenplay was written by Oscar Millard, with additional material provided by Alec Coppel. The film is based on the novel" No Highway" by Nevil Shute and was one of the first films that depicted a potential aviation disaster involving metal fatigue. Although the film follows the plot of Shute\'s original 1948 novel in general," No Highway in the Sky" notably omits references to the supernatural contained in the original novel, including the use of automatic writing to resolve a key element in the original novel\'s story. The role of Scott, the recently appointed administrator who narrates the novel, is curtailed in the film version, which means that one of the several touching features of the book, Scott\'s blind faith in his scientist, is also missing.', 'title': 'No Highway in the Sky'}
