 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Gertrude Hadley Jeannette (November 28, 1914 – April 4, 2018) was an African American playwright and film and stage actress. She is also known for being the first woman to work as a licensed taxi driver in New York City, which she began doing in 1942. Despite being blacklisted during the Red Scare in the 1950s, she wrote five plays and founded the H.A.D.L.E.Y. Players in Harlem, New York, remaining active in mentoring African-American actors in New York City. In the 1960s and 1970s she appeared in Broadway productions such as "The Long DreamNobody Loves an AlbatrossThe Amen CornerThe Skin of Our Teeth" and "Vieux Carré". She also appeared in films such as "Cotton Comes to Harlem" in 1969, "Shaft" in 1971, and "Black Girl" in 1972. She acted into her 80s and retired from directing theater at the age of 98.', 'title': 'Gertrude Jeannette'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Lawrence Cook( May 7, 1930 – December 27, 2003) was an African- American actor. Cook starred in" The Spook Who Sat by the Door"( 1973). In that film, which was based on the 1969 novel of the same name by Sam Greenlee, Cook portrayed Dan Freeman, a secret black nationalist who is trained by the CIA and later trains and leads black freedom fighters in an uprising against the U.S. government. Before" The Spook Who Sat by the Door", Cook appeared in films such as" Cotton Comes to Harlem"( 1970) and" Trouble Man"( 1972). After" Spook", he appeared in" Colors"( 1988) and" Posse"( 1993), as well as in television series including" Family Matters The Mod SquadColumbo" and" McMillan& Wife". He also appeared as Paul Grant on the daytime soap opera" Days Of Our Lives" in the mid-1970s. Cook died in 2003 in Marina del Rey, California. He was buried in Westwood Village Memorial Park Cemetery.', 'title': 'Lawrence Cook (actor)'}
