 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Catherine de\' Medici (13 April 1519 – 5 January 1589), was an Italian noblewoman who was queen consort of France from 1547 until 1559, by marriage to King Henry II, and Queen mother of kings Francis II, Charles IX and Henry III from 1559 to 1589. The years during which her sons reigned have been called "the age of Catherine de\' Medici" as she had extensive, if at times varying, influence in the political life of France. She was born in Florence to Lorenzo de’ Medici, Duke of Urbino and Madeleine de La Tour d\'Auvergne. In 1533, at the age of fourteen, Catherine married Henry, second son of King Francis I and Queen Claude of France. Catherine\'s marriage was arranged by her uncle Pope Clement VII. Henry excluded Catherine from participating in state affairs and instead showered favors on his chief mistress, Diane de Poitiers, who wielded much influence over him. Henry\'s death thrust Catherine into the political arena as mother of the frail 15-year-old King Francis II. When he died in 1560, she became regent on behalf of her 10-year-old son King Charles IX and was granted sweeping powers. From 1560 to 1563, she ruled France as regent for her son Charles IX, King of France. After Charles died in 1574, Catherine played a key role in the reign of her third son, Henry III. He dispensed with her advice only in the last months of her life (he would outlive her by seven months). Catherine\'s three sons reigned in an age of almost constant civil and religious war in France. The problems facing the monarchy were complex and daunting but Catherine was able to keep the monarchy and the state institutions functioning even at a minimum level. At first, Catherine compromised and made concessions to the rebelling Calvinist Protestants, or Huguenots, as they became known. She failed, however, to grasp the theological issues that drove their movement. Later she resorted, in frustration and anger, to hard-line policies against them. In return, she came to be blamed for the excessive persecutions carried out under her sons\' rule, in particular for the St. Bartholomew\'s Day massacre of 1572, in which thousands of Huguenots were killed in Paris and throughout France. Some historians have excused Catherine from blame for the worst decisions of the crown, though evidence for her ruthlessness can be found in her letters. In practice, her authority was always limited by the effects of the civil wars. Her policies, therefore, may be seen as desperate measures to keep the Valois monarchy on the throne at all costs, and her patronage of the arts as an attempt to glorify a monarchy whose prestige was in steep decline. Without Catherine, it is unlikely that her sons would have remained in power. According to Mark Strage, one of her biographers, Catherine was the most powerful woman in 16th-century Europe.', 'title': "Catherine de' Medici"}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Francis II (19 January 1544 – 5 December 1560) was King of France from 1559 to 1560. He was also King consort of Scotland as a result of his marriage to Mary, Queen of Scots, from 1558 until his death in 1560. He ascended the throne of France at the age of fifteen after the accidental death of his father, Henry II, in 1559. His short reign was dominated by the first stirrings of the French Wars of Religion. Although the royal age of majority had been set at fourteen, his mother, Catherine de' Medici, entrusted the reins of government to his wife's uncles from the House of Guise, staunch supporters of the Catholic cause. They were unable to help Catholics in Scotland against the progressing Scottish Reformation, however, and the Auld Alliance was dissolved. Francis was succeeded by two of his brothers in turn, both of whom were also unable to reduce tensions between Protestants and Catholics.", 'title': 'Francis II of France'}
