 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The place of birth( POB) or birthplace is the place where a person was born. This place is often used in legal documents, together with name and date of birth, to uniquely identify a person. As a general rule with respect to passports, the place of birth is determined to be the country that currently has" sovereignty" over the actual place of birth, regardless of when the birth actually occurred. The place of birth is not necessarily the place where the parents of the new baby live. If the baby is born in a hospital in another place, that place is the place of birth. In many countries, this also means that the government requires that the birth of the new baby is registered in the place of birth. Some countries place less or no importance on the place of birth, instead using alternative geographical characteristics for the purpose of identity documents. For example, Sweden has used the concept of" födelsehemortdomicile of birth") since 1947. This means that the domicile of the baby\'s mother is the registered place of birth. The location of the maternity ward or other physical birthplace is considered unimportant. Similarly, Switzerland uses the concept of" Heimatortlieu d\'origineluogo d\'origineplace of origin" in German, French and Italian respectively). A child born to Swiss parents is automatically assigned the place of origin of the parent with the same last name, so the child either gets their mother\'s or father\'s place of origin. A child born to one Swiss parent and one foreign parent acquires the place of origin of their Swiss parent. In a Swiss passport and identity card, the holder\'s place of origin is stated, not their place of birth. In some countries( primarily in the Americas), the place of birth automatically determines the nationality of the baby, a practice often referred to by the Latin phrase" jus soli". Almost all countries outside the Americas instead attribute nationality based on the nationality( ies) of the baby\'s parents( referred to as" jus sanguinis"). There can be some confusion regarding the place of birth if the birth takes place in an unusual way: when babies are born on an airplane or at sea, difficulties can arise. The place of birth of such a person depends on the law of the countries involved, which include the nationality of the plane or ship, the nationality( ies) of the parents and/ or the location of the plane or ship( if the birth occurs in the territorial waters or airspace of a country). Some administrative forms may request the applicant\'s" country of birth". It is important to determine from the requester whether the information requested refers to the applicant\'s" place of birth" or" nationality at birth". For US citizens born abroad who under the US Constitution acquire US citizenship at the time of birth, the nationality at birth will be USA( American), while the place of birth would be the country in which the actual birth takes place.', 'title': 'Place of birth'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Diana, the Hon. Lady Mosley (17 June 191011 August 2003), born Diana Freeman-Mitford and usually known as Diana Mitford, was one of the Mitford sisters. She was first married to Bryan Walter Guinness, heir to the barony of Moyne, and with whom she was part of the Bright young things social group of Bohemian young aristocrats and socialites in 1920s London. Her marriage ended in divorce as she was pursuing a relationship with Sir Oswald Mosley, 6th Baronet of Ancoats, leader of the British Union of Fascists. She married Mosley at the home of Joseph Goebbels in 1936, with Adolf Hitler as guest of honour. Subsequently, her involvement with Fascist political causes resulted in three years\' internment during the Second World War. She later moved to Paris and enjoyed some success as a writer. In the 1950s she contributed diaries to "Tatler" and edited the magazine "The European". In 1977, she published her autobiography, "A Life of Contrasts", and two more biographies in the 1980s. Her appearance on the BBC\'s Desert Island Discs in 1989 was controversial. She was also a regular book reviewer for "Books & Bookmen" and later at "The Evening Standard" in the 1990s. A family friend, James Lees-Milne, wrote of her beauty, "She was the nearest thing to Botticelli\'s Venus that I have ever seen". She was described as "unrepentant" about her previous political associations by obituary writers such as the historian Andrew Roberts.', 'title': 'Diana Mitford'}
