 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Clink was a prison in Southwark, England, which operated from the 12th century until 1780. The prison served the Liberty of the Clink, a local manor area owned by the Bishop of Winchester rather than by the reigning monarch. As the Liberty owner, the Bishop kept all revenues from the Clink Liberty, and could put people in prison for failing to make their payments. As the Bishop, he could also imprison heretics. The Clink prison was situated next to the Bishop\'s London- area residence of Winchester Palace. The Clink was possibly the oldest men\'s prison and probably the oldest women\'s prison in England. It is uncertain whether the prison derived its name from, or bestowed it on, the Liberty that it served. The origins of the name" The Clink" are possibly onomatopoeic, deriving from the sound of striking metal as the prison\'s doors were bolted, or the rattling of the chains the prisoners wore. The name has become slang as a generic term for prison or a jail cell.', 'title': 'The Clink'}
