 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'René de Saussure( 17 March 1868 – 2 December 1943) was a Swiss Esperantist and professional mathematician( he defended in 1895 a doctoral thesis on a subject in geometry in Geneva), who composed important works about Esperanto and interlinguistics from a linguistic viewpoint. He was born in Geneva, Switzerland. His chef d\'oeuvre is an analysis on the logic of word construction in Esperanto," Fundamentaj reguloj de la vortteorio en EsperantoFundamental rules of word theory in Esperanto"), defending the language against several Idist critiques. He developed the concept of" neceso kaj sufiĉonecessity and sufficience") by which he opposed the criticism of Louis Couturat that Esperanto lacks recursion. In 1907, de Saussure proposed the international currency spesmilo. It was used by the Ĉekbanko esperantista and other British and Swiss banks until the First World War. Beginning in 1919, de Saussure proposed a series of Esperanto reforms, and in 1925, he renounced Esperanto in favor of his language Esperanto II. He later became a consultant for the International Auxiliary Language Association, the linguistic research body that standardized and presented Interlingua. He died on 2 December 1943 in Berne, Switzerland. René was the brother of the famous linguist Ferdinand de Saussure and the scholar of ancient Chinese astronomy, Léopold de Saussure. His father was the famous scientist, Henri Louis Frédéric de Saussure. A new silver Esperanto coin for 100 Steloj was struck in 2018 for the 150th birthday of René de Saussure.', 'title': 'René de Saussure'}
