 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'John Tuchet, 4th Baron Audley, 1st Baron Tuchet (23 April 1371 – 19 December 1408) was an English peer. John Tuchet, 4th Baron Audley was the son of Sir John Tuchet, called "Baron Audley", and his wife Maud, widow of Sir Richard de Willoughby. His paternal grandparents were Sir John Tuchet (1327—1371) and his wife Joan Audley (1331–1393, daughter of James Audley, 2nd Baron Audley and first wife Lady Joan Mortimer). In 1391, when his childless great-uncle Nicholas Audley, 3rd Baron Audley died, the Audley Barony was abeyant. Meanwhile, he was created 1st Baron Tuchet in 1403 and received one-third of the share of the barony of Audley. In 1408 the Barony was revived, and John Tuchet became 4th Baron Audley.\nBefore 1398, he married Elizabeth Stafford, daughter of Sir Humphrey Stafford and his first wife, Alice Grenville. They had one son, James, and two daughters, Margaret and Elizabeth. John was succeeded by his only son, James Tuchet.', 'title': 'John Tuchet, 4th Baron Audley'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'John Talbot Tuchet, 8th Earl of Castlehaven( 2 August 1724 – 22 April 1777) was the son of James Tuchet, 6th Earl of Castlehaven, and his wife, née Elizabeth Arundell. He succeeded his brother as Earl of Castlehaven and Baron Audley on 6 May 1769. He died unmarried, at which time the Earldom of Castlehaven and two of its subsidiary titles( Baron Audley of Orier and Baron Audley of Hely) became extinct as the Irish earldom and baronies were entailed honours. The Barony of Audley created by writ of 1312 is deemed to have devolved upon his nephew, namely George Thicknesse( later Thicknesse- Touchet). George was the son of his sister Elizabeth, who had married Philip Thicknesse', 'title': 'John Tuchet, 8th Earl of Castlehaven'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "John Tuchet, 6th Baron Audley, 3rd Baron Tuchet (1423 – 26 September 1490) was an English politician. John Tuchet was the son of James Tuchet, 5th Baron Audley (c. 1398 - 1459). He married Ann Echyngham (daughter of Sir Thomas Echyngham (died 1444) and Margaret Knyvet, and widow of John Rogers of Bryanston), with whom he had seven children. He acquired his title by writ in 1459 on the death of his father. In 1460 at Calais, then belonging to the English crown, he was taken prisoner by the Earl of Warwick whilst on a military expedition during the Wars of the Roses. He there met the future Edward IV and was persuaded to defect to the Yorkist cause and fought for Edward at the Battles of Mortimer's Cross (1461), Barnet (1471) and Tewkesbury (1471). He was subsequently invested by Edward in 1471 as a Privy Counsellor (PC). He received commissions of Array. He was joint commander of the Army and held the office of Master of the King's Dogs in 1471. He was present when King Edward bestowed the title of Earl of Winchester upon Louis Seigneur de la Gruthuyse in 1472. Richard III appointed him Lord High Treasurer in December 1484, in succession to Sir John Wood. John Tuchet died on 26 September 1490 and was buried at Shere, Surrey. He was succeeded by his eldest son, Sir James Tuchet, 7th Baron Audley (1463–1497). He was survived by his wife Anne, who was buried at Bermondsey and whose will was written in 1497 and proved in 1498.", 'title': 'John Tuchet, 6th Baron Audley'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'George Tuchet, 9th Baron Audley, 6th Baron Tuchet( died 1560) was an English peer. George Tuchet was the son of John Tuchet, 8th Baron Audley( born c. 1483). He married twice; firstly Elizabeth Tuke, daughter of Sir Brian Tuke and secondly Joan Platt at Chester in 1559. He inherited his title by writ in 1557. He died in 1560 and was buried in Westminster, London. He was succeeded by his only son, Henry Tuchet, 10th Baron Audley( died 1563).', 'title': 'George Tuchet, 9th Baron Audley'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'James Tuchet, 7th Baron Audley( c. 1463 – 28 June 1497) was a leading rebel in the 1st Cornish Rebellion of 1497 opposing the rule of Henry VII of England. James Tuchet was born in Heleigh Castle, Staffordshire to John Tuchet, 6th Baron Audley and Anne Echingham. He was sentenced for treason and beheaded with the defeat of the Cornish Rebellion of 1497.', 'title': 'James Tuchet, 7th Baron Audley'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "James Tuchet, 5th Baron Audley, 2nd Baron Tuchet (c. 1398 – 23 September 1459) of Heleigh Castle was an English peer. James Tuchet, 5th Baron Audley, son of Elizabeth Stafford and her husband John Tuchet, 4th Baron Audley, was a distinguished veteran of the Hundred Years' War. In the opening phase of the Wars of the Roses he raised troops from his estates in Cheshire, Shropshire, Staffordshire and Derbyshire and commanded the Lancastrian force that moved to block the Yorkist Earl of Salisbury's route to Ludlow where he intended linking up with the rest of the Yorkist army. The two forces clashed in the Battle of Blore Heath on 23 September 1459 and Audley was killed by Sir Roger Kynaston of Stocks near Ellesmere (Kynaston incorporated emblems of the Audley coat-of-arms into his own). Audley's Cross still stands on the battlefield marking the spot where he died. Audley was buried in Darley Abbey, north of Derby, about away from Blore Heath. Unfortunately, the Abbey no longer stands, so his final resting place is no longer marked.", 'title': 'James Tuchet, 5th Baron Audley'}]

