 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Sancho III (1134 – 31 August 1158), called the Desired ("el Deseado"), was King of Castile and Toledo for one year, from 1157 to 1158. He was the son of Alfonso VII of León and Castile and his wife Berengaria of Barcelona, and was succeeded by his son Alfonso VIII. His nickname was due to his position as the first child of his parents, born after eight years of childless marriage. During his reign, the castle of Calatrava-la-Vieja was conceded to Abbot Raymond Serrat of Fitero, who proposed using the lay brothers of his monastery as knights to defend this castle. These knights would give rise to the Order of Calatrava, which was confirmed in 1164 by Pope Alexander III. It was also in his reign that the Leonese and Castilian spheres of conquest against al-Andalus were decided in the Treaty of Sahagún (May 1158), besides an exclusion of the conquering rights and a possible division of the Portuguese kingdom among the two sons of Alfonso VII, which would come to nothing possibly due to the premature death of Sancho.', 'title': 'Sancho III of Castile'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sancho III(" SanzioSantioSanxoSantzoSantxo", or" Sancio";; Gascon:" Sans"), called Mitarra( from the Arabic for" terror" or" the terrible"), Menditarra( meaning" the mountaineer" in Basque), was the Duke of Gascony in a very obscure period of its history between 864 and 893. He was probably duke from 872 to 887. He is shrouded in mystery and legend, but is regarded as a great fighter of the Reconquista elected to his post as Carolingian power waned by the native Gascons. His genealogy is obscure, but he was probably a son of Sancho II Sánchez. There is much confusion among the sources about the identity of Sancho Mitarra. Some give that sobriquet to Sancho II, while some give it to Sancho III. Some call the latter Mitarra Sancho and call him a son of the former. It seems likely that these two Sanchos are related. Genealogies of a" phantasmagorical" character assign to him a Castilian parentage. During the reign of Sancho III, Gascony became" de facto" independent, owing no allegiance to the King of France. He settled the Vikings at the mouth of the Adour and brought them under control. He was succeeded by either his son( most likely) or his brother, García II Sánchez.', 'title': 'Sancho III Mitarra of Gascony'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Philip of Castile (Seville, 28 May 1292 – Madrid, April 1327), was an "infante of Castile", son of Sancho IV of Castile and María de Molina. He was Lord of Cabrera and Ribera and regent of his nephew Alfonso XI of Castile. He married his cousin Margarita de la Cerda, daughter of Alfonso de la Cerda.', 'title': 'Philip of Castile, Lord of Cabrera and Ribera'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'García Sánchez III( 1012 – 15 September 1054), nicknamed García from Nájera was King of Pamplona from 1034 until his death. He was also Count of Álava and had under his personal control part of the County of Castile. As the eldest son of Sancho III he inherited the dynastic rights over the crown of Pamplona, becoming feudal overlord over two of his brothers: Ramiro, who was given lands that would serve as the basis for the Kingdom of Aragón; and Gonzalo, who received the counties of Sobrarbe and Ribagorza. Likewise, he had some claim to suzerainty over his brother Ferdinand, who under their father had served as Count of Castile, nominally subject to the Kingdom of León but brought under the personal control of Sancho III.', 'title': 'García Sánchez III of Pamplona'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Alfonso VII (1 March 110521 August 1157), called the Emperor ("el Emperador"), became the King of Galicia in 1111 and King of León and Castile in 1126. Alfonso, born Alfonso Raimúndez, first used the title Emperor of All Spain, alongside his mother Urraca, once she vested him with the direct rule of Toledo in 1116. Alfonso later held another investiture in 1135 in a grand ceremony reasserting his claims to the imperial title. He was the son of Urraca of León and Raymond of Burgundy, the first of the House of Ivrea to rule in the Iberian peninsula. Alfonso was a dignified and somewhat enigmatic figure. His rule was characterised by the renewed supremacy of the western kingdoms of Christian Iberia over the eastern (Navarre and Aragón) after the reign of Alfonso the Battler. Though he sought to make the imperial title meaningful in practice to both Christian and Muslim populations, his hegemonic intentions never saw fruition. During his tenure, Portugal became "de facto" independent, in 1128, and was recognized as "de jure" independent, in 1143. He was a patron of poets, including, probably, the troubadour Marcabru.', 'title': 'Alfonso VII of León and Castile'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Alfonso de la Cerda, (Valladolid 1270 - Ávila 1333), called the disinherited, was the elder son of Ferdinand de la Cerda and his wife Blanche of France, and was a grandson of Alfonso X of Castile. Alfonso and his brother Fernando were candidates for the Castilian-Leonese crown during the reigns of Sancho IV of Castile, Ferdinand IV of Castile and Alfonso XI of Castile. In 1331, Alfonso renounced his rights and swore allegiance to Alfonso XI of Castile.', 'title': 'Alfonso de la Cerda'}
