 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Crocodile Dundee( stylized as" Crocodile" Dundee in the U.S.) is a 1986 action comedy film set in the Australian Outback and in New York City. It stars Paul Hogan as the weathered Mick Dundee, and Hogan\'s future wife American actress Linda Kozlowski, whom he first met while working on the film, as reporter Sue Charlton. Inspired by the true- life exploits of Rod Ansell, the film was made on a budget of under$ 10 million as a deliberate attempt to make a commercial Australian film that would appeal to a mainstream American audience, but proved to be a worldwide phenomenon. Released on 30 April 1986 in Australia, and on 26 September 1986 in the United States, it was the highest- grossing film of all- time in Australia, the highest- grossing Australian film worldwide, the second- highest- grossing film in the United States in 1986, the highest- grossing non-US film at the US box office ever and the second- highest- grossing film worldwide for the year. There are two versions of the film: the Australian version, and an international version, which had much of the Australian slang replaced with more commonly understood terms, and was slightly shorter. As the first film in the" Crocodile Dundee" film series, it was followed by two sequels:" Crocodile Dundee II"( 1988) and" Crocodile Dundee in Los Angeles"( 2001), although both films failed to match the critical success of the predecessor.', 'title': 'Crocodile Dundee'}
