 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Crocodile Dundee in Los Angeles( also known as Crocodile Dundee III) is a 2001 action comedy film directed by Simon Wincer and starring Paul Hogan. It is the sequel to" Crocodile Dundee II"( 1988) and the third film of the" Crocodile Dundee" series. Hogan and Linda Kozlowski reprise their roles as Michael" Crocodile" Dundee and Sue Charlton, respectively. The film was shot on location in Los Angeles and in Queensland. Actor Paul Hogan reported that the inspiration for the storyline came during a tour of Litomyšl, Czech Republic in 1993.', 'title': 'Crocodile Dundee in Los Angeles'}
