[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Julia Drusilla (Classical Latin:) (16 September AD 16 – 10 June AD 38) was a member of the Roman imperial family, the second daughter and fifth child of Germanicus and Agrippina the Elder to survive infancy. She had two sisters, Julia Livilla and the Empress Agrippina the Younger, and three brothers, Emperor Caligula, Nero Julius Caesar, and Drusus. She was a great-granddaughter of the Emperor Augustus, grand-niece of the Emperor Tiberius, niece of the Emperor Claudius, and aunt of the Emperor Nero.', 'title': 'Julia Drusilla'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Julia the Younger( Classical Latin:) or Julilla( little Julia), Vipsania Julia Agrippina, Julia, Augustus' granddaughter, or Julia Minor( 19 BC – c. AD 29), was a Roman noblewoman of the Julio- Claudian dynasty. She was the first daughter and second child of Marcus Vipsanius Agrippa and Julia the Elder. Along with her sister Agrippina the Elder, Julia was raised and educated by her maternal grandfather Augustus and her maternal step- grandmother Livia Drusilla. Julia the Younger was the elder granddaughter of the Emperor Augustus, stepdaughter of the Emperor Tiberius, maternal aunt of the Emperor Caligula and Empress Agrippina the Younger, second cousin of the Emperor Claudius, and maternal great- aunt of the Emperor Nero.", 'title': 'Julia the Younger'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Agrippina the Elder (Latin:"Vipsania Agrippina"; Classical Latin: ; c. 14 BC – AD 33), commonly referred to as "Agrippina the Elder" (Latin: "Agrippina Maior"), was a prominent member of the Julio-Claudian dynasty. She was born in c. 14 BC the daughter of Marcus Vipsanius Agrippa, a close supporter of Rome\'s first emperor Augustus, and Augustus\' daughter Julia the Elder. At the time of her birth, her brothers Lucius and Gaius were the adoptive sons of Augustus and were his heirs until their deaths in AD 2 and 4, respectively. Following their deaths, her cousin Germanicus was made the adoptive son of Tiberius as part of Augustus\' succession scheme in the adoptions of AD 4 in which Tiberius was adopted by Augustus. As a corollary to the adoption, Agrippina was wed to Germanicus in order to bring him closer to the Julian family. She is known to have traveled with him throughout his career, taking her children everywhere they went. In AD 14, Germanicus was deployed in Gaul as governor and general. While there, the late Augustus sent her son Gaius to her unspecified location. She liked to dress him in a little soldiers\' outfit complete with boots for which Gaius earned the nickname "Caligulalittle soldier\'s boots"). After three years in Gaul they returned to Rome and her husband was awarded a triumph on 26 May AD 17 to commemorate his victories. The following year, Germanicus was sent to govern over the eastern provinces. While Germanicus was active in his administration, the governor of Syria Gnaeus Calpurnius Piso began feuding with him. During the feud, her husband died of illness on 10 October AD 19. Germanicus was cremated in Antioch and she transported his ashes to Rome where they were interred at the Mausoleum of Augustus. Agrippina was vocal in claiming her husband was murdered to promote Tiberius\' son Drusus Julius Caesar ("Drusus the Younger") as heir. Following the model of her grandmother Livia, she spent the time following Germanicus\' death supporting the cause of her sons Nero and Drusus Caesar. This put her and her sons at odds with the powerful Praetorian prefect Lucius Aelius Sejanus who would begin eliminating their supporters with accusations of treason and sexual misconduct in AD 26. Her family\'s rivalry with Sejanus would culminate with her and Nero\'s exile in AD 29. Nero was exiled to Pontia and she was exiled to the island of Pandateria, where she would remain until her death by starvation in AD 33.', 'title': 'Agrippina the Elder'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Lamman Rucker( born October 6, 1971) is an American actor. Rucker began his career on the daytime soap operas" As the World Turns" and" All My Children", before roles in Tyler Perry\'s films " Why Did I Get Married? Why Did I Get Married Too?", and" Meet the Browns", and its television adaptation. In 2016, he began starring as Jacob Greenleaf in the Oprah Winfrey Network drama series," Greenleaf".', 'title': 'Lamman Rucker'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sextus Afranius Burrus( born AD 1 in Vasio, Gallia Narbonensis; died AD 62) was a prefect of the Praetorian Guard and was, together with Seneca the Younger, an advisor to the Roman emperor Nero, making him a very powerful man in the early years of Nero\'s reign. Agrippina the Younger chose him as Prefect in 51 to secure her son Nero\'s place as emperor after the death of Claudius. For the first eight years of Nero\'s rule, Burrus and Nero\'s former tutor Seneca helped maintain a stable government. Burrus acquiesced to Nero\'s murder of Agrippina the Younger but lost his influence over Nero anyway. He died in 62, some say from poison. The cognomen" Burrus" is the Latin version of the name Pyrrhus, king of Epirus.', 'title': 'Sextus Afranius Burrus'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Richard Timothy Jones( born January 16, 1972) is an American actor. Jones is best known for his portrayals of Laveinio in the dramatic film" The Wood"( 1999) and Mike of the dramatic films" Why Did I Get Married?"( 2007) and" Why Did I Get Married Too?"( 2010). He is also well known for his role as Bruce Van Exel, court services officer on the CBS television series" Judging Amy" that aired from 1999 to 2005.', 'title': 'Richard T. Jones'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Antonia Minor, also known as Julia Antonia Minor, Antonia the Younger or simply Antonia( 31 January 36 BC- 1 May AD 37) was the younger of two daughters of Mark Antony and Octavia Minor. She was a niece of the Emperor Augustus, sister of Cleopatra Selene II, sister- in- law of the Emperor Tiberius, paternal grandmother of the Emperor Caligula and Empress Agrippina the Younger, mother of the Emperor Claudius, and both maternal great- grandmother and paternal great- aunt of the Emperor Nero. She was additionally the maternal great- aunt of the Empress Valeria Messalina and Faustus Cornelius Sulla Felix, the paternal grandmother of Claudia Antonia, Claudia Octavia, and Britannicus and the maternal grandmother of Julia Livia and Tiberius Gemellus.', 'title': 'Antonia Minor'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'He is the younger brother of Thomas Gravesen.', 'title': 'Peter Gravesen'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Acerronia Polla was a servant and friend of Agrippina the Younger, the mother of Nero. She was drowned in AD 59, when an unsuccessful attempt was made at the same time to drown Agrippina. She may have been the daughter of Gnaeus Acerronius Proculus, consul in AD 37. Tacitus' account indicates that Agrippina the Younger had set sail on a cruise on which Nero had secreted conspirators intent on killing her. Agrippina and Acerronia, along with the steersman Crepereius Gallus, were underneath a canopy on deck which had been secretly weighted with lead. At a given signal, the canopy fell, killing the steersman, but missing Agrippina and Acerronia because of the high- backed couch they had been sitting on. There had been a mechanism designed to scuttle the ship, although it malfunctioned, and the conspirators failed in their further efforts to sink the craft. Meanwhile, Agrippina and Acerronia entered the water. Acerronia called out, claiming that she was Agrippina. The conspirators struck her with poles and oars until she had either been bludgeoned to death or drowned. Agrippina, wounded in the shoulder, managed to swim to a passing fishing boat. The account of Cassius Dio is fundamentally the same, although he does indicate that the boat was in fact scuttled, and that Acerronia drowned. He also mentions nothing about Agrippina being rescued by a passing boat, and instead claims she swam all the way to shore on her own.", 'title': 'Acerronia Polla'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Agrippina the Younger (Latin: "Julia Agrippina"; 6 November AD 15 – 23 March AD 59), also referred to as Agrippina Minor ("smaller", often used to mean "younger") was a Roman empress and one of the more prominent women in the Julio-Claudian dynasty. Her father was Germanicus, a popular general and one-time heir apparent to the Roman Empire under Tiberius; and her mother was Agrippina the Elder, a granddaughter of the first Roman emperor Augustus. She was also the younger sister of Caligula, as well as the niece and fourth wife of Claudius. Both ancient and modern sources describe Agrippina\'s personality as ruthless, ambitious, violent, and domineering. Physically she was a beautiful and reputable woman; according to Pliny the Elder, she had a double canine in her upper right jaw, a sign of good fortune. Many ancient historians accuse Agrippina of poisoning her husband Claudius, though accounts vary. She briefly served as the de facto ruler of Rome during the reign of her son, emperor Nero. In AD 59 Agrippina was executed on the orders of Nero.', 'title': 'Agrippina the Younger'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Captain from Köpenick, also known as I Was a Criminal and Passport to Heaven, is a 1945 American comedy film directed by Richard Oswald and based upon the play" The Captain of Köpenick" by Carl Zuckmayer and Albright Joseph. The play was based on the true story of Wilhelm Voigt, a German ex-convict who masqueraded as a Prussian military officer in 1906 and became famous as the Captain of Köpenick. " The Captain from Köpenick" was Oswald\'s second film version of the story; the first was a 1931 German film also called" The Captain from Köpenick". In the intervening years Oswald had fled Nazi Germany for France, then the United States; this was his first American film. It was completed in 1941, but due to difficulty finding a distributor, it was not released until 1945.', 'title': 'The Captain from Köpenick (1945 film)'}
