 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Bryan Jay Singer( born September 17, 1965) is an American director, producer and writer of film and television. He is the founder of Bad Hat Harry Productions and has produced or co-produced almost all of the films he has directed. Singer got childhood friend Ethan Hawke to star in his first short film in 1988 after graduating from the University of Southern California. On the basis of that film he received financing for his next film," Public Access"( 1993), which was a co-winner of the Grand Jury Prize at the 1993 Sundance Film Festival. In the mid-1990s, Singer received critical acclaim for directing the neo-noir crime thriller" The Usual Suspects"( 1995), which starred Gabriel Byrne, Kevin Spacey, Stephen Baldwin, and Benicio del Toro. He followed this with another thriller," Apt Pupil"( 1998), an adaptation of a Stephen King novella about a boy\'s fascination with a Nazi war criminal. In the 2000s, he became known for big budget superhero films such as" X- Men"( 2000), for which Singer won the 2000 Saturn Award for Best Direction, its sequel" X2"( 2003), and" Superman Returns"( 2006). He then directed the World War II historical thriller" Valkyrie"( 2008), co-wrote/ co- produced( 2011), and directed the fantasy adventure film" Jack the Giant Slayer"( 2013), as well as two more" X- Men" films,( 2014) and( 2016). Singer directed the Queen biopic" Bohemian Rhapsody"( 2018). Since 1997, a number of boys and men have alleged that Singer sexually assaulted them as minors. Singer has denied all of the allegations.', 'title': 'Bryan Singer'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Jack the Giant Slayer( previously titled Jack the Giant Killer) is a 2013 American fantasy adventure film directed and co-produced by Bryan Singer and written by Darren Lemke, Christopher McQuarrie and Dan Studney, from a story by Lemke and David Dobkin. The film, based on the British fairy tales" Jack the Giant Killer" and" Jack and the Beanstalk", stars Nicholas Hoult, Eleanor Tomlinson, Stanley Tucci, Ian McShane, Bill Nighy, and Ewan McGregor. The film tells the story of Jack, a young farmhand who must rescue a princess from a race of giants after inadvertently opening a gateway to their land in the sky. Development of" Jack the Giant Slayer" began in 2005, when Lemke first pitched the idea. D. J. Caruso was hired to direct the film in January 2009, but in September of that year, Caruso was replaced by Singer, who hired McQuarrie and Studney to rework the script. The main characters were cast between February and March 2011, and principal photography began in April 2011 in England with locations in Somerset, Gloucestershire and Norfolk. Release of the film was moved back in post-production to allow more time for special effects and marketing. " Jack the Giant Slayer" premiered on February 26, 2013 in Hollywood and was released theatrically in the United States on March 1, 2013, receiving mixed reviews from critics and was a box office flop.', 'title': 'Jack the Giant Slayer'}
