 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Hibbert Newton Binney (1766–1842) was a soldier in the Royal Nova Scotia Volunteer Regiment in the American Revolution. He became a member of the Nova Scotia Council. He was also a painter who created some of the earliest images of the Mi'kmaq people. He was the grandson of Henry Newton and the son of Jonathan Binney who was a signatory to one of the Halifax Treaties with the Mi'kmaq. Hibbert is buried in the Old Burying Ground (Halifax, Nova Scotia). There is a mural tablet at St. Paul's Church (Halifax) to his son commander Lieut. John Binney and 11 crew of the mail packet brig Star, that all died at sea. Hibbert was the His grandfathers were Henry Newton (politician) and Bishop Hibbert Binney. He was also the son-in-law of John Creighton (judge).", 'title': 'Hibbert Newton Binney'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Henry Newton (1731 – January 29, 1802) was a political figure in Nova Scotia. He was a member of the 1st General Assembly of Nova Scotia from 1758 to 1760. He was the son of Hibbert Newton, member of the Nova Scotia Council and collector of customs for Nova Scotia at Annapolis Royal, Nova Scotia, and Hannah Adams, the daughter of John Adams, a member of the Legislative Council. Newton was customs collector for Halifax. He first married Charlotte, the daughter of Benjamin Green. After the death of his first wife, Newton married Anne Stuart, the daughter of painter Gilbert Stuart. In 1763, he was named to the province's Legislative Council. He died in Halifax. His sister Hannah Adams Newton married Jonathan Binney and his brother John also served in the Nova Scotia assembly. Newton's son was Gilbert Stuart Newton who became a British painter. Newton's grandson was Hibbert Newton Binney.", 'title': 'Henry Newton (politician)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Marcus Hugh Crofton Binney( born Simms; 21 September 1944) is a British architectural historian and author. He is best known for his conservation work regarding Britain's heritage.", 'title': 'Marcus Binney'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Stephen Binney( March 24, 1805 – January 17, 1872) was a merchant, shipbuilder and political figure in Nova Scotia. He was the first mayor of Halifax, serving from 1841 to 1842. He was born in Halifax, the son of Hibbert Newton Binney, who was the son of Jonathan Binney, and Lucy Creighton. He married Emily Pryor in 1828. In 1841, after having been elected mayor, he clashed with Lieutenant- Governor Lord Falkland during the visit of a prince of the House of Orleans. Binney travelled to England in January 1842, authorized to deliver a congratulatory address on behalf of the city council on the birth of a son, later King Edward VII, to Queen Victoria. Edward Kenny was named as his replacement in March of the same year after Binney's leave of absence expired. During his visit to England, Binney's business interests in Halifax suffered financial problems. In 1843, Binney purchased land in Lewisville near Moncton which included a wharf and a shipyard and built his home there. He established himself as a wholesale merchant, dealing in lumber, flour, and feed. In 1850, Binney was among those supporting a route for the Intercolonial Railway which passed through Moncton.", 'title': 'Stephen Binney'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Jonathan Binney (January 7, 1723 – October 8, 1807) was a merchant, judge and political figure in Nova Scotia. He was a member of the 1st Nova Scotia House of Assembly from 1758 to 1764. He arrived in Nova Scotia in 1753. His father-in-law was Henry Newton (politician). Binney was buried, along with his two sons Stephen and Hibbert, in the Old Burying Ground (Halifax, Nova Scotia). He was born in Hull, Massachusetts, the son of Thomas Binney and Margaret Miller, and went into business in Boston. Binney married Martha Hall in 1746 and they had a child Stephen Hall. Martha died and Jonathan moved to Halifax, leaving his only child in Boston. There he married Hannah Adams Newton and they had another son they named Stephen Hall. Two days later, Jonathan's first son, also named Stephen Hall, died in Boston at age 11 and was buried at King's Chapel.\nJonathan and Joseph Frederick Wallet DesBarres met the Mi'kmaw chiefs at Arichat, Nova Scotia, in 1761, and concluded a lasting peace. Binney was named to the province's Council in 1764. In the same year, he was appointed collector of provincial duties and magistrate at Canso. In 1768, he became customs collector and judge for St. John's Island (later Prince Edward Island). He was named judge in the Inferior Court of Common Pleas for Halifax County in 1772. When Francis Legge became lieutenant governor, he had Binney and his family arrested because Binney often paid himself first with the funds collected on behalf of the government. Binney successfully brought his case against Legge before the Board of Trade in London and his debts were forgiven by the Nova Scotia assembly. In 1784, Binney was accused of certifying New England fisherman as Nova Scotians so that he could sell them fishing licenses. He died in Halifax leaving his belongings to his two sons Hibbert and Stephen.", 'title': 'Jonathan Binney'}
