 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Friedrich Gottlob Uhlemann (26 November 1792 in Zeitz – 19 April 1864) was a German Protestant theologian and educator best known as the author of orientalist grammatical works. In 1815 he received his PhD from the University of Leipzig, where he was a student of Ernst Friedrich Karl Rosenmüller. Following graduation he worked for several years as a private tutor to the family of Friedrich Graf Kleist von Nollendorf. From 1822 up until his death in 1864 he was a teacher at the Friedrich Wilhelm Gymnasium in Berlin. Concurrently, he passed his habilitation for theology at the University of Berlin (1823), where in 1835 he was named an associate professor of theology. In 1839 he received an honorary doctorate in theology from the University of Leipzig.', 'title': 'Friedrich Gottlob Uhlemann'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Max Uhlemann, in full Maximilian Adolph Uhlemann (died 1862) was a German Egyptologist who in 1853 published the third Latin translation of the Egyptian hieroglyphic text of the Rosetta Stone inscription. He was the son of Friedrich Gottlob Uhlemann, who taught theology at the universities of Berlin and Leipzig. Max Uhlemann\'s research at Leipzig, where he initially studied history and archaeology and eventually specialised in ancient Egypt and its literature, led to a doctorate in 1851. Gustav Seyffarth was among his teachers at Leipzig. In 1853, apart from his work on the Rosetta Stone, he also completed and published a Coptic grammar. From 1854 until his early death in 1862 he was a lecturer ("Privatdozent") in Egyptian language and literature at the Universität Göttingen. His "Drei Tage in Memphis" (1856) was an early attempt to describe everyday life in ancient Egypt for a general audience; an English translation, "Three Days in Memphis", appeared in 1858. This was followed by a historical novel, "Der letzte der RamessidenThe Last of the Ramessids"), which ran to two editions in 1860 and 1863.', 'title': 'Max Uhlemann'}
