 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Ruth Carolyn Ziolkowski( née Ross; June 26, 1926 – May 21, 2014) was an American executive and CEO of the Crazy Horse Memorial, a South Dakota monument dedicated to Crazy Horse which was designed by her late husband, Korczak Ziolkowski. Ruth Ziolkowski took over the responsibility for the construction of the monument following the death of her husband in 1982. Korczak Ziolkowski had been focusing on the completion of Crazy Horse's horse at the time of his death. Ruth Ziolkowski changed course, ordering that Crazy Horse's face be completed instead. She hoped that the monument would become a tourist magnet once his 87.5- foot face was finished, providing needed funding for the project. Her prediction proved correct upon the face's completion in 1998 and the statue quickly became one of South Dakota's top tourist attractions. She oversaw the growth, expansion and progress at the Crazy Horse Memorial from the 1980s to the 2010s.", 'title': 'Ruth Ziolkowski'}
