 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Humphrey de Bohun, 7th Earl of Hereford, 6th Earl of Essex, 2nd Earl of Northampton, KG( 25 March 1341 – 16 January 1373) was the son of William de Bohun, 1st Earl of Northampton and Elizabeth de Badlesmere, and grandson of Humphrey de Bohun, 4th Earl of Hereford by Elizabeth of Rhuddlan, daughter of King Edward I. He became heir to the Earldom of Hereford after the death of his childless uncle Humphrey de Bohun, 6th Earl of Hereford. Following King Peter I's visit to England, Humphrey participated in the sack of Alexandria in 1365. His wife and the mother of his daughters was Joan Fitzalan, daughter of Richard Fitzalan, 10th Earl of Arundel and Eleanor of Lancaster, whom he married after 9 September 1359. On his death, his great estates were divided between his two surviving daughters:", 'title': 'Humphrey de Bohun, 7th Earl of Hereford'}
