 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Humphrey Stafford, 1st Duke of Buckingham, 6th Earl of Stafford, (December 1402 – 10 July 1460) was an English nobleman and a military commander in the Hundred Years' War and the Wars of the Roses. Through his mother he had royal descent from King Edward III, his great-grandfather, and from his father, he inherited, at an early age, the earldom of Stafford. By his marriage to a daughter of Ralph, Earl of Westmorland, Humphrey was related to the powerful Neville family and to many of the leading aristocratic houses of the time. He joined the English campaign in France with King Henry V in 1420 and following Henry V's death two years later he became a councillor for the new King, the nine-month-old Henry VI. Stafford acted as a peacemaker during the partisan, factional politics of the 1430s, when Humphrey, Duke of Gloucester, vied with Cardinal Beaufort for political supremacy. Stafford also took part in the eventual arrest of Gloucester in 1447. Stafford returned to the French campaign during the 1430s and for his loyalty and years of service, he was elevated from Earl of Stafford to Duke of Buckingham. Around the same time, his mother died. As much of his estate—as her dower—had previously been in her hands, Humphrey went from having a reduced income in his early years to being one of the wealthiest and most powerful landowners in England. His lands stretched across much of the country, ranging from East Anglia to the Welsh border. Being such an important figure in the localities was not without its dangers and for some time he feuded violently with Sir Thomas Malory in the Midlands. After returning from France, Stafford remained in England for the rest of his life, serving King Henry. He acted as the King's bodyguard and chief negotiator during Jack Cade's rebellion of 1450, helping to suppress it. When the King's cousin, Richard, Duke of York, rebelled two years later, Stafford investigated York's followers. In 1453, the King became ill and sank into a catatonic state; law and order broke down further and when civil war began in 1455, Stafford fought for the King in the First Battle of St Albans which began the Wars of the Roses. Both were captured by the Yorkists and Stafford spent most of his final years attempting to mediate between the Yorkist and Lancastrian factions, the latter by now headed by Henry's wife, Margaret of Anjou. Partly due to a feud with a leading Yorkist—Richard Neville, Earl of Warwick—Stafford eventually declared for King Henry and the Duke of York was defeated in 1459, driving York into exile. When the rebels returned the following year they attacked the royal army at Northampton. Acting as the King's personal guard in the ensuing struggle, Stafford was killed and the King was again taken prisoner. Stafford's eldest son had died of plague two years earlier and the Buckingham dukedom descended to Stafford's five-year-old grandson, Henry, a ward of the King until he came of age in 1473.", 'title': 'Humphrey Stafford, 1st Duke of Buckingham'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Edmund Stafford, 5th Earl of Stafford and 1st Baron Audley, KB, KG( 2 March 1377 – 21 July 1403) was the son of Hugh de Stafford, 2nd Earl of Stafford and Philippa de Beauchamp. He inherited the earldom at the age of 18, the third of three out of four brothers to inherit the title. His eldest brother, Sir Ralph, died before inheriting the title and his other two elder brothers died without issue.', 'title': 'Edmund Stafford, 5th Earl of Stafford'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Humphrey Stafford, 1st Earl of Devon(" ca." 143917 August 1469) was a dominant magnate in south- western England in the mid-15th century, and a participant in the Wars of the Roses. A distant relative of the earls of Stafford, Humphrey Stafford became the greatest landowner in the county of Dorset through fortunes of inheritance. Later, Stafford was one of several men promoted rapidly through the nobility by King Edward IV, to fill the power vacuum left by dead or forfeit Lancastrians. In the West Country it was particularly the forfeitures of the Lancastrian Courtenay family that benefited Stafford. In 1469 he received the Courtenay title of Earl of Devon. Stafford held the comital title for only three months. In July he was sent north to quell a rebellion instigated by the discontented Earl of Warwick. Even though he escaped the disastrous Battle of Edgecote, he was lynched by a mob at Bridgwater on 17 August 1469. Considered an overambitious man by many, Stafford was nevertheless a capable administrator, who enjoyed the absolute confidence of the king.', 'title': 'Humphrey Stafford, 1st Earl of Devon'}
