 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Susanna Leveson- Gower, Marchioness of Stafford( née Lady Susanna Stewart)( 1742 – 1805), styled Lady Susanna Stewart from 1742 to 1768, Countess Gower until 1786, Marchioness of Stafford until 1803 and Dowager Marchioness of Stafford until her death in 1805, was a British noblewoman, who in 1768 became the wife of Granville Leveson- Gower, 1st Marquess of Stafford and a member of the Leveson- Gower family.', 'title': 'Susanna Leveson-Gower, Marchioness of Stafford'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'John Stafford, 1st Earl of Wiltshire,( 24 November 1427 – 8 May 1473) was an English nobleman, the youngest son of Humphrey Stafford, 1st Duke of Buckingham. In 1461 he was appointed Knight of the Order of the Bath.', 'title': 'John Stafford, 1st Earl of Wiltshire'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Thomas Stafford, 3rd Earl of Stafford (c. 1368–4 July 1392) was the second son—but the senior surviving heir—of Hugh Stafford, 2nd Earl of Stafford and Philippa de Beauchamp, daughter of Thomas de Beauchamp, 11th Earl of Warwick. His elder brother, his father's heir, Sir Ralph Stafford, was murdered by Richard II's half-brother, the earl of Huntingdon whilst they were campaigning in Scotland in July 1385. As a result, Thomas became heir to the earldom of Stafford, and in 1390 he was knighted. He gained livery of his estates in 1391 and paid homage to the king for them on 20 October that year. He spent his short career campaigning in France alongside the duke of Gloucester. Thomas Stafford married Anne, daughter of Thomas, Duke of Gloucester around 1390. He died on 4 July 1392 in Westminster, and was interred in Stone, with his father; his widow, Anne, with whom he had had no children, married his youngest brother Edmund Stafford, 5th Earl of Stafford.", 'title': 'Thomas Stafford, 3rd Earl of Stafford'}]

