 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Charles B. Pierce( June 16, 1938 – March 5, 2010) was an American film director, screenwriter, producer, set decorator, cinematographer and actor, and is considered one of the first modern independent filmmakers. Pierce directed thirteen films over the span of 26 years, but is best known for his cult hits" The Legend of Boggy Creek"( 1973) and" The Town That Dreaded Sundown"( 1976). An Arkansas resident most of his life, Pierce made his directorial debut with" Boggy Creek", a faux documentary- style film inspired by the legend of the Bigfoot- like Fouke Monster. The low- budget film grossed roughly$ 25 million, and Pierce followed that success with several inexpensive, regional films set in the southern United States, including" The Town That Dreaded Sundown", based on the true story of the Phantom Killer murders in Texarkana. Pierce continued directing films into the 1980s, when he wrote the story for the Clint Eastwood film" Sudden Impact". For that screenplay, he is said to have written the phrase," Go ahead, make my day," which became one of the most famous movie quotes in history. After years of pressure from producers, Pierce directed a" Boggy Creek" sequel,, which he considered the worst film of his career; it was later riffed on by the comedy television series" Mystery Science Theater 3000".', 'title': 'Charles B. Pierce'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Town That Dreaded Sundown is a 2014 American slasher film, a meta-sequel to the 1976 film of the same name. Directed by Alfonso Gomez-Rejon in his feature-length directorial debut, the film was written by Roberto Aguirre-Sacasa and produced by Jason Blum and Ryan Murphy. The film stars Addison Timlin, Travis Tope, Spencer Treat Clark, Veronica Cartwright and Gary Cole and was one of the last films of Ed Lauter and Edward Herrmann before their deaths in October 2013 and December 2014, respectively. The film was released on October 16, 2014 by Orion Pictures to positive reviews. As of February 2019, the film has grossed over $100k through video sales.', 'title': 'The Town That Dreaded Sundown (2014 film)'}
