 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Roger de Mortimer, 4th Earl of March( 11 April 137420 July 1398) was an English nobleman. He was considered the heir presumptive to his cousin King Richard II. Roger Mortimer's father, the 3rd Earl of March, died in 1381, leaving the six- year- old Roger to succeed to his father's title. Roger was placed under the wardship of Thomas Holland, 2nd Earl of Kent and eventually married Holland's daughter Alianore. During his lifetime, Mortimer spent much time in Ireland; he served several tenures as Lord Lieutenant of Ireland and died during a battle at Kellistown, Co. Carlow. He was succeeded by his young son, Edmund Mortimer, 5th Earl of March.", 'title': 'Roger Mortimer, 4th Earl of March'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Edmund Mortimer, 5th Earl of March, 7th Earl of Ulster( 6 November 139118 January 1425) was an English nobleman and a potential claimant to the throne of England. A great- great- grandson of King Edward III of England, he was heir presumptive to King Richard II of England, his granduncle, when Richard II was deposed in favour of Henry IV. Edmund Mortimer's claim to the throne was the basis of rebellions and plots against Henry IV and his son Henry V, and was later taken up by the House of York in the Wars of the Roses, though Mortimer himself was an important and loyal vassal of Henry V and Henry VI. Edmund was the last Earl of March of the Mortimer family.", 'title': 'Edmund Mortimer, 5th Earl of March'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Roger Mortimer, 3rd Baron Mortimer, 1st Earl of March (25 April 128729 November 1330), was an English nobleman and powerful Marcher lord who gained many estates in the Welsh Marches and Ireland following his advantageous marriage to the wealthy heiress Joan de Geneville, 2nd Baroness Geneville. In November 1316, he was appointed Lord Lieutenant of Ireland. He was imprisoned in the Tower of London in 1322 for having led the Marcher lords in a revolt against King Edward II in what became known as the Despenser War. He later escaped to France, where he was joined by Edward\'s queen consort Isabella, whom he may have taken as his mistress. After he and Isabella led a successful invasion and rebellion, Edward was deposed; Mortimer allegedly arranged his murder at Berkeley Castle. For three years, Mortimer was "de facto" ruler of England before being himself overthrown by Edward\'s eldest son, Edward III. Accused of assuming royal power and other crimes, Mortimer was executed by hanging at Tyburn.', 'title': 'Roger Mortimer, 1st Earl of March'}
