 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Francisco Pizarro González (– 26 June 1541) was a Spanish conquistador, best known for his expeditions that led to the fall of the Inca Empire and the Spanish conquest of Peru. Born in Trujillo, Spain to a poor family, Pizarro chose to pursue fortune and adventure in th New World. He went to the Gulf of Urabá, and accompanied Vasco Núñez de Balboa in his crossing of the Isthmus of Panama, where they became the first Europeans to reach the Pacific Ocean. He served as mayor of the newly founded Panama City for a few years, and undertook two failed expeditions to Peru. In 1528, Pizarro obtained permission from King Charles I and went on his third expedition to Peru. When hostile natives along the coast threatened the expedition, Pizarro moved inland and founded the first Spanish settlement in Peru, San Miguel de Piura. After a series of maneuvres, Pizrro captured the Incan emperor Atahualpa at the Battle of Cajamarca in November 1532. A ransom for the emperor's release was demanded and Atahualpa filled a room with gold, but Pizarro charged him with various crimes and executed him in July 1533. The same year, Pizarro entered the Inca capital of Cuzco and completed his conquest of Peru. In January 1535, Pizarro founded the city of Lima, a project he considered his greatest achievement. Quarrels between Pizarro and his longtime comrade-in-arms Diego Almagro culminated in the Battle of Las Salinas, after which Almagro was executed. In June 1541, a party led by Almagro's son assassinated Pizarro in Lima. He was laid to rest in the Lima Cathedral.", 'title': 'Francisco Pizarro'}
